INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (1, '2020-06-24 17:26:31', '2020-06-24 17:26:31', null, 'Jetty', 'jetty', 'Jetty is used in a wide variety of projects and products, both in development and production. Jetty can be easily embedded in devices, tools, frameworks, application servers, and clusters. See the Jetty Powered page for more uses of Jetty.', 'https://img.stackshare.io/service/1084/8cyY6D_m.png', 'https://github.com/eclipse/jetty.project', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (2, '2020-06-24 17:26:32', '2020-06-24 17:26:32', null, 'nginx', 'nginx', 'nginx [engine x] is an HTTP and reverse proxy server, as well as a mail proxy server, written by Igor Sysoev. According to Netcraft nginx served or proxied 30.46% of the top million busiest sites in Jan 2018.', 'https://img.stackshare.io/service/1052/YMxUfyWf.png', 'https://github.com/nginx/nginx', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (3, '2020-06-24 17:26:33', '2020-06-24 17:26:33', null, 'Apache Tomcat', 'tomcat', 'Apache Tomcat powers numerous large-scale, mission-critical web applications across a diverse range of industries and organizations.', 'https://img.stackshare.io/service/1187/tomcat.png', 'https://github.com/apache/tomcat', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (4, '2020-06-24 17:26:38', '2020-06-24 17:26:38', null, 'Codeship', 'codeship', 'Codeship runs your automated tests and configured deployment when you push to your repository. It takes care of managing and scaling the infrastructure so that you are able to test and release more frequently and get faster feedback for building the product your users need.', 'https://img.stackshare.io/service/224/avatar_codeship_colour.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (5, '2020-06-24 17:26:39', '2020-06-24 17:26:39', null, 'Jenkins', 'jenkins', 'In a nutshell Jenkins CI is the leading open-source continuous integration server. Built with Java, it provides over 300 plugins to support building and testing virtually any project.', 'https://img.stackshare.io/service/670/jenkins.png', 'https://github.com/jenkinsci/jenkins', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (6, '2020-06-24 17:26:41', '2020-06-24 17:26:41', null, 'Travis CI', 'travis-ci', 'Free for open source projects, our CI environment provides multiple runtimes (e.g. Node.js or PHP versions), data stores and so on. Because of this, hosting your project on travis-ci.com means you can effortlessly test your library or applications against multiple runtimes and data stores without even having all of them installed locally.', 'https://img.stackshare.io/service/460/Lu6cGu0z_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (7, '2020-06-24 17:26:46', '2020-06-24 17:26:46', null, 'Appveyor', 'appveyor', 'AppVeyor aims to give powerful Continuous Integration and Deployment tools to every .NET developer without the hassle of setting up and maintaining their own build server.', 'https://img.stackshare.io/service/2011/5s66pnbt5v8tw6most5e.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (8, '2020-06-24 17:26:51', '2020-06-24 17:26:51', null, 'MySQL', 'mysql', 'The MySQL software delivers a very fast, multi-threaded, multi-user, and robust SQL (Structured Query Language) database server. MySQL Server is intended for mission-critical, heavy-load production systems as well as for embedding into mass-deployed software.', 'https://img.stackshare.io/service/1025/logo-mysql-170x170.png', 'https://github.com/mysql/mysql-server', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (9, '2020-06-24 17:26:51', '2020-06-24 17:26:51', null, 'PostgreSQL', 'postgresql', 'PostgreSQL is an advanced object-relational database management system
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (10, '2020-06-24 17:26:52', '2020-06-24 17:26:52', null, 'SQLite', 'sqlite', 'SQLite is an embedded SQL database engine. Unlike most other SQL databases, SQLite does not have a separate server process. SQLite reads and writes directly to ordinary disk files. A complete SQL database with multiple tables, indices, triggers, and views, is contained in a single disk file.', 'https://img.stackshare.io/service/1071/sqlite.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (11, '2020-06-24 17:26:57', '2020-06-24 17:26:57', null, 'Cockpit', 'cockpit', 'An API-driven CMS without forcing you  to make compromises in how you implement your site. The CMS for developers. Manage content like collections, regions, forms and galleries which you can reuse anywhere on your website.', 'https://img.stackshare.io/service/979/e5b082839e7ec5541016a9813bbeb4b8.png', 'https://github.com/aheinze/cockpit', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (12, '2020-06-24 17:26:57', '2020-06-24 17:26:57', null, 'Directus', 'directus', 'Let''s say you''re planning on managing content for a website, native app, and widget. Instead of using a CMS that''s baked into the website client, it makes more sense to decouple your content entirely and access it through an API or SDK. That''s a headless CMS. That''s Directus.', 'https://img.stackshare.io/service/5733/I0Ix_KWZ.jpg', 'https://github.com/directus/directus', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (13, '2020-06-24 17:26:57', '2020-06-24 17:26:57', null, 'Highrise', 'highrise', 'Highrise CRM helps you manage your contacts, keep track of who said what when, schedule follow-ups, set reminders, and convert leads into done deals.', 'https://img.stackshare.io/service/34/Highrise.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (14, '2020-06-24 17:27:02', '2020-06-24 17:27:02', null, 'Status.io', 'status-io', 'Our simple, yet feature packed, status pages provide the ultimate truth-of-source for your system''s current status. Skip building a homegrown solution and keep focused on your passion. Our platform will save you tons of time.', 'https://img.stackshare.io/service/1373/statusio_icon.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (15, '2020-06-24 17:27:02', '2020-06-24 17:27:02', null, 'StatusPage.io', 'statuspage-io', 'The #1 status and incident communication tool. Use Statuspage to build trust with every incident. ', 'https://img.stackshare.io/service/279/sp-logo-blue-white-background.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (16, '2020-06-24 17:27:06', '2020-06-24 17:27:06', null, 'ES6', 'es6', 'Goals for ECMAScript 2015 include providing better support for large applications, library creation, and for use of ECMAScript as a compilation target for other languages. Some of its major enhancements include modules, class declarations, lexical block scoping, iterators and generators, promises for asynchronous programming, destructuring patterns, and proper tail calls.', 'https://img.stackshare.io/service/4109/16407404782_8b9c57eab3.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (17, '2020-06-24 17:27:07', '2020-06-24 17:27:07', null, 'Python', 'python', 'Python is a general purpose programming language created by Guido Van Rossum. Python is most praised for its elegant syntax and readable code, if you are just beginning your programming career python suits you best.', 'https://img.stackshare.io/service/993/pUBY5pVj.png', 'https://github.com/python/cpython', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (18, '2020-06-24 17:27:13', '2020-06-24 17:27:13', null, 'Terraform', 'terraform', 'With Terraform, you describe your complete infrastructure as code, even as it spans multiple service providers. Your servers may come from AWS, your DNS may come from CloudFlare, and your database may come from Heroku. Terraform will build all these resources across all these providers in parallel.', 'https://img.stackshare.io/service/1276/terraform.png', 'https://github.com/hashicorp/terraform', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (19, '2020-06-24 17:27:14', '2020-06-24 17:27:14', null, 'troposphere', 'troposphere', 'The troposphere library allows for easier creation of the AWS CloudFormation JSON by writing Python code to describe the AWS resources. troposphere also includes some basic support for OpenStack resources via Heat.', 'https://img.stackshare.io/no-img-open-source.png', 'https://github.com/cloudtools/troposphere', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (20, '2020-06-24 17:27:18', '2020-06-24 17:27:18', null, 'Google BigQuery', 'google-bigquery', 'Run super-fast, SQL-like queries against terabytes of data in seconds, using the processing power of Google''s infrastructure.
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (21, '2020-06-24 17:27:18', '2020-06-24 17:27:18', null, 'Hadoop', 'hadoop', 'The Apache Hadoop software library is a framework that allows for the distributed processing of large data sets across clusters of computers using simple programming models. It is designed to scale up from single servers to thousands of machines, each offering local computation and storage.', 'https://img.stackshare.io/service/1044/elephant_rgb_sq.png', 'https://github.com/apache/hadoop', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (22, '2020-06-24 17:27:23', '2020-06-24 17:27:23', null, 'AngularJS', 'angularjs', 'AngularJS lets you write client-side web applications as if you had a smarter browser. It lets you use good old HTML (or HAML, Jade and friends!) as your template language and lets you extend HTML’s syntax to express your application’s components clearly and succinctly. It automatically synchronizes data from your UI (view) with your JavaScript objects (model) through 2-way data binding.', 'https://img.stackshare.io/service/1019/square.png', 'https://github.com/angular/angular.js', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (23, '2020-06-24 17:27:24', '2020-06-24 17:27:24', null, 'Ionic', 'ionic', 'Free and open source, Ionic offers a library of mobile and desktop-optimized HTML, CSS and JS components for building highly interactive apps. Use with Angular, React, Vue, or plain JavaScript.', 'https://img.stackshare.io/service/876/bYMCvtHD_400x400.jpg', 'https://github.com/driftyco/ionic', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (24, '2020-06-24 17:27:30', '2020-06-24 17:27:30', null, 'Cloud9 IDE', 'cloud9-ide', 'Cloud9 provides a development environment in the cloud. Cloud9 enables developers to get started with coding immediately with pre-setup environments called workspaces, collaborate with their peers with collaborative coding features, and build web apps with features like live preview and browser compatibility testing. It supports more than 40 languages, with class A support for PHP, Ruby, Python, JavaScript/Node.js, and Go.', 'https://img.stackshare.io/service/209/CvjNepWX.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (25, '2020-06-24 17:27:31', '2020-06-24 17:27:31', null, 'Codio', 'codio', 'Every project gets its own Box: an instantly available server-side development environment with full terminal access. With features such as forking, collaboration, importing from Git repos and more, Codio strives to remove as many barriers as possible to create a platform developers will enjoy using as their IDE of choice.', 'https://img.stackshare.io/service/795/gPeKlutZ.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (26, '2020-06-24 17:27:31', '2020-06-24 17:27:31', null, 'Eclipse Che', 'eclipse-che', 'Eclipse Che makes Kubernetes development accessible for developer teams, providing one-click developer workspaces and eliminating local environment configuration for your entire team. ', 'https://img.stackshare.io/service/3263/Screen_Shot_2019-10-03_at_12.35.04_PM.png', 'https://github.com/codenvy/che', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (27, '2020-06-24 17:27:35', '2020-06-24 17:27:35', null, 'AWS CloudFormation', 'aws-cloudformation', 'You can use AWS CloudFormation’s sample templates or create your own templates to describe the AWS resources, and any associated dependencies or runtime parameters, required to run your application. You don’t need to figure out the order in which AWS services need to be provisioned or the subtleties of how to make those dependencies work.', 'https://img.stackshare.io/service/411/aws-cloudformation.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (28, '2020-06-24 17:27:36', '2020-06-24 17:27:36', null, 'Chef', 'chef', 'Chef enables you to manage and scale cloud infrastructure with no downtime or interruptions. Freely move applications and configurations from one cloud to another. Chef is integrated with all major cloud providers including Amazon EC2, VMWare, IBM Smartcloud, Rackspace, OpenStack, Windows Azure, HP Cloud, Google Compute Engine, Joyent Cloud and others.', 'https://img.stackshare.io/service/420/24f4ef5e7a67c0d720bf9ae69dd6de2a.png', 'https://github.com/opscode/chef', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (29, '2020-06-24 17:27:40', '2020-06-24 17:27:40', null, 'Jekyll', 'jekyll', 'Think of Jekyll as a file-based CMS, without all the complexity. Jekyll takes your content, renders Markdown and Liquid templates, and spits out a complete, static website ready to be served by Apache, Nginx or another web server. Jekyll is the engine behind GitHub Pages, which you can use to host sites right from your GitHub repositories.', 'https://img.stackshare.io/service/1114/ad968c1615d956e800fa36494314f48c.jpeg', 'https://github.com/jekyll/jekyll', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (30, '2020-06-24 17:27:41', '2020-06-24 17:27:41', null, 'Middleman', 'middleman', 'Middleman is a command-line tool for creating static websites using all the shortcuts and tools of the modern web development environment.', 'https://img.stackshare.io/service/1153/ZpC_PISy.jpeg', 'https://github.com/middleman/middleman', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (31, '2020-06-24 17:27:46', '2020-06-24 17:27:46', null, 'Kubernetes', 'kubernetes', 'Kubernetes is an open source orchestration system for Docker containers. It handles scheduling onto nodes in a compute cluster and actively manages workloads to ensure that their state matches the users declared intentions.', 'https://img.stackshare.io/service/1885/21_d3cvM.png', 'https://github.com/googlecloudplatform/kubernetes', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (32, '2020-06-24 17:27:46', '2020-06-24 17:27:46', null, 'Rancher', 'rancher', 'Rancher is an open source container management platform that includes full distributions of Kubernetes, Apache Mesos and Docker Swarm, and makes it simple to operate container clusters on any cloud or infrastructure platform.', 'https://img.stackshare.io/service/2552/rancher.png', 'https://github.com/rancherio/rancher', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (33, '2020-06-24 17:27:51', '2020-06-24 17:27:51', null, 'Amazon DynamoDB', 'amazon-dynamodb', 'With it , you can offload the administrative burden of operating and scaling a highly available distributed database cluster, while paying a low price for only what you use.', 'https://img.stackshare.io/service/389/amazon-dynamodb.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (34, '2020-06-24 17:27:52', '2020-06-24 17:27:52', null, 'Amazon RDS for Aurora', 'amazon-rds-for-aurora', 'Amazon Aurora is a MySQL-compatible, relational database engine that combines the speed and availability of high-end commercial databases with the simplicity and cost-effectiveness of open source databases. Amazon Aurora provides up to five times better performance than MySQL at a price point one tenth that of a commercial database while delivering similar performance and availability.', 'https://img.stackshare.io/service/1924/amazon-rds.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (35, '2020-06-24 17:27:56', '2020-06-24 17:27:56', null, 'Django REST framework', 'django-rest-framework', 'It is a powerful and flexible toolkit that makes it easy to build Web APIs.', 'https://img.stackshare.io/service/1630/New_Project__67_.png', 'https://github.com/tomchristie/django-rest-framework', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (36, '2020-06-24 17:27:57', '2020-06-24 17:27:57', null, 'Flask', 'flask', 'Flask is intended for getting started very quickly and was developed with best intentions in mind.', 'https://img.stackshare.io/service/1001/flask.jpg', 'https://github.com/mitsuhiko/flask', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (37, '2020-06-24 17:28:01', '2020-06-24 17:28:01', null, 'PyCharm', 'pycharm', 'PyCharm’s smart code editor provides first-class support for Python, JavaScript, CoffeeScript, TypeScript, CSS, popular template languages and more. Take advantage of language-aware code completion, error detection, and on-the-fly code fixes!', 'https://img.stackshare.io/service/1644/logo.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (38, '2020-06-24 17:28:02', '2020-06-24 17:28:02', null, 'Visual Studio', 'visual-studio', 'Visual Studio is a suite of component-based software development tools and other technologies for building powerful, high-performance applications.', 'https://img.stackshare.io/service/1451/SR2hUhQN.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (39, '2020-06-24 17:28:07', '2020-06-24 17:28:07', null, 'Kibana', 'kibana', 'Kibana is an open source (Apache Licensed), browser based analytics and search dashboard for Elasticsearch. Kibana is a snap to setup and start using. Kibana strives to be easy to get started with, while also being flexible and powerful, just like Elasticsearch.', 'https://img.stackshare.io/service/1722/Image_2019-05-20_at_4.53.31_PM.png', 'https://github.com/elastic/kibana', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (40, '2020-06-24 17:28:07', '2020-06-24 17:28:07', null, 'New Relic', 'new-relic', 'New Relic is the all-in-one web application performance tool that lets you see performance from the end user experience, through servers, and down to the line of application code.', 'https://img.stackshare.io/service/103/yEDRfH2o.jpeg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (41, '2020-06-24 17:28:13', '2020-06-24 17:28:13', null, 'pathogen.vim', 'vim-pathogen', 'Manage your ''runtimepath'' with ease. In practical terms, pathogen.vim makes it super easy to install plugins and runtime files in their own private directories.', 'https://img.stackshare.io/no-img-open-source.png', 'https://github.com/tpope/vim-pathogen', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (42, '2020-06-24 17:28:13', '2020-06-24 17:28:13', null, 'Vim-Plug', 'vim-plug', 'A minimalist Vim plugin manager.', 'https://img.stackshare.io/service/1462/vim-plug.png', 'https://github.com/junegunn/vim-plug', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (43, '2020-06-24 17:28:13', '2020-06-24 17:28:13', null, 'Vundle', 'vundle', 'Vundle is short for Vim bundle and is a Vim plugin manager.', 'https://img.stackshare.io/no-img-open-source.png', 'https://github.com/gmarik/Vundle.vim', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (44, '2020-06-24 17:28:17', '2020-06-24 17:28:17', null, 'HTML5', 'html5', 'HTML5 is a core technology markup language of the Internet used for structuring and presenting content for the World Wide Web. As of October 2014 this is the final and complete fifth revision of the HTML standard of the World Wide Web Consortium (W3C). The previous version, HTML 4, was standardised in 1997.', 'https://img.stackshare.io/service/2538/kEpgHiC9.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (45, '2020-06-24 17:28:18', '2020-06-24 17:28:18', null, 'Java', 'java', 'Java is a programming language and computing platform first released by Sun Microsystems in 1995. There are lots of applications and websites that will not work unless you have Java installed, and more are created every day. Java is fast, secure, and reliable. From laptops to datacenters, game consoles to scientific supercomputers, cell phones to the Internet, Java is everywhere!', 'https://img.stackshare.io/service/995/K85ZWV2F.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (46, '2020-06-24 17:28:22', '2020-06-24 17:28:22', null, 'JavaScript', 'javascript', 'JavaScript is most known as the scripting language for Web pages, but used in many non-browser environments as well such as node.js or Apache CouchDB. It is a prototype-based, multi-paradigm scripting language that is dynamic,and supports object-oriented, imperative, and functional programming styles. ', 'https://img.stackshare.io/service/1209/javascript.jpeg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (47, '2020-06-24 17:28:27', '2020-06-24 17:28:27', null, 'Keras', 'keras', 'Deep Learning library for Python. Convnets, recurrent neural networks, and more. Runs on TensorFlow or Theano. https://keras.io/', 'https://img.stackshare.io/service/5601/keras.png', 'https://github.com/fchollet/keras', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (48, '2020-06-24 17:28:28', '2020-06-24 17:28:28', null, 'scikit-learn', 'scikit-learn', 'scikit-learn is a Python module for machine learning built on top of SciPy and distributed under the 3-Clause BSD license.', 'https://img.stackshare.io/service/2657/scikit-learn-logo.png', 'https://github.com/scikit-learn/scikit-learn', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (49, '2020-06-24 17:28:28', '2020-06-24 17:28:28', null, 'TensorFlow', 'tensorflow', 'TensorFlow is an open source software library for numerical computation using data flow graphs. Nodes in the graph represent mathematical operations, while the graph edges represent the multidimensional data arrays (tensors) communicated between them. The flexible architecture allows you to deploy computation to one or more CPUs or GPUs in a desktop, server, or mobile device with a single API.', 'https://img.stackshare.io/service/4717/FtFnqC38_400x400.png', 'https://github.com/tensorflow/tensorflow', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (50, '2020-06-24 17:28:33', '2020-06-24 17:28:33', null, 'Marathon', 'marathon', 'Marathon is an Apache Mesos framework for container orchestration. Marathon provides a REST API for starting, stopping, and scaling applications. Marathon is written in Scala and can run in highly-available mode by running multiple copies. The state of running tasks gets stored in the Mesos state abstraction.', 'https://img.stackshare.io/service/2612/marathon.png', 'https://github.com/mesosphere/marathon', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (51, '2020-06-24 17:28:38', '2020-06-24 17:28:38', null, 'PHP', 'php', 'Fast, flexible and pragmatic, PHP powers everything from your blog to the most popular websites in the world.', 'https://img.stackshare.io/service/991/hwUcGZ41_400x400.jpg', 'https://github.com/php/php-src', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (52, '2020-06-24 17:28:44', '2020-06-24 17:28:44', null, 'Nagios', 'nagios', 'Nagios is a host/service/network monitoring program written in C and
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (53, '2020-06-24 17:28:44', '2020-06-24 17:28:44', null, 'Shinken', 'shinken', 'Shinken''s main goal is to give users a flexible architecture for their monitoring system that is designed to scale to large environments. Shinken is backwards-compatible with the Nagios configuration standard and plugins. It works on any operating system and architecture that supports Python, which includes Windows, GNU/Linux and FreeBSD.', 'https://img.stackshare.io/service/4597/10d62d5744951aee2a897812c02a5cf4.png', 'https://github.com/naparuba/shinken', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (54, '2020-06-24 17:28:48', '2020-06-24 17:28:48', null, 'Apache HTTP Server', 'apache-httpd', 'The Apache HTTP Server is a powerful and flexible HTTP/1.1 compliant web server.  Originally designed as a replacement for the NCSA HTTP Server, it has grown to be the most popular web server on the Internet.', 'https://img.stackshare.io/service/1051/fab.os.logo.apache.200.15011_400x400.jpg', 'https://github.com/apache/httpd', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (55, '2020-06-24 17:28:54', '2020-06-24 17:28:54', null, 'Box', 'box', 'The Box API gives you access to the content management features you see in our web app and lets you extend them for use in your own app. It strives to be RESTful and is organized around the main resources you’re familiar with from the Box web interface.', 'https://img.stackshare.io/service/147/SQlVGGlz.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (56, '2020-06-24 17:28:54', '2020-06-24 17:28:54', null, 'Dropbox', 'dropbox', 'Harness the power of Dropbox. Connect to an account, upload, download, search, and more.', 'https://img.stackshare.io/service/146/cbe630c29a62e283cef31afc5c4471da.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (57, '2020-06-24 17:28:55', '2020-06-24 17:28:55', null, 'Google Drive', 'google-drive', 'Keep photos, stories, designs, drawings, recordings, videos, and more. Your first 15 GB of storage are free with a Google Account. Your files in Drive can be reached from any smartphone, tablet, or computer.', 'https://img.stackshare.io/service/148/5qxhymf609p5sizjjqvz.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (58, '2020-06-24 17:29:00', '2020-06-24 17:29:00', null, 'npm', 'npm', 'npm is the command-line interface to the npm ecosystem. It is battle-tested, surprisingly flexible, and used by hundreds of thousands of JavaScript developers every day.', 'https://img.stackshare.io/service/1120/lejvzrnlpb308aftn31u.png', 'https://github.com/npm/npm', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (59, '2020-06-24 17:29:01', '2020-06-24 17:29:01', null, 'Yarn', 'yarn', 'Yarn caches every package it downloads so it never needs to again. It also parallelizes operations to maximize resource utilization so install times are faster than ever.', 'https://img.stackshare.io/service/5848/44mC-kJ3.jpg', 'https://github.com/yarnpkg/yarn', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (60, '2020-06-24 17:29:06', '2020-06-24 17:29:06', null, 'Grafana', 'grafana', 'Grafana is a general purpose dashboard and graph composer. It''s focused on providing rich ways to visualize time series metrics, mainly though graphs but supports other ways to visualize data through a pluggable panel architecture. It currently has rich support for for Graphite, InfluxDB and OpenTSDB. But supports other data sources via plugins.', 'https://img.stackshare.io/service/2645/rhtKuA9t.png', 'https://github.com/grafana/grafana', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (61, '2020-06-24 17:29:10', '2020-06-24 17:29:10', null, 'Drone.io', 'drone-io', 'Drone is a hosted continuous integration service. It enables you to conveniently set up projects to automatically build, test, and deploy as you make changes to your code.
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (62, '2020-06-24 17:29:23', '2020-06-24 17:29:23', null, 'AWS Data Pipeline', 'aws-data-pipeline', 'AWS Data Pipeline is a web service that provides a simple management system for data-driven workflows. Using AWS Data Pipeline, you define a pipeline composed of the “data sources” that contain your data, the “activities” or business logic such as EMR jobs or SQL queries, and the “schedule” on which your business logic executes. For example, you could define a job that, every hour, runs an Amazon Elastic MapReduce (Amazon EMR)–based analysis on that hour’s Amazon Simple Storage Service (Amazon S3) log data, loads the results into a relational database for future lookup, and then automatically sends you a daily summary email. ', 'https://img.stackshare.io/service/422/aws-data-pipeline.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (63, '2020-06-24 17:29:23', '2020-06-24 17:29:23', null, 'Google Cloud Dataflow', 'google-cloud-dataflow', 'Google Cloud Dataflow is a unified programming model and a managed service for developing and executing a wide range of data processing patterns including ETL, batch computation, and continuous computation. Cloud Dataflow frees you from operational tasks like resource management and performance optimization.', 'https://img.stackshare.io/service/5253/google-cloud-dataflow.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (64, '2020-06-24 17:29:28', '2020-06-24 17:29:28', null, 'Ansible', 'ansible', 'Ansible is an IT automation tool. It can configure systems, deploy software, and orchestrate more advanced IT tasks such as continuous deployments or zero downtime rolling updates. Ansible’s goals are foremost those of simplicity and maximum ease of use.', 'https://img.stackshare.io/service/663/ElOjna20.png', 'https://github.com/ansible/ansible', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (65, '2020-06-24 17:29:29', '2020-06-24 17:29:29', null, 'Tower', 'tower', 'Use all of Git''s powerful feature set - in a GUI that makes you more productive.', 'https://img.stackshare.io/service/1601/tower-dock-icon_transparent_2x.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (66, '2020-06-24 17:29:33', '2020-06-24 17:29:33', null, 'Algolia', 'algolia', 'Our mission is to make you a search expert. Push data to our API to make it searchable in real time. Build your dream front end with one of our web or mobile UI libraries. Tune relevance and get analytics right from your dashboard.', 'https://img.stackshare.io/service/589/iEEMVN5L_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (67, '2020-06-24 17:29:34', '2020-06-24 17:29:34', null, 'Elasticsearch', 'elasticsearch', 'Elasticsearch is a distributed, RESTful search and analytics engine capable of storing data and searching it in near real time. Elasticsearch, Kibana, Beats and Logstash are the Elastic Stack (sometimes called the ELK Stack). ', 'https://img.stackshare.io/service/841/Image_2019-05-20_at_4.58.04_PM.png', 'https://github.com/elasticsearch/elasticsearch', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (68, '2020-06-24 17:29:36', '2020-06-24 17:29:36', null, 'Swiftype', 'swiftype', 'Swiftype is the easiest way to add great search to your website or mobile application.', 'https://img.stackshare.io/service/227/Yn4nI9Oy.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (69, '2020-06-24 17:29:40', '2020-06-24 17:29:40', null, 'IntelliJ IDEA', 'intellij-idea', 'Out of the box, IntelliJ IDEA provides a comprehensive feature set including tools and integrations with the most important modern technologies and frameworks for enterprise and web development with Java, Scala, Groovy and other languages.', 'https://img.stackshare.io/service/1453/icon_IntelliJIDEA.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (70, '2020-06-24 17:29:46', '2020-06-24 17:29:46', null, 'PhpStorm', 'phpstorm', 'PhpStorm is a PHP IDE which keeps up with latest PHP & web languages trends, integrates a variety of modern tools, and brings even more extensibility with support for major PHP frameworks.', 'https://img.stackshare.io/service/1452/icon_PhpStorm.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (71, '2020-06-24 17:29:47', '2020-06-24 17:29:47', null, 'Sublime Text', 'sublime-text', 'Sublime Text is available for OS X, Windows and Linux. One license is all you need to use Sublime Text on every computer you own, no matter what operating system it uses.
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (72, '2020-06-24 17:29:53', '2020-06-24 17:29:53', null, 'Eclipse', 'eclipse', 'Standard Eclipse package suited for Java and plug-in development plus adding new plugins; already includes Git, Marketplace Client, source code and developer documentation. 
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (73, '2020-06-24 17:29:53', '2020-06-24 17:29:53', null, 'NetBeans IDE', 'netbeans', 'NetBeans IDE is FREE, open source, and has a worldwide community of users and developers.', 'https://img.stackshare.io/service/1449/DxAPXRVS.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (74, '2020-06-24 17:29:58', '2020-06-24 17:29:58', null, 'Amazon API Gateway', 'amazon-api-gateway', 'Amazon API Gateway handles all the tasks involved in accepting and processing up to hundreds of thousands of concurrent API calls, including traffic management, authorization and access control, monitoring, and API version management.', 'https://img.stackshare.io/service/3299/aws-api-gateway.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (75, '2020-06-24 17:29:58', '2020-06-24 17:29:58', null, 'Apigility', 'apigility', 'An API-based architecture is essential to agile delivery of mobile applications. Apigility provides JSON representations that can be parsed and used in any mobile framework; write for the web or native applications simultaneously!', 'https://img.stackshare.io/service/2627/eed79f8989d03cd3ce30757f91926287.png', 'https://github.com/zfcampus/zf-apigility-skeleton', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (76, '2020-06-24 17:29:59', '2020-06-24 17:29:59', null, 'Kong', 'kong', 'Kong is a scalable, open source API Layer (also known as an API Gateway, or API Middleware). Kong controls layer 4 and 7 traffic and is extended through Plugins, which provide extra functionality and services beyond the core platform.', 'https://ucarecdn.com/3cf09daa-4e1e-404e-a612-f8a91c661db2/', 'https://github.com/Mashape/kong', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (77, '2020-06-24 17:30:03', '2020-06-24 17:30:03', null, 'Amazon CloudFront', 'amazon-cloudfront', 'Amazon CloudFront can be used to deliver your entire website, including dynamic, static, streaming, and interactive content using a global network of edge locations. Requests for your content are automatically routed to the nearest edge location, so content is delivered with the best possible performance.', 'https://img.stackshare.io/service/13/amazon-cloudfront.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (78, '2020-06-24 17:30:04', '2020-06-24 17:30:04', null, 'CloudFlare', 'cloudflare', 'Cloudflare speeds up and protects millions of websites, APIs, SaaS services, and other properties connected to the Internet.', 'https://img.stackshare.io/service/15/twitter-profile-400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (79, '2020-06-24 17:30:05', '2020-06-24 17:30:05', null, 'Fastly', 'fastly', 'Fastly''s real-time content delivery network gives you total control over your content, unprecedented access to performance analytics, and the ability to instantly update content in 150 milliseconds.', 'https://img.stackshare.io/service/274/9V2sLNfw.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (80, '2020-06-24 17:30:09', '2020-06-24 17:30:09', null, 'Bootstrap', 'bootstrap', 'Bootstrap is the most popular HTML, CSS, and JS framework for developing responsive, mobile first projects on the web.', 'https://img.stackshare.io/service/1101/C9QJ7V3X.png', 'https://github.com/twbs/bootstrap', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (81, '2020-06-24 17:30:10', '2020-06-24 17:30:10', null, 'Material Design Lite', 'material-design-lite', 'Material Design Lite (MDL) lets you add a Material Design look and feel to your static content websites. It doesn''t rely on any JavaScript frameworks or libraries. Optimized for cross-device use, gracefully degrades in older browsers, and offers an experience that is accessible from the get-go.', 'https://img.stackshare.io/service/3318/I7ZBJ4-L.png', 'https://github.com/google/material-design-lite', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (82, '2020-06-24 17:30:11', '2020-06-24 17:30:11', null, 'Material-UI', 'material-ui', 'It is a comprehensive guide for visual, motion, and interaction design across platforms and devices.', 'https://img.stackshare.io/service/1904/_.png', 'https://github.com/callemall/material-ui', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (83, '2020-06-24 17:30:15', '2020-06-24 17:30:15', null, 'IBM DB2', 'db2', 'DB2 for Linux, UNIX, and Windows is optimized to deliver industry-leading performance across multiple workloads, while lowering administration, storage, development, and server costs.', 'https://img.stackshare.io/service/1029/preview.jpeg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (84, '2020-06-24 17:30:20', '2020-06-24 17:30:20', null, 'Grape', 'grape', 'Grape is a REST-like API micro-framework for Ruby. It''s designed to run on Rack or complement existing web application frameworks such as Rails and Sinatra by providing a simple DSL to easily develop RESTful APIs. It has built-in support for common conventions, including multiple formats, subdomain/prefix restriction, content negotiation, versioning and much more.', 'https://img.stackshare.io/service/2002/grape.png', 'https://github.com/intridea/grape', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (85, '2020-06-24 17:30:20', '2020-06-24 17:30:20', null, 'Rails API', 'rails-api', 'Rails::API is a subset of a normal Rails application, created for applications that don''t require all functionality that a complete Rails application provides. It is a bit more lightweight, and consequently a bit faster than a normal Rails application. The main example for its usage is in API applications only, where you usually don''t need the entire Rails middleware stack nor template generation.', 'https://img.stackshare.io/no-img-open-source.png', 'https://github.com/rails-api/rails-api', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (86, '2020-06-24 17:30:21', '2020-06-24 17:30:21', null, 'Sinatra', 'sinatra', 'Sinatra is a DSL for quickly creating web applications in Ruby with minimal effort.', 'https://img.stackshare.io/service/999/logo.png', 'https://github.com/sinatra/sinatra', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (87, '2020-06-24 17:30:25', '2020-06-24 17:30:25', null, 'Spring Boot', 'spring-boot', 'Spring Boot makes it easy to create stand-alone, production-grade Spring based Applications that you can "just run". We take an opinionated view of the Spring platform and third-party libraries so you can get started with minimum fuss. Most Spring Boot applications need very little Spring configuration.', 'https://img.stackshare.io/service/2927/nPzvMuo2_400x400.png', 'https://github.com/spring-projects/spring-boot', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (88, '2020-06-24 17:30:30', '2020-06-24 17:30:30', null, 'Gerrit Code Review', 'gerrit-code-review', 'Gerrit is a self-hosted pre-commit code review tool. It serves as a Git hosting server with option to comment incoming changes. It is highly configurable and extensible with default guarding policies, webhooks, project access control and more.', 'https://img.stackshare.io/service/4508/5g2nrvlZ.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (89, '2020-06-24 17:30:31', '2020-06-24 17:30:31', null, 'GitLab', 'gitlab', 'GitLab offers git repository management, code reviews, issue tracking, activity feeds and wikis. Enterprises install GitLab on-premise and connect it with LDAP and Active Directory servers for secure authentication and authorization. A single GitLab server can handle more than 25,000 users but it is also possible to create a high availability setup with multiple active servers.', 'https://img.stackshare.io/service/880/lmalkclL.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (90, '2020-06-24 17:30:38', '2020-06-24 17:30:38', null, 'MongoDB', 'mongodb', 'MongoDB stores data in JSON-like documents that can vary in structure, offering a dynamic, flexible schema. MongoDB was also designed for high availability and scalability, with built-in replication and auto-sharding.', 'https://img.stackshare.io/service/1030/leaf-360x360.png', 'https://github.com/mongodb/mongo', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (91, '2020-06-24 17:30:39', '2020-06-24 17:30:39', null, 'Oracle', 'oracle', 'Oracle Database is an RDBMS. An RDBMS that implements object-oriented features such as user-defined types, inheritance, and polymorphism is called an object-relational database management system (ORDBMS). Oracle Database has extended the relational model to an object-relational model, making it possible to store complex business models in a relational database.', 'https://img.stackshare.io/service/1026/jT-HJYJg.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (92, '2020-06-24 17:30:43', '2020-06-24 17:30:43', null, 'RubyMine', 'rubymine', 'JetBrains RubyMine IDE provides a comprehensive Ruby code editor aware of dynamic language specifics and delivers smart coding assistance, intelligent code refactoring and code analysis capabilities. ', 'https://img.stackshare.io/service/1454/icon_RubyMine.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (93, '2020-06-24 17:30:44', '2020-06-24 17:30:44', null, 'Visual Studio Code', 'visual-studio-code', 'Build and debug modern web and cloud applications. Code is free and available on your favorite platform - Linux, Mac OSX, and Windows.', 'https://img.stackshare.io/service/4202/Visual_Studio_Code_logo.png', 'https://github.com/Microsoft/vscode', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (94, '2020-06-24 17:30:50', '2020-06-24 17:30:50', null, 'C#', 'c-sharp', 'C# (pronounced "See Sharp") is a simple, modern, object-oriented, and type-safe programming language. C# has its roots in the C family of languages and will be immediately familiar to C, C++, Java, and JavaScript programmers.', 'https://img.stackshare.io/service/1015/1200px-C_Sharp_wordmark.svg.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (95, '2020-06-24 17:30:57', '2020-06-24 17:30:57', null, 'Amazon EC2', 'amazon-ec2', 'It is a web service that provides resizable compute capacity in the cloud. It is designed to make web-scale computing easier for developers.', 'https://img.stackshare.io/service/18/amazon-ec2.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (96, '2020-06-24 17:30:59', '2020-06-24 17:30:59', null, 'OVH', 'ovh', 'Hundreds of new servers are installed in our 12 datacenters everyday. For our clients, this guarantees bare-metal resources accessible in less than an hour, and the liberty to use it to rollout the software of their choice. The many functions available on our dedicated servers allow our clients to manage their infrastructure autonomously.', 'https://img.stackshare.io/service/682/TKg5WGCg.jpeg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (97, '2020-06-24 17:31:04', '2020-06-24 17:31:04', null, 'Codacy', 'codacy', 'Codacy automates code review to improve & standardize code quality across large enterprises. It identifies issues through static code analysis. Integrates with GitLab, GitHub & Bitbucket. Supports 30+ languages', 'https://img.stackshare.io/service/866/icon-black.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (98, '2020-06-24 17:31:04', '2020-06-24 17:31:04', null, 'ESLint', 'eslint', 'A pluggable and configurable linter tool for identifying and reporting on patterns in JavaScript. Maintain your code quality with ease.', 'https://img.stackshare.io/service/3337/Q4L7Jncy.jpg', 'https://github.com/eslint/eslint', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (99, '2020-06-24 17:31:05', '2020-06-24 17:31:05', null, 'SonarQube', 'sonarqube', 'SonarQube provides an overview of the overall health of your source code and even more importantly, it highlights issues found on new code. With a Quality Gate set on your project, you will simply fix the Leak and start mechanically improving.', 'https://img.stackshare.io/service/2638/zIVhxKyn_400x400.png', 'https://github.com/SonarSource/sonarqube', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (100, '2020-06-24 17:31:18', '2020-06-24 17:31:18', null, 'Bitbucket', 'bitbucket', 'Bitbucket gives teams one place to plan projects, collaborate on code, test and deploy, all with free private Git repositories. Teams choose Bitbucket because it has a superior Jira integration, built-in CI/CD, & is free for up to 5 users.', 'https://img.stackshare.io/service/28/35O2KIRX_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (101, '2020-06-24 17:31:20', '2020-06-24 17:31:20', null, 'GitHub', 'github', 'GitHub is the best place to share code with friends, co-workers, classmates, and complete strangers. Over three million people use GitHub to build amazing things together.', 'https://img.stackshare.io/service/27/sBsvBbjY.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (102, '2020-06-24 17:31:26', '2020-06-24 17:31:26', null, 'Materialize', 'materialize', 'A CSS Framework based on material design.', 'https://img.stackshare.io/service/2015/GN559Lfb.png', 'https://github.com/Dogfalo/materialize', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (103, '2020-06-24 17:31:32', '2020-06-24 17:31:32', null, 'Django', 'django', 'Django is a high-level Python Web framework that encourages rapid development and clean, pragmatic design.', 'https://img.stackshare.io/service/994/4aGjtNQv.png', 'https://github.com/django/django', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (104, '2020-06-24 17:31:34', '2020-06-24 17:31:34', null, 'Laravel', 'laravel', 'It is a web application framework with expressive, elegant syntax. It attempts to take the pain out of development by easing common tasks used in the majority of web projects, such as authentication, routing, sessions, and caching.', 'https://img.stackshare.io/service/992/AcA2LnWL_400x400.jpg', 'https://github.com/laravel/laravel', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (105, '2020-06-24 17:31:38', '2020-06-24 17:31:38', null, 'Node.js', 'nodejs', 'Node.js uses an event-driven, non-blocking I/O model that makes it lightweight and efficient, perfect for data-intensive real-time applications that run across distributed devices.', 'https://img.stackshare.io/service/1011/n1JRsFeB_400x400.png', 'https://github.com/nodejs/node', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (106, '2020-06-24 17:31:44', '2020-06-24 17:31:44', null, 'Foundation', 'foundation', 'Foundation is the most advanced responsive front-end framework in the world. You can quickly prototype and build sites or apps that work on any kind of device with Foundation, which includes layout constructs (like a fully responsive grid), elements and best practices.', 'https://img.stackshare.io/service/1105/ocLJW3ku_400x400.jpg', 'https://github.com/zurb/foundation', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (107, '2020-06-24 17:31:49', '2020-06-24 17:31:49', null, 'Flyway', 'flyway', 'It lets you regain control of your database migrations with pleasure and plain sql. Solves only one problem and solves it well. It migrates your database, so you don''t have to worry about it anymore.', 'https://img.stackshare.io/service/2925/sR9x0dd4_400x400.jpg', 'https://github.com/flyway/flyway', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (108, '2020-06-24 17:31:49', '2020-06-24 17:31:49', null, 'Liquibase', 'liquibase', 'Liquibase is a leading open-source tool for database schema change management. Liquibase helps teams track, version, and deploy database schema and logic changes so they can automate their database code process with their app code process.', 'https://img.stackshare.io/service/1398/y1As8_s5_400x400.jpg', 'https://github.com/liquibase/liquibase', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (109, '2020-06-24 17:31:54', '2020-06-24 17:31:54', null, 'AWS CodeCommit', 'aws-codecommit', 'CodeCommit eliminates the need to operate your own source control system or worry about scaling its infrastructure. You can use CodeCommit to securely store anything from source code to binaries, and it works seamlessly with your existing Git tools.', 'https://img.stackshare.io/service/3298/aws-codecommit.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (110, '2020-06-24 17:31:59', '2020-06-24 17:31:59', null, 'NativeScript', 'nativescript', 'NativeScript enables developers to build native apps for iOS, Android and Windows Universal while sharing the application code across the platforms. When building the application UI, developers use our libraries, which abstract the differences between the native platforms.', 'https://img.stackshare.io/service/2605/_fBe-iYT.jpeg', 'https://github.com/NativeScript/NativeScript', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (111, '2020-06-24 17:32:00', '2020-06-24 17:32:00', null, 'React Native', 'react-native', 'React Native enables you to build world-class application experiences on native platforms using a consistent developer experience based on JavaScript and React. The focus of React Native is on developer efficiency across all the platforms you care about - learn once, write anywhere. Facebook uses React Native in multiple production apps and will continue investing in React Native.', 'https://img.stackshare.io/service/2699/KoK6gHzp.jpg', 'https://github.com/facebook/react-native', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (112, '2020-06-24 17:32:05', '2020-06-24 17:32:05', null, 'Docker Swarm', 'docker-swarm', 'Swarm serves the standard Docker API, so any tool which already communicates with a Docker daemon can use Swarm to transparently scale to multiple hosts: Dokku, Compose, Krane, Deis, DockerUI, Shipyard, Drone, Jenkins... and, of course, the Docker client itself.', 'https://img.stackshare.io/service/3177/preview.png', 'https://github.com/docker/swarm', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (113, '2020-06-24 17:32:10', '2020-06-24 17:32:10', null, 'Microsoft SQL Server', 'microsoft-sql-server', 'Microsoft® SQL Server is a database management and analysis system for e-commerce, line-of-business, and data warehousing solutions. ', 'https://img.stackshare.io/service/1027/sql_server.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (114, '2020-06-24 17:32:14', '2020-06-24 17:32:14', null, 'MariaDB', 'mariadb', 'Started by core members of the original MySQL team, MariaDB actively works with outside developers to deliver the most featureful, stable, and sanely licensed open SQL server in the industry. MariaDB is designed as a drop-in replacement of MySQL(R) with more features, new storage engines, fewer bugs, and better performance.
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (115, '2020-06-24 17:32:19', '2020-06-24 17:32:19', null, 'Postman', 'postman', 'It is the only complete API development environment, used by nearly five million developers and more than 100,000 companies worldwide. ', 'https://img.stackshare.io/service/1336/xWMRvm_5_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (116, '2020-06-24 17:32:20', '2020-06-24 17:32:20', null, 'Swagger UI', 'swagger-ui', 'Swagger UI is a dependency-free collection of HTML, Javascript, and CSS assets that dynamically generate beautiful documentation and sandbox from a Swagger-compliant API', 'https://img.stackshare.io/service/3417/pIea9Ji0.png', 'https://github.com/swagger-api/swagger-ui', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (117, '2020-06-24 17:32:24', '2020-06-24 17:32:24', null, 'Grunt', 'grunt', 'The less work you have to do when performing repetitive tasks like minification, compilation, unit testing, linting, etc, the easier your job becomes. After you''ve configured it, a task runner can do most of that mundane work for you—and your team—with basically zero effort.', 'https://img.stackshare.io/service/845/falgg2jybmhgk16y62lr.png', 'https://github.com/gruntjs/grunt', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (118, '2020-06-24 17:32:25', '2020-06-24 17:32:25', null, 'gulp', 'gulp', 'Build system automating tasks: minification and copying of all JavaScript files, static images. More capable of watching files to automatically rerun the task when a file changes.', 'https://img.stackshare.io/service/844/iruTC031.png', 'https://github.com/gulpjs/gulp', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (119, '2020-06-24 17:32:25', '2020-06-24 17:32:25', null, 'Webpack', 'webpack', 'A bundler for javascript and friends. Packs many modules into a few bundled assets. Code Splitting allows to load parts for the application on demand. Through "loaders" modules can be CommonJs, AMD, ES6 modules, CSS, Images, JSON, Coffeescript, LESS, ... and your custom stuff.', 'https://img.stackshare.io/service/1682/IMG_4636.PNG', 'https://github.com/webpack/webpack', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (120, '2020-06-24 17:32:30', '2020-06-24 17:32:30', null, 'Graphite', 'graphite', 'Graphite does two things: 1) Store numeric time-series data and 2) Render graphs of this data on demand', 'https://img.stackshare.io/service/1050/graphite.gif', 'https://github.com/graphite-project/graphite-web', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (121, '2020-06-24 17:32:34', '2020-06-24 17:32:34', null, 'Spring', 'spring', 'A key element of Spring is infrastructural support at the application level: Spring focuses on the "plumbing" of enterprise applications so that teams can focus on application-level business logic, without unnecessary ties to specific deployment environments.', 'https://img.stackshare.io/service/996/unnamed.jpg', 'https://github.com/spring-projects/spring-framework', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (122, '2020-06-24 17:32:39', '2020-06-24 17:32:39', null, 'Consul', 'consul', 'Consul is a tool for service discovery and configuration. Consul is distributed, highly available, and extremely scalable.', 'https://img.stackshare.io/service/747/consul-logo-grad_teaser.png', 'https://github.com/hashicorp/consul', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (123, '2020-06-24 17:32:39', '2020-06-24 17:32:39', null, 'Eureka', 'eureka', 'Eureka is a REST (Representational State Transfer) based service that is primarily used in the AWS cloud for locating services for the purpose of load balancing and failover of middle-tier servers.', 'https://img.stackshare.io/service/2085/99V92_Sr.png', 'https://github.com/Netflix/eureka', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (124, '2020-06-24 17:32:40', '2020-06-24 17:32:40', null, 'Zookeeper', 'zookeeper', 'A centralized service for maintaining configuration information, naming, providing distributed synchronization, and providing group services. All of these kinds of services are used in some form or another by distributed applications.', 'https://img.stackshare.io/service/1528/apache-zookeeper.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (125, '2020-06-24 17:32:44', '2020-06-24 17:32:44', null, 'Atom', 'atom', 'At GitHub, we''re building the text editor we''ve always wanted. A tool you can customize to do anything, but also use productively on the first day without ever touching a config file. Atom is modern, approachable, and hackable to the core. We can''t wait to see what you build with it.', 'https://img.stackshare.io/service/648/QbnVqgX4.png', 'https://github.com/atom/atom', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (126, '2020-06-24 17:32:45', '2020-06-24 17:32:45', null, 'Notepad++', 'notepad-plus-plus', 'Notepad++ is a free (as in "free speech" and also as in "free beer") source code editor and Notepad replacement that supports several languages. Running in the MS Windows environment, its use is governed by GPL License.', 'https://img.stackshare.io/service/646/logo.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (127, '2020-06-24 17:32:50', '2020-06-24 17:32:50', null, '.NET', 'dot-net', '.NET is a general purpose development platform. With .NET, you can use multiple languages, editors, and libraries to build native applications for web, mobile, desktop, gaming, and IoT for Windows, macOS, Linux, Android, and more.', 'https://img.stackshare.io/service/1014/IoPy1dce_400x400.png', 'https://github.com/dotnet/core', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (128, '2020-06-24 17:32:55', '2020-06-24 17:32:55', null, 'Prometheus', 'prometheus', 'Prometheus is a systems and service monitoring system. It collects metrics from configured targets at given intervals, evaluates rule expressions, displays the results, and can trigger alerts if some condition is observed to be true.', 'https://img.stackshare.io/service/2501/prometheus.png', 'https://github.com/prometheus/prometheus', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (129, '2020-06-24 17:33:01', '2020-06-24 17:33:01', null, 'Kafka', 'kafka', 'Kafka is a distributed, partitioned, replicated commit log service. It provides the functionality of a messaging system, but with a unique design.', 'https://img.stackshare.io/service/1063/kazUJooF_400x400.jpg', 'https://github.com/apache/kafka', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (130, '2020-06-24 17:33:02', '2020-06-24 17:33:02', null, 'RabbitMQ', 'rabbitmq', 'RabbitMQ gives your applications a common platform to send and receive messages, and your messages a safe place to live until received.', 'https://img.stackshare.io/service/1061/rabbit.jpg', 'https://github.com/rabbitmq/rabbitmq-server', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (131, '2020-06-24 17:33:03', '2020-06-24 17:33:03', null, 'ZeroMQ', 'zeromq', 'The 0MQ lightweight messaging kernel is a library which extends the standard socket interfaces with features traditionally provided by specialised messaging middleware products. 0MQ sockets provide an abstraction of asynchronous message queues, multiple messaging patterns, message filtering (subscriptions), seamless access to multiple transport protocols and more.', 'https://img.stackshare.io/service/1064/zeromq.png', 'https://github.com/zeromq/libzmq', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (132, '2020-06-24 17:33:07', '2020-06-24 17:33:07', null, 'Google Maps', 'google-maps', 'Create rich applications and stunning visualisations of your data, leveraging the comprehensiveness, accuracy, and usability of Google Maps and a modern web platform that scales as you grow.', 'https://img.stackshare.io/service/1652/googlemaps.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (133, '2020-06-24 17:33:08', '2020-06-24 17:33:08', null, 'Mapbox', 'mapbox', 'We make it possible to pin travel spots on Pinterest, find restaurants on Foursquare, and visualize data on GitHub.', 'https://img.stackshare.io/service/1640/cvosutVr_400x400.jpg', 'https://github.com/mapbox/mapbox.js/', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (134, '2020-06-24 17:33:12', '2020-06-24 17:33:12', null, 'Firebase', 'firebase', 'Firebase is a cloud service designed to power real-time, collaborative applications. Simply add the Firebase library to your application to gain access to a shared data structure; any changes you make to that data are automatically synchronized with the Firebase cloud and with other clients within milliseconds.', 'https://img.stackshare.io/service/116/cZLxNFZS.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (135, '2020-06-24 17:33:14', '2020-06-24 17:33:14', null, 'PubNub', 'pubnub', 'PubNub makes it easy for you to add real-time capabilities to your apps, without worrying about the infrastructure. Build apps that allow your users to engage in real-time across mobile, browser, desktop and server.', 'https://img.stackshare.io/service/349/A2EP-NOS.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (136, '2020-06-24 17:33:15', '2020-06-24 17:33:15', null, 'Pusher', 'pusher', 'Pusher is the category leader in delightful APIs for app developers building communication and collaboration features.', 'https://img.stackshare.io/service/115/preview.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (137, '2020-06-24 17:33:20', '2020-06-24 17:33:20', null, 'Leaflet', 'leaflet', 'Leaflet is an open source JavaScript library for mobile-friendly interactive maps. It is developed by Vladimir Agafonkin of MapBox with a team of dedicated contributors. Weighing just about 30 KB of gzipped JS code, it has all the features most developers ever need for online maps.', 'https://img.stackshare.io/service/2392/leaflet_upic.png', 'https://github.com/Leaflet/Leaflet', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (138, '2020-06-24 17:33:20', '2020-06-24 17:33:20', null, 'OpenLayers', 'openlayers', 'An opensource javascript library to load, display and render maps from multiple sources on web pages.', 'https://img.stackshare.io/service/3208/397ce8027eb036960f00dd5153d41993.png', 'https://github.com/openlayers/ol3', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (139, '2020-06-24 17:33:25', '2020-06-24 17:33:25', null, 'Mailgun', 'mailgun', 'Mailgun is a set of powerful APIs that allow you to send, receive, track and store email effortlessly.', 'https://img.stackshare.io/service/44/ICON_MAILGUN_NOFX.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (140, '2020-06-24 17:33:26', '2020-06-24 17:33:26', null, 'Mandrill', 'mandrill', 'Mandrill is a new way for apps to send transactional email. It runs on the delivery infrastructure that powers MailChimp.', 'https://img.stackshare.io/service/46/0skjzkftgup526281tkn.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (141, '2020-06-24 17:33:27', '2020-06-24 17:33:27', null, 'Twilio SendGrid', 'twilio-sendgrid', 'Twilio SendGrid''s cloud-based email infrastructure relieves businesses of the cost and complexity of maintaining custom email systems. Twilio SendGrid provides reliable delivery, scalability & real-time analytics along with flexible API''s.', 'https://img.stackshare.io/service/43/kQ_6nwmP.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (142, '2020-06-24 17:33:32', '2020-06-24 17:33:32', null, 'Paw', 'paw', 'Paw is a full-featured and beautifully designed Mac app that makes interaction with REST services delightful. Either you are an API maker or consumer, Paw helps you build HTTP requests, inspect the server''s response and even generate client code.', 'https://img.stackshare.io/service/2032/YApveawR.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (143, '2020-06-24 17:33:32', '2020-06-24 17:33:32', null, 'Runscope', 'runscope', 'Keep tabs on all aspects of your API''s performance with uptime monitoring, integration testing, logging and real-time monitoring.', 'https://img.stackshare.io/service/278/zlcbgqTt.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (144, '2020-06-24 17:33:37', '2020-06-24 17:33:37', null, 'Socket.IO', 'socket-io', 'It enables real-time bidirectional event-based communication. It works on every platform, browser or device, focusing equally on reliability and speed.', 'https://img.stackshare.io/service/1161/vI0ZZlhZ_400x400.png', 'https://github.com/Automattic/socket.io', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (145, '2020-06-24 17:33:42', '2020-06-24 17:33:42', null, 'Amazon SQS', 'amazon-sqs', 'Transmit any volume of data, at any level of throughput, without losing messages or requiring other services to be always available. With SQS, you can offload the administrative burden of operating and scaling a highly available messaging cluster, while paying a low price for only what you use.', 'https://img.stackshare.io/service/395/amazon-sqs.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (146, '2020-06-24 17:33:47', '2020-06-24 17:33:47', null, 'OpenStreetMap', 'openstreetmap', 'OpenStreetMap is built by a community of mappers that contribute and maintain data about roads, trails, cafés, railway stations, and much more, all over the world.', 'https://img.stackshare.io/service/2068/OSM_fixed_512.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (147, '2020-06-24 17:33:52', '2020-06-24 17:33:52', null, 'HipChat', 'hipchat', 'HipChat is a hosted private chat service for your company or team. Invite colleagues to share ideas and files in persistent group chat rooms. Get your team off AIM, Google Talk, and Skype — HipChat was built for business.', 'https://img.stackshare.io/service/144/R2NV13gL.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (148, '2020-06-24 17:33:54', '2020-06-24 17:33:54', null, 'Mattermost', 'mattermost', 'Mattermost is modern communication from behind your firewall. ', 'https://img.stackshare.io/service/3254/xiE1dr2s_400x400.jpg', 'https://github.com/mattermost/platform', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (149, '2020-06-24 17:33:55', '2020-06-24 17:33:55', null, 'Slack', 'slack', 'Imagine all your team communication in one place, instantly searchable, available wherever you go. That’s Slack. All your messages. All your files. And everything from Twitter, Dropbox, Google Docs, Asana, Trello, GitHub and dozens of other services. All together.', 'https://img.stackshare.io/service/675/RNiSRYOF_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (150, '2020-06-24 17:34:04', '2020-06-24 17:34:04', null, 'Jupyter', 'jupyter', 'The Jupyter Notebook is a web-based interactive computing platform. The notebook combines live code, equations, narrative text, visualizations, interactive dashboards and other media.', 'https://img.stackshare.io/service/4190/fGBUdNf__400x400.jpg', 'https://github.com/jupyter/notebook', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (151, '2020-06-24 17:34:05', '2020-06-24 17:34:05', null, 'Apache Zeppelin', 'zeppelin', 'A web-based notebook that enables interactive data analytics. You can make beautiful data-driven, interactive and collaborative documents with SQL, Scala and more.', 'https://img.stackshare.io/service/3659/NukVX4E1_400x400.png', 'https://github.com/apache/zeppelin', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (152, '2020-06-24 17:34:10', '2020-06-24 17:34:10', null, 'C3.js', 'c3', 'c3 is a D3-based reusable chart library that enables deeper integration of charts into web applications.', 'https://img.stackshare.io/no-img-open-source.png', 'https://github.com/masayuki0812/c3', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (153, '2020-06-24 17:34:10', '2020-06-24 17:34:10', null, 'D3.js', 'd3', 'It is a JavaScript library for manipulating documents based on data. Emphasises on web standards gives you the full capabilities of modern browsers without tying yourself to a proprietary framework.', 'https://img.stackshare.io/service/1491/HgKolWB5_400x400.jpg', 'https://github.com/d3/d3', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (154, '2020-06-24 17:34:11', '2020-06-24 17:34:11', null, 'Highcharts', 'highcharts', 'Highcharts currently supports line, spline, area, areaspline, column, bar, pie, scatter, angular gauges, arearange, areasplinerange, columnrange, bubble, box plot, error bars, funnel, waterfall and polar chart types.', 'https://img.stackshare.io/service/1435/Vx4_Psj1.png', 'https://github.com/highslide-software/highcharts.com', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (155, '2020-06-24 17:34:16', '2020-06-24 17:34:16', null, 'Email on Acid', 'email-on-acid', 'Email on Acid is the most affordable, self-serve email testing platform in the world. We can help you maximize the success of your email marketing efforts by diagnosing and improving your renderability, deliverability, click-throughs and conversions.', 'https://img.stackshare.io/service/58/4104af4178ecc05ea0b6cc184ae720d5.jpeg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (156, '2020-06-24 17:34:16', '2020-06-24 17:34:16', null, 'Litmus', 'litmus', 'Litmus is a testing service for web and marketing professionals. It allows people to cross-browser test their websites, and test their email newsletters across a range of email clients and spam filters.', 'https://img.stackshare.io/service/57/FlNaz6PN.jpeg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (157, '2020-06-24 17:34:21', '2020-06-24 17:34:21', null, 'Airbrake', 'airbrake', 'Airbrake collects errors for your applications in all major languages and frameworks. We alert you to new errors and give you critical context, trends and details needed to find and fix errors fast.', 'https://img.stackshare.io/service/194/MCc1W3L8_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (158, '2020-06-24 17:34:21', '2020-06-24 17:34:21', null, 'Bugsnag', 'bugsnag', 'Bugsnag captures errors from your web, mobile and back-end applications, providing instant visibility into user impact.  Diagnostic data and tools are included to help your team prioritize, debug and fix exceptions fast.', 'https://img.stackshare.io/service/150/square-logo-small-midnight.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (159, '2020-06-24 17:34:22', '2020-06-24 17:34:22', null, 'Sentry', 'sentry', 'Sentry is an open-source platform for workflow productivity, aggregating errors from across the stack in real time. 500K developers use Sentry to get the code-level context they need to resolve issues at every stage of the app lifecycle.', 'https://img.stackshare.io/service/191/lzoDXqf-.png', 'https://github.com/getsentry/sentry', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (160, '2020-06-24 17:34:27', '2020-06-24 17:34:27', null, 'DigitalOcean', 'digitalocean', 'We take the complexities out of cloud hosting by offering blazing fast, on-demand SSD cloud servers, straightforward pricing, a simple API, and an easy-to-use control panel. ', 'https://img.stackshare.io/service/295/Onjxs6Lw_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (161, '2020-06-24 17:34:29', '2020-06-24 17:34:29', null, 'Microsoft Azure', 'microsoft-azure', 'Azure is an open and flexible cloud platform that enables you to quickly build, deploy and manage applications across a global network of Microsoft-managed datacenters. You can build applications using any language, tool or framework. And you can integrate your public cloud applications with your existing IT environment.', 'https://img.stackshare.io/service/213/W9gT7hZo.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (162, '2020-06-24 17:34:34', '2020-06-24 17:34:34', null, 'Linode', 'linode', 'Get a server running in minutes with your choice of Linux distro, resources, and node location.', 'https://img.stackshare.io/service/24/631d437cd8e04903f69766a85d8a5540.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (163, '2020-06-24 17:34:39', '2020-06-24 17:34:39', null, 'OpenCV', 'opencv', 'OpenCV was designed for computational efficiency and with a strong focus on real-time applications. Written in optimized C/C++, the library can take advantage of multi-core processing. Enabled with OpenCL, it can take advantage of the hardware acceleration of the underlying heterogeneous compute platform.', 'https://img.stackshare.io/service/1293/opencv-logo-64x64.png', 'https://github.com/Itseez/opencv', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (164, '2020-06-24 17:34:39', '2020-06-24 17:34:39', null, 'scikit-image', 'scikit-image', 'scikit-image is a collection of algorithms for image processing.', 'https://img.stackshare.io/service/1294/897180.png', 'https://github.com/scikit-image/scikit-image', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (165, '2020-06-24 17:34:48', '2020-06-24 17:34:48', null, 'InVision', 'invision', 'InVision lets you create stunningly realistic interactive wireframes and prototypes without compromising your creative vision.', 'https://img.stackshare.io/service/165/r9uL4jWU.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (166, '2020-06-24 17:34:49', '2020-06-24 17:34:49', null, 'Marvel', 'marvel', 'A super simple tool that turns any image (including PSDs) or sketch into interactive prototypes for any device.
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (167, '2020-06-24 17:34:49', '2020-06-24 17:34:49', null, 'Proto.io', 'proto-io', 'Proto.io supports all the major mobile gestures and touch events like tap, tap-hold, swipe, pinch, and zoom. Interaction designers are not limited to a single ‘link’ transition anymore. Instead they can apply animated screen transitions like slide, fade, pop, flip, flow, and turn.', 'https://img.stackshare.io/service/505/WvPwQzE1_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (168, '2020-06-24 17:34:53', '2020-06-24 17:34:53', null, 'Rollbar', 'rollbar', 'Rollbar helps development teams find and fix errors faster. Quickly pinpoint what’s broken and why. View exceptions from all of your languages, frameworks, platforms & environments in one place. Get context & insights to defeat all errors.', 'https://img.stackshare.io/service/328/IWsbTBOs_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (169, '2020-06-24 17:34:58', '2020-06-24 17:34:58', null, 'Google Compute Engine', 'google-compute-engine', 'Google Compute Engine is a service that provides virtual machines that run on Google infrastructure. Google Compute Engine offers scale, performance, and value that allows you to easily launch large compute clusters on Google''s infrastructure. There are no upfront investments and you can run up to thousands of virtual CPUs on a system that has been designed from the ground up to be fast, and to offer strong consistency of performance.', 'https://img.stackshare.io/service/518/s01TMTGn.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (170, '2020-06-24 17:35:03', '2020-06-24 17:35:03', null, 'Amazon SES', 'amazon-ses', 'Amazon SES eliminates the complexity and expense of building an in-house email solution or licensing, installing, and operating a third-party email service. The service integrates with other AWS services, making it easy to send emails from applications being hosted on services such as Amazon EC2. ', 'https://img.stackshare.io/service/17/amazon-ses.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (171, '2020-06-24 17:35:08', '2020-06-24 17:35:08', null, 'Adyen', 'adyen', 'A payments technology company that provides a single global platform to accept payments anywhere in the world. Businesses can process payments across online, mobile and in-store (POS) with over 250 payment methods and 187 currencies.', 'https://img.stackshare.io/service/2907/OErNR8qK.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (172, '2020-06-24 17:35:08', '2020-06-24 17:35:08', null, 'Braintree', 'braintree', 'Braintree replaces traditional payment gateways and merchant accounts. From one touch payments, to mobile SDKs and international sales, we provide everything you need to start accepting payments today.', 'https://img.stackshare.io/service/98/mgD1tpPz.jpeg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (173, '2020-06-24 17:35:09', '2020-06-24 17:35:09', null, 'Stripe', 'stripe', 'Stripe makes it easy for developers to accept credit cards on the web.', 'https://img.stackshare.io/service/97/eW6tXeq3.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (174, '2020-06-24 17:35:13', '2020-06-24 17:35:13', null, 'RocketChat', 'rocketchat', 'Rocket.Chat is a Web Chat Server, developed in JavaScript, using the Meteor fullstack framework.
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (175, '2020-06-24 17:35:19', '2020-06-24 17:35:19', null, 'Mailjet', 'mailjet', 'Mailjet is a real-time Cloud Emailing platform: scalable, agile and flexible. Our unique algorithm boosts your deliverability and our platform provides in-depth insight so you can optimize more than ever.', 'https://img.stackshare.io/service/52/BXEGzoD1.jpeg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (176, '2020-06-24 17:35:24', '2020-06-24 17:35:24', null, 'Gitter', 'gitter', 'Free chat rooms for your public repositories. 
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (177, '2020-06-24 17:35:29', '2020-06-24 17:35:29', null, 'jQuery', 'jquery', 'jQuery is a cross-platform JavaScript library designed to simplify the client-side scripting of HTML.', 'https://img.stackshare.io/service/1021/lxEKmMnB_400x400.jpg', 'https://github.com/jquery/jquery', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (178, '2020-06-24 17:35:31', '2020-06-24 17:35:31', null, 'jQuery UI', 'jquery-ui', 'Whether you''re building highly interactive web applications or you just need to add a date picker to a form control, jQuery UI is the perfect choice.', 'https://img.stackshare.io/service/1022/jqueryui_avatar_96.png', 'https://github.com/jquery/jquery-ui', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (179, '2020-06-24 17:35:32', '2020-06-24 17:35:32', null, 'React', 'react', 'Lots of people use React as the V in MVC. Since React makes no assumptions about the rest of your technology stack, it''s easy to try it out on a small feature in an existing project.', 'https://img.stackshare.io/service/1020/OYIaJ1KK.png', 'https://github.com/facebook/react', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (180, '2020-06-24 17:35:39', '2020-06-24 17:35:39', null, 'Google Cloud Messaging', 'google-cloud-messaging', 'Google Cloud Messaging (GCM) is a free service that enables developers to send messages between servers and client apps. This includes downstream messages from servers to client apps, and upstream messages from client apps to servers.', 'https://img.stackshare.io/service/3873/googledev.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (181, '2020-06-24 17:35:43', '2020-06-24 17:35:43', null, 'App Annie', 'app-annie', 'Annie takes care of all the Math Behind The App Stores keeping you up-to-date with your own app''s metrics and the latest app store trends. Annie provides three fabulous products for her fans: Analytics, Store Stats, Intelligence.', 'https://img.stackshare.io/service/978/SkCJEIH6_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (182, '2020-06-24 17:35:43', '2020-06-24 17:35:43', null, 'Sensor Tower', 'sensor-tower', 'Sensor Tower is an app analytics platform focused on helping companies with mobile apps understand and improve their organic user acquisition, analyze their app’s performance, keep up to date with competitors and manage reviews. Over 20,000 mobile companies & developers use Sensor Tower to improve their downloads on iOS (iPhone, iPad and iPod) and Android.', 'https://img.stackshare.io/service/552/73dd2ba8a15aeedbaaaee4248e18a33a.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (183, '2020-06-24 17:35:48', '2020-06-24 17:35:48', null, 'HuBoard', 'huboard', 'Adds a lightweight kanban board to GitHub issues, instantly adding project management to your GitHub projects. HuBoard is built from the ground up using the GitHub public API. HuBoard issues are GitHub issues, you will never have to deal with syncronization problems.', 'https://img.stackshare.io/service/321/a39742cf3ad5820968b5007782877249.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (184, '2020-06-24 17:35:48', '2020-06-24 17:35:48', null, 'waffle.io', 'waffle-io', 'Track priority and rank for your GitHub issues across multiple repositories. Automatically see issues moved across a board for you, when you open pull requests or create branches. ', 'https://img.stackshare.io/service/780/dVIEyFe8.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (185, '2020-06-24 17:35:49', '2020-06-24 17:35:49', null, 'ZenHub', 'zenhub', 'ZenHub is a lightweight browser extension that adds a powerful set of features directly into GitHub''s UI. ', 'https://img.stackshare.io/service/1589/6d14af3a-bbab-11e5-9206-d68fba762c54.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (186, '2020-06-24 17:35:54', '2020-06-24 17:35:54', null, 'Hubot', 'hubot', 'Hubot is a chat bot, modeled after GitHub''s Campfire bot, hubot. He''s pretty cool. He''s extendable with old community scripts, or new community org and your own custom scripts, and can work on many different chat services.', 'https://img.stackshare.io/service/1519/hubot.png', 'https://github.com/github/hubot', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (187, '2020-06-24 17:35:55', '2020-06-24 17:35:55', null, 'Lita', 'lita', 'Lita is a chat bot written in Ruby with persistent storage provided by Redis. It uses a plugin system to connect to different chat services and to provide new behavior. The plugin system uses the familiar tools of the Ruby ecosystem: RubyGems and Bundler.', 'https://img.stackshare.io/service/1520/h7ATpIfy.png', 'https://github.com/jimmycuadra/lita', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (188, '2020-06-24 17:36:04', '2020-06-24 17:36:04', null, 'Cypress', 'cypress', 'Cypress is a front end automated testing application created for the modern web. Cypress is built on a new architecture and runs in the same run-loop as the application being tested. As a result Cypress provides better, faster, and more reliable testing for anything that runs in a browser. Cypress works on any front-end framework or website. ', 'https://img.stackshare.io/service/9231/pXI1GDHW_400x400.jpg', 'https://github.com/cypress-io/cypress', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (189, '2020-06-24 17:36:04', '2020-06-24 17:36:04', null, 'Jest', 'jest', 'Jest provides you with multiple layers on top of Jasmine.', 'https://img.stackshare.io/service/830/jest.png', 'https://github.com/facebook/jest', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (190, '2020-06-24 17:36:09', '2020-06-24 17:36:09', null, 'Gitcolony', 'gitcolony', 'Gitcolony encourages developers to share early feedback, do partial reviews, reduce rework and leverage the knowledge of the whole group. Teams become more efficient by adding visibility to the process.', 'https://img.stackshare.io/service/2381/Q4dAMHF5.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (191, '2020-06-24 17:36:09', '2020-06-24 17:36:09', null, 'Prettier', 'prettier', 'Prettier is an opinionated code formatter. It enforces a consistent style by parsing your code and re-printing it with its own rules that take the maximum line length into account, wrapping code when necessary.', 'https://img.stackshare.io/service/7035/icon.png', 'https://github.com/prettier/prettier', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (192, '2020-06-24 17:36:10', '2020-06-24 17:36:10', null, 'RuboCop', 'rubocop', 'RuboCop is a Ruby static code analyzer. Out of the box it will enforce many of the guidelines outlined in the community Ruby Style Guide.', 'https://img.stackshare.io/service/2643/rubocop.png', 'https://github.com/bbatsov/rubocop', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (193, '2020-06-24 17:36:14', '2020-06-24 17:36:14', null, 'Amazon RDS', 'amazon-rds-for-mysql', 'Amazon RDS gives you access to the capabilities of a familiar MySQL, Oracle or Microsoft SQL Server database engine. This means that the code, applications, and tools you already use today with your existing databases can be used with Amazon RDS. Amazon RDS automatically patches the database software and backs up your database, storing the backups for a user-defined retention period and enabling point-in-time recovery. You benefit from the flexibility of being able to scale the compute resources or storage capacity associated with your Database Instance (DB Instance) via a single API call.', 'https://img.stackshare.io/service/232/amazon-rds.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (194, '2020-06-24 17:36:15', '2020-06-24 17:36:15', null, 'DigitalOcean Managed Databases', 'digitalocean-managed-databases', 'Build apps and store data in minutes with easy access to one or more databases and sleep better knowing your data is backed up and optimized.', 'https://img.stackshare.io/service/9763/ATvWxM7a_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (195, '2020-06-24 17:36:15', '2020-06-24 17:36:15', null, 'GenieDB', 'geniedb', 'GenieDB’s DBaaS uses multi-master replication and multi-regional distribution on multiple cloud infrastructures (Amazon AWS, IBM Softlayer, DigitalOcean, Rackspace Cloud, and Google Cloud) to help reduce latency, eliminate downtime, and easily scale your database. ', 'https://img.stackshare.io/service/764/762750adda7635a94b28509b49dae74b.jpeg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (196, '2020-06-24 17:36:19', '2020-06-24 17:36:19', null, 'GraphQL', 'graphql', 'GraphQL is a data query language and runtime designed and used at Facebook to request and deliver data to mobile and web apps since 2012.', 'https://img.stackshare.io/service/3820/12972006.png', 'https://github.com/facebook/graphql', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (197, '2020-06-24 17:36:20', '2020-06-24 17:36:20', null, 'Prisma', 'prisma', 'Prisma is an open-source database toolkit. It replaces traditional ORMs and makes database access easy with an auto-generated query builder for TypeScript & Node.js.', 'https://img.stackshare.io/service/8680/Logo_Symbol_White.jpg', 'https://github.com/prisma/prisma', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (198, '2020-06-24 17:36:24', '2020-06-24 17:36:24', null, 'Glamorous', 'glamorous', 'Glamorous is React component styling solved with an elegant (inspired) API, small footprint (<5kb gzipped), and great performance (via glamor). It has a very similar API to styled-components and uses similar tools under the hood (glamor).', 'https://img.stackshare.io/service/9149/full.png', 'https://github.com/paypal/glamorous', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (199, '2020-06-24 17:36:24', '2020-06-24 17:36:24', null, 'React Canvas', 'react-canvas', 'React Canvas adds the ability for React components to render to "canvas" rather than DOM. This project is a work-in-progress. Though much of the code is in production on flipboard.com, the React canvas bindings are relatively new and the API is subject to change.', 'https://img.stackshare.io/no-img-open-source.png', 'https://github.com/Flipboard/react-canvas', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (200, '2020-06-24 17:36:24', '2020-06-24 17:36:24', null, 'Vuesax', 'vuesax', 'Vuesax is a framework of components based on vue js, it is a framework that is designed from scratch to be incrementally adoptable.
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (201, '2020-06-24 17:36:29', '2020-06-24 17:36:29', null, 'MacGap', 'macgap', 'MacGap provides HTML/JS/CSS developers an Xcode project for developing native OS X App. These Apps run in OS X''s WebView and take advantage of WebKit technologies. MacGap exposes a JavaScript API for OS X integration, such as displaying native notifications or writing data to a file. MacGap is extremely lightweight and nimble; a blank application weighs less than 1MB.', 'https://img.stackshare.io/service/2125/7732773.png', 'https://github.com/MacGapProject/MacGap1', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (202, '2020-06-24 17:36:29', '2020-06-24 17:36:29', null, 'Proton Native', 'proton-native', 'Create native desktop applications through a React syntax, on all platforms', 'https://img.stackshare.io/service/8517/eE3nAsW.png', 'https://github.com/kusti8/proton-native', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (203, '2020-06-24 17:36:29', '2020-06-24 17:36:29', null, 'React Desktop', 'react-desktop', 'react-desktop is a JavaScript library built ontop of Facebook''s React library, which aims to bring a native desktop experience to the web, featuring many OS X El Capitan and Windows 10 components. react-desktop works perfectly with node-webkit and Electron.js, but can be used in any JavaScript powered project!', 'https://img.stackshare.io/service/3806/react-desktop.png', 'https://github.com/gabrielbull/react-desktop', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (204, '2020-06-24 17:36:33', '2020-06-24 17:36:33', null, 'Fork', 'fork', 'Manage your repositories without leaving the application. Organize the repositores into categories. Fork''s Diff Viewer provides a clear view to spot the changes in your source code quickly.', 'https://img.stackshare.io/service/5672/logo1.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (205, '2020-06-24 17:36:34', '2020-06-24 17:36:34', null, 'Sublime Merge', 'sublime-merge', 'A snappy UI, three-way merge tool, side-by-side diffs, syntax highlighting, and more. Evaluate for free – no account, tracking, or time limits.', 'https://img.stackshare.io/service/9564/sublimemerge.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (206, '2020-06-24 17:36:38', '2020-06-24 17:36:38', null, 'GitKraken', 'gitkraken', 'The downright luxurious Git client for Windows, Mac and Linux. Cross-platform, 100% standalone, and free.', 'https://img.stackshare.io/service/4614/XHJt0jRW.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (207, '2020-06-24 17:36:43', '2020-06-24 17:36:43', null, 'Docker Compose', 'docker-compose', 'With Compose, you define a multi-container application in a single file, then spin your application up in a single command which does everything that needs to be done to get it running.', 'https://img.stackshare.io/service/3136/docker-compose.png', 'https://github.com/docker/compose', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (208, '2020-06-24 17:36:44', '2020-06-24 17:36:44', null, 'Helm', 'helm', 'Helm is the best way to find, share, and use software built for Kubernetes.', 'https://img.stackshare.io/service/5983/AHcBc6EG_400x400.jpg', 'https://github.com/kubernetes/helm', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (209, '2020-06-24 17:36:44', '2020-06-24 17:36:44', null, 'Skaffold', 'skaffold', 'Skaffold is a command line tool that facilitates continuous development for Kubernetes applications. You can iterate on your application source code locally then deploy to local or remote Kubernetes clusters. Skaffold handles the workflow for building, pushing and deploying your application. It can also be used in an automated context such as a CI/CD pipeline to leverage the same workflow and tooling when moving applications to production.', 'https://img.stackshare.io/service/8677/2810941.png', 'https://github.com/GoogleCloudPlatform/skaffold', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (210, '2020-06-24 17:36:48', '2020-06-24 17:36:48', null, 'Ember.js', 'emberjs', 'A JavaScript framework that does all of the heavy lifting that you''d normally have to do by hand. There are tasks that are common to every web app; It does those things for you, so you can focus on building killer features and UI.', 'https://img.stackshare.io/service/1018/3s1seyc0csl75btyw1vl.png', 'https://github.com/emberjs/ember.js', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (211, '2020-06-24 17:36:50', '2020-06-24 17:36:50', null, 'KnockoutJS', 'knockout', 'Knockout is a JavaScript MVVM (a modern variant of MVC) library that makes it easier to create rich, desktop-like user interfaces with JavaScript and HTML. It uses observers to make your UI automatically stay in sync with an underlying data model, along with a powerful and extensible set of declarative bindings to enable productive development.', 'https://img.stackshare.io/service/1997/logo_400x400.png', 'https://github.com/knockout/knockout', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (212, '2020-06-24 17:36:55', '2020-06-24 17:36:55', null, 'Backbone.js', 'backbone', 'Backbone supplies structure to JavaScript-heavy applications by providing models key-value binding and custom events, collections with a rich API of enumerable functions, views with declarative event handling, and connects it all to your existing application over a RESTful JSON interface.', 'https://img.stackshare.io/service/1017/Screen_Shot_2012-04-28_at_8.52.15_PM.png', 'https://github.com/jashkenas/backbone', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (213, '2020-06-24 17:37:00', '2020-06-24 17:37:00', null, 'Geddy', 'geddy', 'Geddy is a full stack open source MVC framework based on ruby on rails methodology with built-in authentication module, passportjs and socket.io integration. ', 'https://img.stackshare.io/service/1164/4d4218f385fc6fc6d718583412c0db3b.png', 'https://github.com/geddy/geddy', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (214, '2020-06-24 17:37:00', '2020-06-24 17:37:00', null, 'NestJS', 'nestjs', 'Nest is a framework for building efficient, scalable Node.js server-side applications. It uses progressive JavaScript, is built with TypeScript (preserves compatibility with pure JavaScript) and combines elements of OOP (Object Oriented Programming), FP (Functional Programming), and FRP (Functional Reactive Programming).
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (215, '2020-06-24 17:37:05', '2020-06-24 17:37:05', null, 'Micro ', 'micro-editor', 'Micro is a terminal-based text editor that aims to be easy to use and intuitive, while also taking advantage of the full capabilities of modern terminals. It comes as one single, batteries-included, static binary with no dependencies, and you can download and use it right now.', 'https://img.stackshare.io/service/7701/21361806.png', 'https://github.com/zyedidia/micro', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (216, '2020-06-24 17:37:05', '2020-06-24 17:37:05', null, 'Vim', 'vim', 'Vim is an advanced text editor that seeks to provide the power of the de-facto Unix editor ''Vi'', with a more complete feature set. Vim is a highly configurable text editor built to enable efficient text editing. It is an improved version of the vi editor distributed with most UNIX systems. Vim is distributed free as charityware. ', 'https://img.stackshare.io/service/644/vim_logo.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (217, '2020-06-24 17:37:11', '2020-06-24 17:37:11', null, 'Jitsi', 'jitsi', 'Jitsi is a set of open-source projects that allows you to easily build and deploy secure videoconferencing solutions. At the heart of Jitsi are Jitsi Videobridge and Jitsi Meet, which let you have conferences on the internet, while other projects in the community enable other features such as audio, dial-in, recording, and simulcasting.', 'https://img.stackshare.io/service/9412/F0VxeYZj_400x400.png', 'https://github.com/jitsi/jitsi', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (218, '2020-06-24 17:37:12', '2020-06-24 17:37:12', null, 'Meetings.io', 'meetings-io', 'Meet with clients, co-workers & teams. No software or signups needed. Works on all web browsers. Best of all, it''s free.', 'https://img.stackshare.io/service/163/v6slok3h41cko3ttffia.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (219, '2020-06-24 17:37:12', '2020-06-24 17:37:12', null, 'Skype', 'skype', 'Skype’s text, voice and video make it simple to share experiences with the people that matter to you, wherever they are.', 'https://img.stackshare.io/service/340/skype.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (220, '2020-06-24 17:37:16', '2020-06-24 17:37:16', null, 'Empire', 'empire', 'Empire is a control layer on top of Amazon EC2 Container Service (ECS) that provides a Heroku like workflow. It conforms to a subset of the Heroku Platform API, which means you can use the same tools and processes that you use with Heroku, but with all the power of EC2 and Docker.', 'https://img.stackshare.io/no-img-open-source.png', 'https://github.com/remind101/empire', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (221, '2020-06-24 17:37:17', '2020-06-24 17:37:17', null, 'Hasura', 'hasura', 'An open source GraphQL engine that deploys instant, realtime GraphQL APIs on any Postgres database.', 'https://img.stackshare.io/service/6590/hasura_logo_vertical_black.png', 'https://github.com/hasura/graphql-engine', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (222, '2020-06-24 17:37:17', '2020-06-24 17:37:17', null, 'MongoDB Stitch', 'mongodb-stitch', 'MongoDB Stitch lets developers focus on building applications rather than on managing data manipulation code, service integration, or backend infrastructure. Stitch lets you focus on building the app users want, not on writing boilerplate backend logic.', 'https://img.stackshare.io/service/7174/stitch-360x360.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (223, '2020-06-24 17:37:21', '2020-06-24 17:37:21', null, 'Anvil', 'anvil', 'Anvil is a platform for building and hosting full-stack web apps written entirely in Python. Drag & drop your UI, then write Python on the front-end and back-end to make it all work. Web development has never been this easy (or fast)!', 'https://img.stackshare.io/service/7847/MV7xAivq_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (224, '2020-06-24 17:37:21', '2020-06-24 17:37:21', null, 'Jelastic', 'jelastic', 'Jelastic is a Multi-Cloud DevOps PaaS for ISVs, telcos, service providers and enterprises needing to speed up development, reduce cost of IT infrastructure, improve uptime and security.', 'https://img.stackshare.io/service/140/jelastic_icon.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (225, '2020-06-24 17:37:26', '2020-06-24 17:37:26', null, 'redux-saga', 'redux-saga', 'An alternative side effect model for Redux apps', 'https://img.stackshare.io/no-img-open-source.png', 'https://github.com/redux-saga/redux-saga', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (226, '2020-06-24 17:37:26', '2020-06-24 17:37:26', null, 'redux-thunk', 'redux-thunk', 'Redux Thunk middleware allows you to write action creators that return a function instead of an action. The thunk can be used to delay the dispatch of an action, or to dispatch only if a certain condition is met. The inner function receives the store methods dispatch and getState as parameters.', 'https://img.stackshare.io/service/5448/13142323.png', 'https://github.com/reduxjs/redux-thunk', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (227, '2020-06-24 17:37:30', '2020-06-24 17:37:30', null, 'Adobe Photoshop', 'adobe-photoshop', 'It is the best in the world of graphic design and image processing software that will realize any of your ideas. Create and enhance photos, illustrations and 3D graphic objects.', 'https://img.stackshare.io/service/3176/lxVcZyci.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (228, '2020-06-24 17:37:31', '2020-06-24 17:37:31', null, 'Figma', 'figma', 'Figma is the first interface design tool with real-time collaboration. It keeps everyone on the same page. Focus on the work instead of fighting your tools.', 'https://img.stackshare.io/service/7007/MFYQOphW_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (229, '2020-06-24 17:37:35', '2020-06-24 17:37:35', null, 'Graphene', 'graphene', 'Graphene is a Python library for building GraphQL schemas/types fast and easily.', 'https://img.stackshare.io/service/4611/graphene.png', 'https://github.com/graphql-python/graphene', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (230, '2020-06-24 17:37:39', '2020-06-24 17:37:39', null, 'Cierge', 'cierge', 'Cierge is an open source authentication server (OIDC) that handles user signup, login, profiles, managerment, and more. Instead of storing passwords, Cirege uses magic links/codes and external logins to authenticate your users.', 'https://img.stackshare.io/service/8225/21dq3he.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (231, '2020-06-24 17:37:40', '2020-06-24 17:37:40', null, 'sso', 'sso-buzzfeed', 'The authentication and authorization system BuzzFeed developed to provide a secure, single sign-on experience for access to the many internal web apps used by our employees.', 'https://img.stackshare.io/service/9493/sso.png', 'https://github.com/buzzfeed/sso', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (232, '2020-06-24 17:37:44', '2020-06-24 17:37:44', null, 'Fathom Analytics', 'fathom-analytics', 'Fathom tracks users on a website (without collecting personal data) and give you a non-nerdy breakdown of your top content and top referrers. It does so with user-centric rights and privacy, and without selling, sharing or giving away the data you collect. It''s a simple and easy to use for website owners at any technical level.', 'https://img.stackshare.io/service/9116/1b62fea7-e785-4704-a82e-283d2ef1693e.jpeg', 'https://github.com/usefathom/fathom', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (233, '2020-06-24 17:37:44', '2020-06-24 17:37:44', null, 'Piwik', 'piwik', 'Piwik is a full featured PHP MySQL software program that you download and install on your own webserver. Piwik aims to be a Free software alternative to Google Analytics, and is already used on more than 1,000,000 websites. Privacy is built-in!', 'https://img.stackshare.io/service/1430/vEoidUi7.png', 'https://github.com/piwik/piwik', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (234, '2020-06-24 17:37:48', '2020-06-24 17:37:48', null, 'Cloudflare Registrar', 'cloudflare-registrar', 'Cloudflare Registrar lets you securely register and manage your domain names with transparent, no-markup pricing that eliminates surprise renewal fees and hidden add-on charges.', 'https://img.stackshare.io/service/9596/774dec62-8528-4824-aed6-028006e72f9e.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (235, '2020-06-24 17:37:48', '2020-06-24 17:37:48', null, 'GoDaddy', 'godaddy', 'Go Daddy makes registering Domain Names fast, simple, and affordable', 'https://img.stackshare.io/service/42/eH9oma1K.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (236, '2020-06-24 17:37:53', '2020-06-24 17:37:53', null, 'BitBar', 'bitbar', 'Testdroid provides a set of products for Android and iOS app/game testing on real devices. With different testing solutions, you can efficiently develop and test your mobile apps/games in agile way and achieve your business goals.', 'https://img.stackshare.io/service/728/oPSWabPw.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (237, '2020-06-24 17:37:53', '2020-06-24 17:37:53', null, 'Testmunk', 'testmunk', 'Test your app on a large pool of Android and iOS versions and devices. No need to constantly buy and upgrade your devices. Testmunk ensures complete device and OS coverage currently available on the market. Devices are non-jailbroken. We support native and hybrid apps.', 'https://img.stackshare.io/service/2429/dc5747844e85ba6b9a71ece73231eb9e.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (238, '2020-06-24 17:37:57', '2020-06-24 17:37:57', null, 'Rails', 'rails', 'Rails is a web-application framework that includes everything needed to create database-backed web applications according to the Model-View-Controller (MVC) pattern.', 'https://img.stackshare.io/service/990/x57_Lorv.png', 'https://github.com/rails/rails', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (239, '2020-06-24 17:38:03', '2020-06-24 17:38:03', null, 'Avocode', 'avocode', 'Avocode is a cross-platform app that helps designers and developers collaborate and easily handoff designs. Avocode comes with 14 days free trial.', 'https://img.stackshare.io/service/2157/preview.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (240, '2020-06-24 17:43:16', '2020-06-24 17:43:16', null, 'Netty', 'netty', 'Netty is a NIO client server framework which enables quick and easy development of network applications such as protocol servers and clients. It greatly simplifies and streamlines network programming such as TCP and UDP socket server.', 'https://img.stackshare.io/service/3278/netty_icon_256px.png', 'https://github.com/netty/netty', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (241, '2020-06-24 17:43:21', '2020-06-24 17:43:21', null, 'Wildfly', 'wildfly', 'It is a flexible, lightweight, managed application runtime that helps you build amazing applications. It supports the latest standards for web development.', 'https://img.stackshare.io/service/3411/R_inOTNM_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (242, '2020-06-24 17:43:25', '2020-06-24 17:43:25', null, 'JBoss', 'jboss', 'An application platform for hosting your apps that provides an innovative modular, cloud-ready architecture, powerful management and automation, and world class developer productivity.', 'https://img.stackshare.io/service/2188/unnamed.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (243, '2020-06-24 17:43:29', '2020-06-24 17:43:29', null, 'GlassFish', 'glassfish', 'An Application Server means, It can manage Java EE applications You should use GlassFish for Java EE enterprise applications. The need for a seperate Web server is mostly needed in a production environment.', 'https://img.stackshare.io/service/3628/515GX-Cc_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (244, '2020-06-24 17:43:33', '2020-06-24 17:43:33', null, 'Jersey', 'jersey', 'It is open source, production quality, framework for developing RESTful Web Services in Java that provides support for JAX-RS APIs and serves as a JAX-RS (JSR 311 & JSR 339) Reference Implementation. It provides it’s own API that extend the JAX-RS toolkit with additional features and utilities to further simplify RESTful service and client development.', 'https://img.stackshare.io/service/1757/E6ajYzZW_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (245, '2020-06-24 17:43:43', '2020-06-24 17:43:43', null, 'HAProxy', 'haproxy', 'HAProxy (High Availability Proxy) is a free, very fast and reliable solution offering high availability, load balancing, and proxying for TCP and HTTP-based applications.', 'https://img.stackshare.io/service/1179/preview.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (246, '2020-06-24 17:43:48', '2020-06-24 17:43:48', null, 'lighttpd', 'lighttpd', 'lighttpd has a very low memory footprint compared to other webservers and takes care of cpu-load. Its advanced feature-set (FastCGI, CGI, Auth, Output-Compression, URL-Rewriting and many more) make lighttpd the perfect webserver-software for every server that suffers load problems.', 'https://img.stackshare.io/service/1184/796438.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (247, '2020-06-24 17:43:53', '2020-06-24 17:43:53', null, 'Traefik', 'traefik', 'A modern HTTP reverse proxy and load balancer that makes deploying microservices easy. Traefik integrates with your existing infrastructure components and configures itself automatically and dynamically.', 'https://img.stackshare.io/service/5126/soSblPVT_400x400.jpg', 'https://github.com/containous/traefik', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (248, '2020-06-24 17:43:57', '2020-06-24 17:43:57', null, 'Caddy', 'caddy', 'Caddy 2 is a powerful, enterprise-ready, open source web server with automatic HTTPS written in Go.', 'https://img.stackshare.io/service/3834/caddy.png', 'http://github.com/caddyserver/caddy', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (249, '2020-06-24 17:44:02', '2020-06-24 17:44:02', null, 'Envoy', 'envoy', 'Originally built at Lyft, Envoy is a high performance C++ distributed proxy designed for single services and applications, as well as a communication bus and “universal data plane” designed for large microservice “service mesh” architectures.', 'https://img.stackshare.io/service/8416/Tfk-FtVd_400x400.jpg', 'https://github.com/envoyproxy/envoy', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (250, '2020-06-24 17:44:06', '2020-06-24 17:44:06', null, 'Microsoft IIS', 'microsoft-iis', 'Internet Information Services (IIS) for Windows Server is a flexible, secure and manageable Web server for hosting anything on the Web. From media streaming to web applications, IIS''s scalable and open architecture is ready to handle the most demanding tasks.', 'https://img.stackshare.io/service/1056/J5gFiHbG.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (251, '2020-06-24 17:44:45', '2020-06-24 17:44:45', null, 'TeamCity', 'teamcity', 'TeamCity is a user-friendly continuous integration (CI) server for professional developers, build engineers, and DevOps. It is trivial to setup and absolutely free for small teams and open source projects.', 'https://img.stackshare.io/service/1357/317jQkeS.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (252, '2020-06-24 17:44:50', '2020-06-24 17:44:50', null, 'CircleCI', 'circleci', 'Continuous integration and delivery platform helps software teams rapidly release code with confidence by automating the build, test, and deploy process. Offers a modern software development platform that lets teams ramp.', 'https://img.stackshare.io/service/190/CvqrSSFs_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (253, '2020-06-24 17:45:00', '2020-06-24 17:45:00', null, 'Bamboo', 'bamboo', 'Focus on coding and count on Bamboo as your CI and build server! Create multi-stage build plans, set up triggers to start builds upon commits, and assign agents to your critical builds and deployments.', 'https://img.stackshare.io/service/1729/omsJmyCc.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (254, '2020-06-24 17:45:04', '2020-06-24 17:45:04', null, 'Apache Maven', 'maven', 'Maven allows a project to build using its project object model (POM) and a set of plugins that are shared by all projects using Maven, providing a uniform build system. Once you familiarize yourself with how one Maven project builds you automatically know how all Maven projects build saving you immense amounts of time when trying to navigate many projects.', 'https://img.stackshare.io/service/977/maven.png', 'https://github.com/apache/maven', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (255, '2020-06-24 17:45:23', '2020-06-24 17:45:23', null, 'GitLab CI', 'gitlab-ci', 'GitLab offers a continuous integration service. If you add a .gitlab-ci.yml file to the root directory of your repository, and configure your GitLab project to use a Runner, then each merge request or push triggers your CI pipeline.', 'https://img.stackshare.io/service/5545/9pAwHBR0.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (256, '2020-06-24 17:45:57', '2020-06-24 17:45:57', null, 'Azure DevOps', 'azure-devops', 'Azure DevOps provides unlimited private Git hosting, cloud build for continuous integration, agile planning, and release management for continuous delivery to the cloud and on-premises.  Includes broad IDE support.', 'https://img.stackshare.io/service/4313/XNKktHjN_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (257, '2020-06-24 17:46:05', '2020-06-24 17:46:05', null, 'Azure Pipelines', 'azure-pipelines', 'Fast builds with parallel jobs and test execution. Use container jobs to create consistent and reliable builds with the exact tools you need. Create new containers with ease and push them to any registry.', 'https://img.stackshare.io/service/10164/528389819366_e7a0672f0480b3e98d21_512.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (258, '2020-06-24 17:47:01', '2020-06-24 17:47:01', null, 'Cassandra', 'cassandra', 'Partitioning means that Cassandra can distribute your data across multiple machines in an application-transparent matter. Cassandra will automatically repartition as machines are added and removed from the cluster. Row store means that like relational databases, Cassandra organizes data by rows and columns. The Cassandra Query Language (CQL) is a close relative of SQL.', 'https://img.stackshare.io/service/1032/cassandra_small.png', 'https://github.com/apache/cassandra', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (259, '2020-06-24 17:47:14', '2020-06-24 17:47:14', null, 'LiteDB', 'litedb', 'Embedded NoSQL database for .NET.
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (260, '2020-06-24 17:47:22', '2020-06-24 17:47:22', null, 'IndexedDB', 'indexeddb', 'This API uses indexes to enable high-performance searches of this data. While Web Storage is useful for storing smaller amounts of data, it is less useful for storing larger amounts of structured data.', 'https://img.stackshare.io/service/3991/New_Project__92_.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (261, '2020-06-24 17:47:32', '2020-06-24 17:47:32', null, 'Strapi', 'strapi', 'It is an open source Node.js Headless CMS to easily build customisable APIs. It lets you manage your content and distribute it anywhere. It allows you to securely and privately serve your database of choice from your hosting and server of choice.', 'https://ucarecdn.com/2704c731-d8b8-4832-a05e-68882e8c565f/', 'https://github.com/strapi/strapi', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (262, '2020-06-24 17:47:37', '2020-06-24 17:47:37', null, 'Webmin', 'webmin', 'It is a web-based interface for system administration for Unix. Using any modern web browser, you can setup user accounts, Apache, DNS, file sharing and much more. It removes the need to manually edit Unix configuration files.', 'https://img.stackshare.io/service/4208/s7IV7_uQ_200x200.jpg', 'https://github.com/webmin/webmin', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (263, '2020-06-24 17:47:41', '2020-06-24 17:47:41', null, 'Portainer', 'portainer', 'Portainer is an open-source lightweight management UI which allows you to easily manage your Docker environments.
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (264, '2020-06-24 17:47:46', '2020-06-24 17:47:46', null, 'NetData', 'netdata', 'Netdata is distributed, real-time, performance and health monitoring for systems and applications. It is a highly optimized monitoring agent you install on all your systems and containers.', 'https://img.stackshare.io/service/5766/logo_green_fill.png', 'https://github.com/firehol/netdata', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (265, '2020-06-24 17:48:09', '2020-06-24 17:48:09', null, 'Insightly', 'insightly', 'With integrations to Google Apps, Office 365, MailChimp, and major social media sites; great mobile apps for tablets and smart phones; and easy access to a REST API for custom integration, Insightly is the leading small business CRM.', 'https://img.stackshare.io/service/288/dp92uy3vlt86zrj6r23p.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (266, '2020-06-24 17:48:14', '2020-06-24 17:48:14', null, 'Basecamp', 'basecamp', 'Basecamp is a project management and group collaboration tool. The tool includes features for schedules, tasks, files, and messages.', 'https://img.stackshare.io/service/110/X-gfZudw_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (267, '2020-06-24 17:48:18', '2020-06-24 17:48:18', null, 'Capsule', 'capsule', 'Packages any JVM application, no matter how complex, as a single, plain executable JAR. A capsule may directly contain all of the application’s dependencies or simply declare some or all of them, to be downloaded when launched.', 'https://img.stackshare.io/service/3625/capsule.png', 'https://github.com/puniverse/capsule', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (268, '2020-06-24 17:48:23', '2020-06-24 17:48:23', null, 'Pipedrive', 'pipedrive', 'Pipeline tool for active dealmakers. Get super-organized. Close deals in less time. Built by active salespeople and serious web app developers.', 'https://img.stackshare.io/service/2733/7NdrIqpR_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (269, '2020-06-24 17:48:27', '2020-06-24 17:48:27', null, 'HubSpot', 'hubspot', 'Attract, convert, close and delight customers with HubSpot’s complete set of marketing tools. HubSpot all-in-one marketing software helps more than 12,000 companies in 56 countries attract leads and convert them into customers. ', 'https://img.stackshare.io/service/256/9Q0oQwl2_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (270, '2020-06-24 17:48:31', '2020-06-24 17:48:31', null, 'Zoho', 'zoho', 'Unique and powerful suite of software to run your entire business. It contains word processing, spreadsheets, presentations, databases, note-taking, wikis, web conferencing, customer relationship management, project management, invoicing, and other applications.', 'https://img.stackshare.io/service/5654/B4cJBv28_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (271, '2020-06-24 17:48:45', '2020-06-24 17:48:45', null, 'iOS', 'ios', 'It is the operating system that presently powers many of the mobile devices, including the iPhone, iPad, and iPod Touch. It is designed to make your iPhone and iPad experience even faster, more responsive, and more delightful.', 'https://img.stackshare.io/service/2886/ios-logo.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (272, '2020-06-24 17:48:49', '2020-06-24 17:48:49', null, 'Fyipe', 'fyipe', 'It monitors your website, dashboards, API''s, and more and alerts your team when downtime happens. We also give you a Status Page which keeps your customers looped in and improves transparency.', 'https://img.stackshare.io/service/9073/BTXHqAXB_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (273, '2020-06-24 17:48:53', '2020-06-24 17:48:53', null, 'Cachet', 'cachet', 'Cachet is an open source status page system written in PHP, using the Laravel framework.', 'https://img.stackshare.io/service/2749/mH9IpOz7.png', 'https://github.com/cachethq/cachet', '', '', '');
