INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (275, '2020-06-24 17:49:23', '2020-06-24 17:49:23', null, 'PageFate', 'pagefate', 'It is a free status page and incident management tool for your APIs, services or company. It is multi user friendly and comes with two factor authentication via Google or Github for added security. It''s a powerful, managed, heads-free alternative to StatusPage.io and Status.io.', 'https://img.stackshare.io/service/11289/p_qbq0Ag_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (276, '2020-06-24 17:49:36', '2020-06-24 17:49:36', null, 'CoffeeScript', 'coffeescript', 'It adds syntactic sugar inspired by Ruby, Python and Haskell in an effort to enhance JavaScript''s brevity and readability. Specific additional features include list comprehension and de-structuring assignment.', 'https://img.stackshare.io/service/1178/slQydAMv.png', 'https://github.com/jashkenas/coffeescript', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (277, '2020-06-24 17:49:41', '2020-06-24 17:49:41', null, 'TypeScript', 'typescript', 'TypeScript is a language for application-scale JavaScript development. It''s a typed superset of JavaScript that compiles to plain JavaScript.', 'https://img.stackshare.io/service/1612/bynNY5dJ.jpg', 'https://github.com/Microsoft/TypeScript', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (278, '2020-06-24 17:50:03', '2020-06-24 17:50:03', null, 'R Language', 'r-language', 'R provides a wide variety of statistical (linear and nonlinear modelling, classical statistical tests, time-series analysis, classification, clustering, ...) and graphical techniques, and is highly extensible.', 'https://img.stackshare.io/service/1213/r-logo.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (279, '2020-06-24 17:50:12', '2020-06-24 17:50:12', null, 'Scala', 'scala', 'Scala is an acronym for “Scalable Language”. This means that Scala grows with you. You can play with it by typing one-line expressions and observing the results. But you can also rely on it for large mission critical systems, as many companies, including Twitter, LinkedIn, or Intel do. To some, Scala feels like a scripting language. Its syntax is concise and low ceremony; its types get out of the way because the compiler can infer them. ', 'https://img.stackshare.io/service/1012/scala.png', 'https://github.com/scala/scala', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (280, '2020-06-24 17:50:20', '2020-06-24 17:50:20', null, 'Anaconda', 'anaconda', 'A free and open-source distribution of the Python and R programming languages for scientific computing, that aims to simplify package management and deployment. Package versions are managed by the package management system conda.', 'https://img.stackshare.io/service/4168/vB6sRNsh_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (281, '2020-06-24 17:50:24', '2020-06-24 17:50:24', null, 'Perl', 'perl', 'Perl is a general-purpose programming language originally developed for
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (282, '2020-06-24 17:50:43', '2020-06-24 17:50:43', null, 'Packer', 'packer', 'Packer automates the creation of any type of machine image. It embraces modern configuration management by encouraging you to use automated scripts to install and configure the software within your Packer-made images.', 'https://img.stackshare.io/service/967/packer.png', 'https://github.com/mitchellh/packer', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (283, '2020-06-24 17:50:47', '2020-06-24 17:50:47', null, 'Cloud Foundry', 'cloud-foundry', 'Cloud Foundry is an open platform as a service (PaaS) that provides a choice of clouds, developer frameworks, and application services. Cloud Foundry makes it faster and easier to build, test, deploy, and scale applications.', 'https://img.stackshare.io/service/893/VJI_bxtd_200x200.jpg', 'https://github.com/cloudfoundry/cf-release', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (284, '2020-06-24 17:50:52', '2020-06-24 17:50:52', null, 'Pulumi', 'pulumi', 'Pulumi is a cloud development platform that makes creating cloud programs easy and productive. Skip the YAML and just write code. Pulumi is multi-language, multi-cloud and fully extensible in both its engine and ecosystem of packages.', 'https://img.stackshare.io/service/9053/pulumi_mark_flat_onPurple.png', 'https://github.com/pulumi/pulumi', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (285, '2020-06-24 17:51:10', '2020-06-24 17:51:10', null, 'λ Gordon', 'gordon-2', 'Gordon is a tool to create, wire and deploy AWS Lambdas using CloudFormation
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (286, '2020-06-24 17:51:32', '2020-06-24 17:51:32', null, 'Google Cloud Bigtable', 'google-cloud-bigtable', 'Google Cloud Bigtable offers you a fast, fully managed, massively scalable NoSQL database service that''s ideal for web, mobile, and Internet of Things applications requiring terabytes to petabytes of data. Unlike comparable market offerings, Cloud Bigtable doesn''t require you to sacrifice speed, scale, or cost efficiency when your applications grow. Cloud Bigtable has been battle-tested at Google for more than 10 years—it''s the database driving major applications such as Google Analytics and Gmail.', 'https://img.stackshare.io/service/2977/Cloud-Bigtable.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (287, '2020-06-24 17:51:37', '2020-06-24 17:51:37', null, 'Amazon Redshift', 'amazon-redshift', 'It is optimized for data sets ranging from a few hundred gigabytes to a petabyte or more and costs less than $1,000 per terabyte per year, a tenth the cost of most traditional data warehousing solutions.', 'https://img.stackshare.io/service/386/amazon-redshift.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (288, '2020-06-24 17:51:41', '2020-06-24 17:51:41', null, 'Snowflake', 'snowflake', 'Snowflake eliminates the administration and management demands of traditional data warehouses and big data platforms. Snowflake is a true data warehouse as a service running on Amazon Web Services (AWS)—no infrastructure to manage and no knobs to turn.', 'https://img.stackshare.io/service/5889/QYHZHC4n_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (289, '2020-06-24 17:51:45', '2020-06-24 17:51:45', null, 'Google Analytics', 'google-analytics', 'Google Analytics lets you measure your advertising ROI as well as track your Flash, video, and social networking sites and applications.', 'https://img.stackshare.io/service/64/cU74ahCn_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (290, '2020-06-24 17:51:51', '2020-06-24 17:51:51', null, 'Amazon Athena', 'amazon-athena', 'Amazon Athena is an interactive query service that makes it easy to analyze data in Amazon S3 using standard SQL. Athena is serverless, so there is no infrastructure to manage, and you pay only for the queries that you run.', 'https://img.stackshare.io/service/6091/amazon-athena.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (291, '2020-06-24 17:52:13', '2020-06-24 17:52:13', null, 'Splunk', 'splunk', 'It provides the leading platform for Operational Intelligence. Customers use it to search, monitor, analyze and visualize machine data.', 'https://img.stackshare.io/service/1732/oru8eUWh_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (292, '2020-06-24 17:52:21', '2020-06-24 17:52:21', null, 'Apache Spark', 'spark', 'Spark is a fast and general processing engine compatible with Hadoop data. It can run in Hadoop clusters through YARN or Spark''s standalone mode, and it can process data in HDFS, HBase, Cassandra, Hive, and any Hadoop InputFormat. It is designed to perform both batch processing (similar to MapReduce) and new workloads like streaming, interactive queries, and machine learning.', 'https://img.stackshare.io/service/2220/ca72c4715da998b0bf5d1c857958bed3.png', 'https://github.com/apache/spark', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (293, '2020-06-24 17:52:37', '2020-06-24 17:52:37', null, 'Angular 2', 'angular-2', 'It is a TypeScript-based open-source web application framework. It is a development platform for building mobile and desktop web applications.', 'https://img.stackshare.io/service/3745/cb8U-gL6_400x400.jpg', 'https://github.com/angular/angular', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (294, '2020-06-24 17:53:07', '2020-06-24 17:53:07', null, 'PhoneGap', 'phonegap', 'PhoneGap is a web platform that exposes native mobile device apis and data to JavaScript. PhoneGap is a distribution of Apache Cordova. PhoneGap allows you to use standard web technologies such as HTML5, CSS3, and JavaScript for cross-platform development, avoiding each mobile platforms'' native development language. Applications execute within wrappers targeted to each platform, and rely on standards-compliant API bindings to access each device''s sensors, data, and network status.', 'https://img.stackshare.io/service/777/NgaEDjHt.jpg', 'https://github.com/phonegap/phonegap', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (295, '2020-06-24 17:53:13', '2020-06-24 17:53:13', null, 'Xamarin', 'xamarin', 'Xamarin’s Mono-based products enable .NET developers to use their existing code, libraries and tools (including Visual Studio*), as well as skills in .NET and the C# programming language, to create mobile applications for the industry’s most widely-used mobile devices, including Android-based smartphones and tablets, iPhone, iPad and iPod Touch.', 'https://img.stackshare.io/service/211/RDXWoY7W.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (296, '2020-06-24 17:53:30', '2020-06-24 17:53:30', null, 'Flutter', 'flutter', 'Flutter is a mobile app SDK to help developers and designers build modern mobile apps for iOS and Android.', 'https://img.stackshare.io/service/7180/flutter-mark-square-100.png', 'https://github.com/flutter/flutter', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (297, '2020-06-24 17:53:38', '2020-06-24 17:53:38', null, 'Apache Cordova', 'apache-cordova', 'Apache Cordova is a set of device APIs that allow a mobile app developer to access native device function such as the camera or accelerometer from JavaScript. Combined with a UI framework such as jQuery Mobile or Dojo Mobile or Sencha Touch, this allows a smartphone app to be developed with just HTML, CSS, and JavaScript.', 'https://img.stackshare.io/service/1716/cordova_256.png', 'https://github.com/apache/cordova-cli', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (298, '2020-06-24 17:53:54', '2020-06-24 17:53:54', null, 'Codeanywhere', 'codeanywhere', 'A development platform that enables you to not only edit your files from underlying services like FTP, GitHub, Dropbox and the like, but on top of that gives you the ability to collaborate, embed and share through Codeanywhere on any device.', 'https://img.stackshare.io/service/829/KoCAQODI.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (299, '2020-06-24 17:54:47', '2020-06-24 17:54:47', null, 'Theia', 'theia', 'Theia provides the end-user with a full-fledged multi-language IDE (not just a smart editor) and supports equally the paradigm of Cloud IDE and Desktop IDE.', 'https://img.stackshare.io/service/7263/28530323.png', 'https://github.com/theia-ide/theia', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (300, '2020-06-24 17:54:57', '2020-06-24 17:54:57', null, 'Red Hat Codeready Workspaces', 'red-hat-codeready-workspaces', 'Built on the open Eclipse Che project, Red Hat CodeReady Workspaces provides developer workspaces, which include all the tools and the dependencies that are needed to code, build, test, run, and debug applications. ', 'https://img.stackshare.io/service/198/unnamed.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (301, '2020-06-24 17:55:21', '2020-06-24 17:55:21', null, 'AWS CodeDeploy', 'aws-codedeploy', 'AWS CodeDeploy is a service that automates code deployments to Amazon EC2 instances. AWS CodeDeploy makes it easier for you to rapidly release new features, helps you avoid downtime during deployment, and handles the complexity of updating your applications. ', 'https://img.stackshare.io/service/1888/aws-codedeploy.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (302, '2020-06-24 17:55:30', '2020-06-24 17:55:30', null, 'AWS Elastic Beanstalk', 'aws-elastic-beanstalk', 'Once you upload your application, Elastic Beanstalk automatically handles the deployment details of capacity provisioning, load balancing, auto-scaling, and application health monitoring.', 'https://img.stackshare.io/service/210/aws-elastic-beanstalk.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (303, '2020-06-24 17:55:35', '2020-06-24 17:55:35', null, 'AWS Config', 'aws-config', 'AWS Config is a fully managed service that provides you with an AWS resource inventory, configuration history, and configuration change notifications to enable security and governance. With AWS Config you can discover existing AWS resources, export a complete inventory of your AWS resources with all configuration details, and determine how a resource was configured at any point in time. These capabilities enable compliance auditing, security analysis, resource change tracking, and troubleshooting.', 'https://img.stackshare.io/service/1906/16ffae8c667bdbc6a4969f6f02090652.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (304, '2020-06-24 17:55:43', '2020-06-24 17:55:43', null, 'Azure Resource Manager', 'azure-resource-manager', 'It is the deployment and management service for Azure. It provides a management layer that enables you to create, update, and delete resources in your Azure subscription. You use management features, like access control, locks, and tags, to secure and organize your resources after deployment.', 'https://img.stackshare.io/service/6343/New_Project__82_.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (305, '2020-06-24 17:55:56', '2020-06-24 17:55:56', null, 'Puppet Labs', 'puppet', 'Puppet is an automated administrative engine for your Linux, Unix, and Windows systems and performs administrative tasks (such as adding users, installing packages, and updating server configurations) based on a centralized specification.', 'https://img.stackshare.io/service/421/954f7381089ac290b4690c5ffd9dd7d3.png', 'https://github.com/puppetlabs/puppet', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (306, '2020-06-24 17:56:05', '2020-06-24 17:56:05', null, 'VisualOps', 'visualops', 'VisualOps has a WYSIWYG editor to design, configure and provision your AWS cloud applications. Once the applications are deployed, VisualOps continuously monitors and manages the apps to ensure they always run in the defined states.', 'https://img.stackshare.io/service/828/fN_nQ9jI.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (307, '2020-06-24 17:56:09', '2020-06-24 17:56:09', null, 'AWS OpsWorks', 'aws-opswork', 'Start from templates for common technologies like Ruby, Node.JS, PHP, and Java, or build your own using Chef recipes to install software packages and perform any task that you can script. AWS OpsWorks can scale your application using automatic load-based or time-based scaling and maintain the health of your application by detecting failed instances and replacing them. You have full control of deployments and automation of each component&nbsp;', 'https://img.stackshare.io/service/419/aws-opswork.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (308, '2020-06-24 17:56:23', '2020-06-24 17:56:23', null, 'Hugo', 'hugo', 'Hugo is a static site generator written in Go. It is optimized for speed, easy use and configurability. Hugo takes a directory with content and templates and renders them into a full html website. Hugo makes use of markdown files with front matter for meta data.', 'https://img.stackshare.io/service/1158/hugo-icon.png', 'https://github.com/spf13/hugo', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (309, '2020-06-24 17:56:29', '2020-06-24 17:56:29', null, 'Hexo', 'hexo', 'Hexo is a fast, simple and powerful blog framework. It parses your posts with Markdown or other render engine and generates static files with the beautiful theme. All of these just take seconds.', 'https://img.stackshare.io/service/1154/mQZOTo9f.png', 'https://github.com/hexojs/hexo', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (310, '2020-06-24 17:56:43', '2020-06-24 17:56:43', null, 'Pelican', 'pelican', 'Pelican is a static site generator that supports Markdown and reST syntax. Write your weblog entries directly with your editor of choice (vim!) in reStructuredText or Markdown.', 'https://img.stackshare.io/service/1152/8fc5b7f80b98bcc67512795fe5fb9291.png', 'https://github.com/getpelican/pelican', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (311, '2020-06-24 17:57:02', '2020-06-24 17:57:02', null, 'Nomad', 'nomad', 'Nomad is a cluster manager, designed for both long lived services and short lived batch processing workloads. Developers use a declarative job specification to submit work, and Nomad ensures constraints are satisfied and resource utilization is optimized by efficient task packing. Nomad supports all major operating systems and virtualized, containerized, or standalone applications.
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (312, '2020-06-24 17:57:06', '2020-06-24 17:57:06', null, 'OpenStack', 'openstack', 'OpenStack is a cloud operating system that controls large pools of compute, storage, and networking resources throughout a datacenter, all managed through a dashboard that gives administrators control while empowering their users to provision resources through a web interface.', 'https://img.stackshare.io/service/770/GCPRyAva.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (313, '2020-06-24 17:57:15', '2020-06-24 17:57:15', null, 'DC/OS', 'dcos', 'Unlike traditional operating systems, DC/OS spans multiple machines within a network, aggregating their resources to maximize utilization by distributed applications.', 'https://img.stackshare.io/service/5190/sZw79H1D.jpg', 'https://github.com/dcos/dcos', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (314, '2020-06-24 17:57:33', '2020-06-24 17:57:33', null, 'Docker', 'docker', 'The Docker Platform is the industry-leading container platform for continuous, high-velocity innovation, enabling organizations to seamlessly build and share any application — from legacy to what comes next  — and securely run them anywhere', 'https://img.stackshare.io/service/586/n4u37v9t_400x400.png', 'https://github.com/docker/docker', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (315, '2020-06-24 17:57:43', '2020-06-24 17:57:43', null, 'Cowboy', 'cowboy', 'Cowboy aims to provide a complete HTTP stack in a small code base. It is optimized for low latency and low memory usage, in part because it uses binary strings. Cowboy provides routing capabilities, selectively dispatching requests to handlers written in Erlang.', 'https://img.stackshare.io/service/2738/1166740.png', 'https://github.com/ninenines/cowboy', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (316, '2020-06-24 17:57:53', '2020-06-24 17:57:53', null, 'Google Cloud Datastore', 'google-cloud-datastore', 'Use a managed, NoSQL, schemaless database for storing non-relational data. Cloud Datastore automatically scales as you need it and supports transactions as well as robust, SQL-like queries.', 'https://img.stackshare.io/service/2754/google_cloud_datastore.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (317, '2020-06-24 17:58:01', '2020-06-24 17:58:01', null, 'Amazon SimpleDB', 'amazon-simpledb', 'Developers simply store and query data items via web services requests and Amazon SimpleDB does the rest. Behind the scenes, Amazon SimpleDB creates and manages multiple geographically distributed replicas of your data automatically to enable high availability and data durability. Amazon SimpleDB provides a simple web services interface to create and store multiple data sets, query your data easily, and return the results. Your data is automatically indexed, making it easy to quickly find the information that you need. There is no need to pre-define a schema or change a schema if new data is added later. And scale-out is as simple as creating new domains, rather than building out new servers.', 'https://img.stackshare.io/service/403/amazon-simpledb.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (318, '2020-06-24 17:58:05', '2020-06-24 17:58:05', null, 'Amazon S3', 'amazon-s3', 'Amazon Simple Storage Service provides a fully redundant data storage infrastructure for storing and retrieving any amount of data, at any time, from anywhere on the web', 'https://img.stackshare.io/service/25/amazon-s3.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (319, '2020-06-24 17:58:26', '2020-06-24 17:58:26', null, 'ClearDB', 'cleardb', 'ClearDB uses a combination of advanced replication techniques, advanced cluster technology, and layered web services to provide you with a MySQL database that is "smarter" than usual.', 'https://img.stackshare.io/service/317/data_ok.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (320, '2020-06-24 17:58:31', '2020-06-24 17:58:31', null, 'TempoDB', 'tempodb', 'TempoDB is the first database service for time series data (ex: measuring thermostat temperatures, network latencies, heart rates). Time series is a unique Big Data problem that breaks traditional databases (MySQL, MongoDB, etc). Today, businesses spend months and millions attempting to build solutions to manage all this data and yet still fail to store as much as they need or analyze it effectively. TempoDB is a purpose-built database service that enables businesses to store and analyze massive streams of time series data, so they can learn from the past, understand the present, and predict the future.', 'https://img.stackshare.io/service/671/NDi4eSNA.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (321, '2020-06-24 17:58:35', '2020-06-24 17:58:35', null, 'TrueVault', 'truevault', 'TrueVault was built to help startups simplify the complexities of HIPAA. TrueVault will save you hundreds of dev hours. Focus on building your software''s core functionality, and let TrueVault protect your data at HIPAA-security levels.', 'https://img.stackshare.io/service/697/xUyVrVfb.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (322, '2020-06-24 17:58:44', '2020-06-24 17:58:44', null, 'Azure SQL Database', 'azure-sql-database', 'It is the intelligent, scalable, cloud database service that provides the broadest SQL Server engine compatibility and up to a 212% return on investment. It is a database service that can quickly and efficiently scale to meet demand, is automatically highly available, and supports a variety of third party software.', 'https://img.stackshare.io/service/3433/OJB_wH-7_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (323, '2020-06-24 17:58:58', '2020-06-24 17:58:58', null, 'Tastypie', 'tastypie', 'Tastypie is a webservice API framework for Django. It provides a convenient, yet powerful and highly customizable abstraction for creating REST-style interfaces.', 'https://img.stackshare.io/no-img-open-source.png', 'https://github.com/toastdriven/django-tastypie', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (324, '2020-06-24 17:59:25', '2020-06-24 17:59:25', null, 'Tornado', 'tornado', 'By using non-blocking network I/O, Tornado can scale to tens of thousands of open connections, making it ideal for long polling, WebSockets, and other applications that require a long-lived connection to each user.', 'https://img.stackshare.io/service/1002/tornado.png', 'https://github.com/tornadoweb/tornado', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (325, '2020-06-24 17:59:29', '2020-06-24 17:59:29', null, 'ExpressJS', 'expressjs', 'Express is a minimal and flexible node.js web application framework, providing a robust set of features for building single and multi-page, and hybrid web applications.', 'https://img.stackshare.io/service/1163/hashtag.png', 'https://github.com/visionmedia/express', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (326, '2020-06-24 17:59:42', '2020-06-24 17:59:42', null, 'Bottle', 'bottle', 'It is distributed as a single file module and has no dependencies other than the Python Standard Library. It has fast and pythonic built-in template engine and support for mako, jinja2 and cheetah templates.', 'https://img.stackshare.io/service/3727/g6549-8-0_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (327, '2020-06-24 18:00:37', '2020-06-24 18:00:37', null, 'CLion', 'clion', 'Knowing your code through and through, CLion can take care of the routine while you focus on the important things. Boost your productivity with the keyboard-centric approach (Vim-emulation plugin is also available in plugin repository), full coding assistance, smart and relevant code completion, fast project navigation, intelligent intention actions, and reliable refactorings.', 'https://img.stackshare.io/service/1445/icon_CLion.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (328, '2020-06-24 18:00:42', '2020-06-24 18:00:42', null, 'Visual Basic', 'visual-basic', 'Visual Basic is derived from BASIC and enables the rapid application development (RAD) of graphical user interface (GUI) applications, access to databases using Data Access Objects, Remote Data Objects, or ActiveX Data Objects, and creation of ActiveX controls and objects.', 'https://img.stackshare.io/service/1016/10ffe9eda0de4670955cc9bdfa78fe9b.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (329, '2020-06-24 18:00:51', '2020-06-24 18:00:51', null, 'Loggly', 'loggly', 'The world''s most popular cloud-based log management service delivers application intelligence.', 'https://img.stackshare.io/service/83/jy01f4p69n78p0nl4xou.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (330, '2020-06-24 18:00:56', '2020-06-24 18:00:56', null, 'Graylog', 'graylog', 'Centralize and aggregate all your log files for 100% visibility. Use our powerful query language to search through terabytes of log data to discover and analyze important information.', 'https://img.stackshare.io/service/4392/_HU28D42.png', 'https://github.com/Graylog2/graylog2-server', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (331, '2020-06-24 18:01:08', '2020-06-24 18:01:08', null, 'Tableau', 'tableau', 'Tableau can help anyone see and understand their data. Connect to almost any database, drag and drop to create visualizations, and share with a click.', 'https://img.stackshare.io/service/2584/ZadESXl4_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (332, '2020-06-24 18:01:17', '2020-06-24 18:01:17', null, 'AppDynamics', 'appdynamics', 'AppDynamics develops application performance management (APM) solutions that deliver problem resolution for highly distributed applications through transaction flow monitoring and deep diagnostics.', 'https://img.stackshare.io/service/105/C0eOfY-7.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (333, '2020-06-24 18:01:22', '2020-06-24 18:01:22', null, 'Datadog', 'datadog', 'Datadog is the leading service for cloud-scale monitoring. It is used by IT, operations, and development teams who build and operate applications that run on dynamic or hybrid cloud infrastructure. Start monitoring in minutes with Datadog!', 'https://img.stackshare.io/service/669/Y0o5D0_u.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (334, '2020-06-24 18:02:22', '2020-06-24 18:02:22', null, 'NeoBundle', 'neobundle', 'NeoBundle is a next generation Vim plugin manager. This plugin is based on Vundle, but I renamed and added tons of features, while Vundle tends to stay simple.', 'https://img.stackshare.io/no-img-open-source.png', 'https://github.com/Shougo/neobundle.vim', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (335, '2020-06-24 18:02:30', '2020-06-24 18:02:30', null, 'NCrunch', 'ncrunch', 'It is an automated concurrent testing tool for Visual Studio.
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (336, '2020-06-24 18:02:34', '2020-06-24 18:02:34', null, 'Ionide', 'ionide', 'It includes all the necessary features you’d find in a modern IDE - autocomplete, tooltips, document formatting, syntax and error highlighting, and many more.', 'https://img.stackshare.io/service/9928/70GwlpQ1_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (337, '2020-06-24 18:03:09', '2020-06-24 18:03:09', null, 'Android SDK', 'android', 'Android provides a rich application framework that allows you to build innovative apps and games for mobile devices in a Java language environment.', 'https://img.stackshare.io/service/1010/m8jf0po4imu8t5eemjdd.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (338, '2020-06-24 18:03:17', '2020-06-24 18:03:17', null, 'WordPress', 'wordpress', 'The core software is built by hundreds of community volunteers, and when you’re ready for more there are thousands of plugins and themes available to transform your site into almost anything you can imagine. Over 60 million people have chosen WordPress to power the place on the web they call “home” — we’d love you to join the family.', 'https://img.stackshare.io/service/250/logo.png', 'https://github.com/WordPress/WordPress', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (339, '2020-06-24 18:03:39', '2020-06-24 18:03:39', null, 'C', 'c', '', 'https://img.stackshare.io/no-img-open-source.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (340, '2020-06-24 18:03:43', '2020-06-24 18:03:43', null, 'Abstract', 'abstract', 'Abstract builds upon and extends the stable technology of Git to host and manage your work.', 'https://img.stackshare.io/service/7300/WIrU3jiP_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (341, '2020-06-24 18:03:48', '2020-06-24 18:03:48', null, 'Go', 'go', 'Go is expressive, concise, clean, and efficient. Its concurrency mechanisms make it easy to write programs that get the most out of multicore and networked machines, while its novel type system enables flexible and modular program construction. Go compiles quickly to machine code yet has the convenience of garbage collection and the power of run-time reflection. It''s a fast, statically typed, compiled language that feels like a dynamically typed, interpreted language.', 'https://img.stackshare.io/service/1005/O6AczwfV_400x400.png', 'https://github.com/golang/go', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (342, '2020-06-24 18:03:58', '2020-06-24 18:03:58', null, 'Kotlin', 'kotlin', 'Kotlin is a statically typed programming language for the JVM, Android and the browser, 100% interoperable with Java', 'https://img.stackshare.io/service/3750/pCfEzr6L.png', 'https://github.com/JetBrains/kotlin', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (343, '2020-06-24 18:04:16', '2020-06-24 18:04:16', null, 'Dart', 'dart', 'Dart is a cohesive, scalable platform for building apps that run on the web (where you can use Polymer) or on servers (such as with Google Cloud Platform). Use the Dart language, libraries, and tools to write anything from simple scripts to full-featured apps.', 'https://img.stackshare.io/service/1646/Twitter-02.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (344, '2020-06-24 18:04:34', '2020-06-24 18:04:34', null, 'PyTorch', 'pytorch', 'PyTorch is not a Python binding into a monolothic C++ framework. It is built to be deeply integrated into Python. You can use it naturally like you would use numpy / scipy / scikit-learn etc.', 'https://img.stackshare.io/service/8171/YYpjkbVn_400x400.jpg', 'https://github.com/pytorch/pytorch', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (345, '2020-06-24 18:04:42', '2020-06-24 18:04:42', null, 'MXNet', 'mxnet', 'A deep learning framework designed for both efficiency and flexibility. It allows you to mix symbolic and imperative programming to maximize efficiency and productivity. At its core, it contains a dynamic dependency scheduler that automatically parallelizes both symbolic and imperative operations on the fly.', 'https://img.stackshare.io/service/8352/kxyKWxfA_400x400.jpg', 'https://github.com/apache/incubator-mxnet', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (346, '2020-06-24 18:04:46', '2020-06-24 18:04:46', null, 'Gluon', 'gluon', 'A new open source deep learning interface which allows developers to more easily and quickly build machine learning models, without compromising performance. Gluon provides a clear, concise API for defining machine learning models using a collection of pre-built, optimized neural network components.', 'https://img.stackshare.io/service/7729/gluon-api.png', 'https://github.com/gluon-api/gluon-api/', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (347, '2020-06-24 18:04:50', '2020-06-24 18:04:50', null, 'Aerosolve', 'aerosolve', 'This library is meant to be used with sparse, interpretable features such as those that commonly occur in search (search keywords, filters) or pricing (number of rooms, location, price). It is not as interpretable with problems with very dense non-human interpretable features such as raw pixels or audio samples.', 'https://img.stackshare.io/service/3131/aerosolve2.png', 'https://github.com/airbnb/aerosolve', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (348, '2020-06-24 18:04:55', '2020-06-24 18:04:55', null, 'Swift AI', 'swift-ai', 'Swift AI is a high-performance AI and machine learning library written entirely in Swift. We currently support iOS and OS X, with support for more platforms coming soon!', 'https://img.stackshare.io/no-img-open-source.png', 'https://github.com/collinhundley/Swift-AI', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (349, '2020-06-24 18:05:16', '2020-06-24 18:05:16', null, 'XGBoost', 'xgboost', 'Scalable, Portable and Distributed Gradient Boosting (GBDT, GBRT or GBM) Library, for Python, R, Java, Scala, C++ and more. Runs on single machine, Hadoop, Spark, Flink and DataFlow', 'https://img.stackshare.io/service/9899/xgboost400.png', 'https://github.com/dmlc/xgboost/', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (350, '2020-06-24 18:05:20', '2020-06-24 18:05:20', null, 'H2O', 'h2o', 'H2O.ai is the maker behind H2O, the leading open source machine learning platform for smarter applications and data products. H2O operationalizes data science by developing and deploying algorithms and models for R, Python and the Sparkling Water API for Spark.', 'https://img.stackshare.io/service/5001/DTgFCs-n_400x400.png', 'https://github.com/h2oai/h2o-3', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (351, '2020-06-24 18:05:34', '2020-06-24 18:05:34', null, 'Theano', 'theano', 'Theano is a Python library that lets you to define, optimize, and evaluate mathematical expressions, especially ones with multi-dimensional arrays (numpy.ndarray). Using Theano it is possible to attain speeds rivaling hand-crafted C impleme', 'https://img.stackshare.io/service/6241/theano.png', 'https://github.com/Theano/Theano', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (352, '2020-06-24 18:06:44', '2020-06-24 18:06:44', null, 'Ruby', 'ruby', 'Ruby is a language of careful balance. Its creator, Yukihiro “Matz” Matsumoto, blended parts of his favorite languages (Perl, Smalltalk, Eiffel, Ada, and Lisp) to form a new language that balanced functional programming with imperative programming.', 'https://img.stackshare.io/service/989/ruby.png', 'https://github.com/ruby/ruby', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (353, '2020-06-24 18:06:55', '2020-06-24 18:06:55', null, 'Zabbix', 'zabbix', 'Zabbix is a mature and effortless enterprise-class open source monitoring solution for network monitoring and application monitoring of millions of metrics.', 'https://img.stackshare.io/service/1705/MlkWTc_x.png', 'https://github.com/zabbix/zabbix', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (354, '2020-06-24 18:07:04', '2020-06-24 18:07:04', null, 'Icinga', 'icinga', 'It monitors availability and performance, gives you simple access to relevant data and raises alerts to keep you in the loop. It was originally created as a fork of the Nagios system monitoring application.', 'https://img.stackshare.io/service/1696/cGOgBLP1_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (355, '2020-06-24 18:07:08', '2020-06-24 18:07:08', null, 'Solarwinds', 'solarwinds', 'Developed by network and systems engineers who know what it takes to manage today''s dynamic IT environments, SolarWinds has a deep connection to the IT community.', 'https://img.stackshare.io/service/3536/uSalz79X_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (356, '2020-06-24 18:07:16', '2020-06-24 18:07:16', null, 'PRTG', 'prtg', 'It can monitor and classify system conditions like bandwidth usage or uptime and collect statistics from miscellaneous hosts as switches, routers, servers and other devices and applications.', 'https://img.stackshare.io/service/3617/DdOfMgKQ_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (357, '2020-06-24 18:07:42', '2020-06-24 18:07:42', null, 'XAMPP', 'xampp', 'It consists mainly of the Apache HTTP Server, MariaDB database, and interpreters for scripts written in the PHP and Perl programming languages.', 'https://img.stackshare.io/service/1631/XAMPP_128.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (358, '2020-06-24 18:07:46', '2020-06-24 18:07:46', null, 'Sanic', 'sanic', 'Sanic is a Flask-like Python 3.5+ web server that''s written to go fast. It''s based on the work done by the amazing folks at magicstack. On top of being Flask-like, Sanic supports async request handlers.', 'https://img.stackshare.io/no-img-open-source.png', 'https://github.com/channelcat/sanic', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (359, '2020-06-24 18:08:00', '2020-06-24 18:08:00', null, 'OneDrive', 'onedrive', 'Outlook.com is a free, personal email service from Microsoft. Keep your inbox clutter-free with powerful organizational tools, and collaborate easily with OneDrive and Office Online integration.', 'https://img.stackshare.io/service/1814/X4ZS9emh_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (360, '2020-06-24 18:08:08', '2020-06-24 18:08:08', null, 'Dropmark', 'dropmark', 'Dropmark offers super simple drag-and-drop file sharing, like a number of web apps before it, but if you want to use it for more you can create presentations, slideshows, and collaborate with others just as easily.', 'https://img.stackshare.io/service/243/drop.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (361, '2020-06-24 18:08:12', '2020-06-24 18:08:12', null, 'Bitcasa', 'bitcasa', 'Your personal cloud storage platform. Simple, private & secure, as much space as you need, for all your devices.', 'https://img.stackshare.io/service/1096/qQAg7rlm.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (362, '2020-06-24 18:08:26', '2020-06-24 18:08:26', null, 'Microsoft SharePoint', 'microsoft-sharepoint', 'It empowers teamwork with dynamic and productive team sites for every project team, department, and division. Share and manage content, knowledge, and applications to empower teamwork, quickly find information, and seamlessly collaborate across the organization. ', 'https://img.stackshare.io/service/2274/pDetc4fK_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (363, '2020-06-24 18:08:35', '2020-06-24 18:08:35', null, 'G Suite', 'g-suite', 'An integrated suite of secure, cloud-native collaboration and productivity apps. It includes Gmail, Docs, Drive, Calendar, Meet and more.', 'https://img.stackshare.io/service/247/oYkAxyQM_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (364, '2020-06-24 18:08:39', '2020-06-24 18:08:39', null, 'Evernote', 'evernote', 'Take notes to a new level with Evernote, the productivity app that keeps your projects, ideas, and inspiration handy across all your digital devices. It helps you capture and prioritize ideas, projects, and to-do lists, so nothing falls through the cracks.', 'https://img.stackshare.io/service/1664/Msdwofz8_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (365, '2020-06-24 18:08:54', '2020-06-24 18:08:54', null, 'Google Cloud Storage', 'google-cloud-storage', 'Google Cloud Storage allows world-wide storing and retrieval of any amount of data and at any time. It provides a simple programming interface which enables developers to take advantage of Google''s own reliable and fast networking infrastructure to perform data operations in a secure and cost effective manner. If expansion needs arise, developers can benefit from the scalability provided by Google''s infrastructure.', 'https://img.stackshare.io/service/694/Cloud_Storage.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (366, '2020-06-24 18:08:58', '2020-06-24 18:08:58', null, 'iCloud', 'icloud', 'Sign in to iCloud to access your photos, videos, documents, notes, contacts, and more. Use your Apple ID or create a new account to start using Apple services.', 'https://img.stackshare.io/service/7193/iEqpsbUA_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (367, '2020-06-24 18:09:02', '2020-06-24 18:09:02', null, 'Google Docs', 'google-docs', 'It is a word processor included as part of a free, web-based software office suite offered by Google. It brings your documents to life with smart editing and styling tools to help you easily format text and paragraphs.', 'https://img.stackshare.io/service/4575/google-docs.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (368, '2020-06-24 18:09:20', '2020-06-24 18:09:20', null, 'Bower', 'bower', 'Bower is a package manager for the web. It offers a generic, unopinionated solution to the problem of front-end package management, while exposing the package dependency model via an API that can be consumed by a more opinionated build stack. There are no system wide dependencies, no dependencies are shared between different apps, and the dependency tree is flat.', 'https://img.stackshare.io/service/847/66db62603f426a8fc6664081811be6d4.png', 'https://github.com/bower/bower', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (369, '2020-06-24 18:09:24', '2020-06-24 18:09:24', null, 'NuGet', 'nuget', 'A free and open-source package manager designed for the Microsoft development platform. It is also distributed as a Visual Studio extension.', 'https://img.stackshare.io/service/2637/220px-NuGet_project_logo.svg.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (370, '2020-06-24 18:09:38', '2020-06-24 18:09:38', null, 'Apache Mesos', 'mesos', 'Apache Mesos is a cluster manager that simplifies the complexity of running applications on a shared pool of servers.', 'https://img.stackshare.io/service/914/d64b637225a3e671799940d5fe13c76b.png', 'https://github.com/apache/mesos/tree/master', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (371, '2020-06-24 18:10:42', '2020-06-24 18:10:42', null, 'Concourse', 'concourse', 'Concourse''s principles reduce the risk of switching to and from Concourse, by encouraging practices that decouple your project from your CI''s little details, and keeping all configuration in declarative files that can be checked into version control. ', 'https://img.stackshare.io/service/4949/jnsjSQcw_400x400.jpg', 'https://github.com/concourse/concourse', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (372, '2020-06-24 18:10:59', '2020-06-24 18:10:59', null, 'AWS Glue', 'aws-glue', 'A fully managed extract, transform, and load (ETL) service that makes it easy for customers to prepare and load their data for analytics.', 'https://img.stackshare.io/service/8906/AWS-Glue_4x.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (373, '2020-06-24 18:11:03', '2020-06-24 18:11:03', null, 'Airflow', 'airflow', 'Use Airflow to author workflows as directed acyclic graphs (DAGs) of tasks. The Airflow scheduler executes your tasks on an array of workers while following the specified dependencies. Rich command lines utilities makes performing complex surgeries on DAGs a snap. The rich user interface makes it easy to visualize pipelines running in production, monitor progress and troubleshoot issues when needed.', 'https://img.stackshare.io/service/3130/airflow.png', 'https://github.com/airbnb/airflow', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (374, '2020-06-24 18:11:08', '2020-06-24 18:11:08', null, 'AWS Step Functions', 'aws-step-functions', 'AWS Step Functions makes it easy to coordinate the components of distributed applications and microservices using visual workflows. Building applications from individual components that each perform a discrete function lets you scale and change applications quickly.', 'https://img.stackshare.io/service/6089/SWF-e64610d24b6e458c257f1105d8aa926f4a524182.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (375, '2020-06-24 18:11:12', '2020-06-24 18:11:12', null, 'Apache NiFi', 'apache-nifi', 'An easy to use, powerful, and reliable system to process and distribute data. It supports powerful and scalable directed graphs of data routing, transformation, and system mediation logic.', 'https://img.stackshare.io/service/8447/qpL7Veso_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (376, '2020-06-24 18:11:17', '2020-06-24 18:11:17', null, 'AWS Batch', 'aws-batch', 'It enables developers, scientists, and engineers to easily and efficiently run hundreds of thousands of batch computing jobs on AWS. It dynamically provisions the optimal quantity and type of compute resources (e.g., CPU or memory optimized instances) based on the volume and specific resource requirements of the batch jobs submitted. ', 'https://img.stackshare.io/service/7453/preview.jpeg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (377, '2020-06-24 18:11:21', '2020-06-24 18:11:21', null, 'Azure Data Factory', 'azure-data-factory', 'It is a service designed to allow developers to integrate disparate data sources. It is a platform somewhat like SSIS in the cloud to manage the data you have both on-prem and in the cloud.', 'https://img.stackshare.io/service/6356/sni_tf5H_400x400.jpg', 'https://github.com/Azure/Azure-DataFactory', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (378, '2020-06-24 18:11:42', '2020-06-24 18:11:42', null, 'Beam', 'beam', 'A distributed knowledge graph store. Knowledge graphs are suitable for modeling data that is highly interconnected by many types of relationships, like encyclopedic information about the world. ', 'https://img.stackshare.io/no-img-open-source.png', 'https://github.com/eBay/beam', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (379, '2020-06-24 18:11:47', '2020-06-24 18:11:47', null, 'Apache Beam', 'apache-beam', 'It implements batch and streaming data processing jobs that run on any execution engine. It executes pipelines on multiple execution environments.', 'https://img.stackshare.io/service/5286/FILKflMC_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (380, '2020-06-24 18:11:51', '2020-06-24 18:11:51', null, 'Google Cloud Data Fusion', 'google-cloud-data-fusion', 'A fully managed, cloud-native data integration service that helps users efficiently build and manage ETL/ELT data pipelines. With a graphical interface and a broad open-source library of preconfigured connectors and transformations, and more.', 'https://img.stackshare.io/service/10775/Image_2019-04-16_at_7.45.29_AM.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (381, '2020-06-24 18:12:04', '2020-06-24 18:12:04', null, 'Salt', 'salt', 'Salt is a new approach to infrastructure management. Easy enough to get running in minutes, scalable enough to manage tens of thousands of servers, and fast enough to communicate with them in seconds.
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (382, '2020-06-24 18:12:22', '2020-06-24 18:12:22', null, 'AWX', 'awx', 'AWX provides a web-based user interface, REST API, and task engine built on top of Ansible. It is the upstream project for Tower, a commercial derivative of AWX. Ansible Towers powers enterprise automation by adding control, security and delegation capabilities to Ansible environments.', 'https://img.stackshare.io/service/7728/DJLpA-IWAAAqXsE.jpg', 'https://github.com/ansible/awx', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (383, '2020-06-24 18:12:26', '2020-06-24 18:12:26', null, 'SourceTree', 'sourcetree', 'Use the full capability of Git and Mercurial in the SourceTree desktop app. Manage all your repositories, hosted or local, through SourceTree''s simple interface.', 'https://img.stackshare.io/service/1599/sourcetree.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (384, '2020-06-24 18:12:39', '2020-06-24 18:12:39', null, 'GitUp', 'gitup', 'GitUp lets you see your entire labyrinth of branches and merges with perfect clarity. Any change you make, large or small, even outside GitUp, is immediately reflected in GitUp''s graph. No refreshing, no waiting.', 'https://img.stackshare.io/service/3129/FnDZxfad.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (385, '2020-06-24 18:12:52', '2020-06-24 18:12:52', null, 'Solr', 'solr', 'Solr is the popular, blazing fast open source enterprise search platform from the Apache Lucene project. Its major features include powerful full-text search, hit highlighting, faceted search, near real-time indexing, dynamic clustering, database integration, rich document (e.g., Word, PDF) handling, and geospatial search. Solr is highly reliable, scalable and fault tolerant, providing distributed indexing, replication and load-balanced querying, automated failover and recovery, centralized configuration and more. Solr powers the search and navigation features of many of the world''s largest internet sites.', 'https://img.stackshare.io/service/1596/al3IkKF8.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (386, '2020-06-24 18:13:01', '2020-06-24 18:13:01', null, 'Azure Search', 'azure-search', 'Azure Search makes it easy to add powerful and sophisticated search capabilities to your website or application. Quickly and easily tune search results and construct rich, fine-tuned ranking models to tie search results to business goals. Reliable throughput and storage provide fast search indexing and querying to support time-sensitive search scenarios.', 'https://img.stackshare.io/service/1370/azure-search.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (387, '2020-06-24 18:13:06', '2020-06-24 18:13:06', null, 'Klevu', 'klevu', 'It is an intelligent site search solution designed to help eCommerce businesses increase onsite sales and improve the customer online shopping experience.', 'https://img.stackshare.io/service/9069/ipVmbOgk_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (388, '2020-06-24 18:13:10', '2020-06-24 18:13:10', null, 'Amazon CloudSearch', 'amazon-cloudsearch', 'Amazon CloudSearch enables you to search large collections of data such as web pages, document files, forum posts, or product information. With a few clicks in the AWS Management Console, you can create a search domain, upload the data you want to make searchable to Amazon CloudSearch, and the search service automatically provisions the required technology resources and deploys a highly tuned search index.', 'https://img.stackshare.io/service/393/amazon-cloudsearch.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (389, '2020-06-24 18:13:24', '2020-06-24 18:13:24', null, 'Lucene', 'lucene', 'Lucene Core, our flagship sub-project, provides Java-based indexing and search technology, as well as spellchecking, hit highlighting and advanced analysis/tokenization capabilities.', 'https://img.stackshare.io/service/1597/lucene.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (390, '2020-06-24 18:13:49', '2020-06-24 18:13:49', null, 'AddSearch', 'addsearch', 'We help your website visitors find what they are looking for. AddSearch is a lightning fast, accurate and customizable site search engine with a Search API. AddSearch works on all devices and is easy to install, customize and tweak.', 'https://img.stackshare.io/service/10886/AulmKmTX_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (391, '2020-06-24 18:13:53', '2020-06-24 18:13:53', null, 'Adobe Target', 'adobe-target', 'A/B and multivariate testing. Personalization. AI-powered automation at scale. Testing and personalization with features that optimize, automate, and predict the best experiences for your audiences.', 'https://img.stackshare.io/service/6774/isZUknsf_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (392, '2020-06-24 18:14:18', '2020-06-24 18:14:18', null, 'Android Studio', 'android-studio', 'Android Studio is a new Android development environment based on IntelliJ IDEA. It provides new features and improvements over Eclipse ADT and will be the official Android IDE once it''s ready.', 'https://img.stackshare.io/service/1447/AyreX9yf.jpeg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (393, '2020-06-24 18:14:23', '2020-06-24 18:14:23', null, 'WebStorm', 'webstorm', 'WebStorm is a lightweight and intelligent IDE for front-end development and server-side JavaScript.', 'https://img.stackshare.io/service/1455/icon_WebStorm.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (394, '2020-06-24 18:14:45', '2020-06-24 18:14:45', null, 'DataGrip', 'datagrip', 'A cross-platform IDE that is aimed at DBAs and developers working with SQL databases.', 'https://img.stackshare.io/service/5053/datagrip-logo.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (395, '2020-06-24 18:15:18', '2020-06-24 18:15:18', null, 'Brackets', 'brackets', 'With focused visual tools and preprocessor support, it is a modern text editor that makes it easy to design in the browser. ', 'https://img.stackshare.io/service/2226/brackets_512_400x400.png', 'https://github.com/adobe/brackets', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (396, '2020-06-24 18:16:10', '2020-06-24 18:16:10', null, 'Apigee', 'apigee', 'API management, design, analytics, and security are at the heart of modern digital architecture. The Apigee intelligent API platform is a complete solution for moving business to the digital world.', 'https://img.stackshare.io/service/4215/6f72b788786c25b956aac477099a23ed_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (397, '2020-06-24 18:16:22', '2020-06-24 18:16:22', null, 'Zuul', 'zuul', 'It is the front door for all requests from devices and websites to the backend of the Netflix streaming application. As an edge service application, It is built to enable dynamic routing, monitoring, resiliency, and security. Routing is an integral part of a microservice architecture.', 'https://img.stackshare.io/service/2932/99V92_Sr_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (398, '2020-06-24 18:16:27', '2020-06-24 18:16:27', null, 'Azure API Management', 'azure-api-management', 'Today''s innovative enterprises are adopting API architectures to accelerate growth. Streamline your work across hybrid and multi-cloud environments with a single place for managing all your APIs.', 'https://img.stackshare.io/service/11968/BvrAZAbM_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (399, '2020-06-24 18:16:31', '2020-06-24 18:16:31', null, 'Google Cloud Endpoints', 'google-cloud-endpoints', 'An NGINX-based proxy and distributed architecture give unparalleled performance and scalability. Using an Open API Specification or one of our API frameworks, Cloud Endpoints gives you the tools you need for every phase of API development and provides insight with Google Cloud Monitoring, Cloud Trace, Google Cloud Logging and Cloud Trace.', 'https://img.stackshare.io/service/1647/google-cloud-endpoints.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (400, '2020-06-24 18:16:40', '2020-06-24 18:16:40', null, 'Slim', 'slim', 'Slim is easy to use for both beginners and professionals. Slim favors cleanliness over terseness and common cases over edge cases. Its interface is simple, intuitive, and extensively documented — both online and in the code itself.', 'https://img.stackshare.io/service/1206/GDHlxO_z_400x400.jpg', 'https://github.com/slimphp/Slim', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (401, '2020-06-24 18:16:44', '2020-06-24 18:16:44', null, 'Lumen', 'lumen', 'Laravel Lumen is a stunningly fast PHP micro-framework for building web applications with expressive, elegant syntax. We believe development must be an enjoyable, creative experience to be truly fulfilling. Lumen attempts to take the pain out of development by easing common tasks used in the majority of web projects, such as routing, database abstraction, queueing, and caching.', 'https://img.stackshare.io/service/2820/lumen.png', 'https://github.com/laravel/lumen', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (402, '2020-06-24 18:16:52', '2020-06-24 18:16:52', null, 'API Platform', 'api-platform', 'It is a set of tools to build and consume web APIs. You can build a fully-featured hypermedia or GraphQL API in minutes. Leverage its awesome features to develop complex and high performance API-first projects. Extend or override everything you want.', 'https://img.stackshare.io/service/6998/9jNpgyfh_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (403, '2020-06-24 18:16:57', '2020-06-24 18:16:57', null, 'Expressive', 'expressive', 'Make your code flexible and robust, using the dependency injection container of your choice.', 'https://img.stackshare.io/service/10613/zf-logo-mark_400x400.png', 'https://github.com/zendframework/zend-expressive', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (404, '2020-06-24 18:17:01', '2020-06-24 18:17:01', null, 'ignite', 'ignite', 'The ignite platform provides a holistic service catalog as well as an end-to-end lifecycle with a focus on plan, design, and build, generating most of the required code and gateway settings directly to your CI/CD and run. ', 'https://img.stackshare.io/service/11345/empty-logo-square.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (405, '2020-06-24 18:17:13', '2020-06-24 18:17:13', null, 'linkerd', 'linkerd', 'linkerd is an out-of-process network stack for microservices. It functions as a transparent RPC proxy, handling everything needed to make inter-service RPC safe and sane--including load-balancing, service discovery, instrumentation, and routing.', 'https://img.stackshare.io/service/4513/linkerd.png', 'https://github.com/BuoyantIO/linkerd', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (406, '2020-06-24 18:17:18', '2020-06-24 18:17:18', null, 'Micro', 'micro', 'Micro is a distributed systems runtime for the Cloud and beyond. Micro addresses the key requirements for building distributed systems. It leverages the microservices architecture pattern and provides a set of services which act as the buil', 'https://img.stackshare.io/service/4793/Powered_by_Micro__3_.png', 'https://github.com/micro/micro', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (407, '2020-06-24 18:17:22', '2020-06-24 18:17:22', null, 'Claudia', 'claudia', 'Claudia helps you deploy Node.js microservices to Amazon Web Services easily. It automates and simplifies deployment workflows and error prone tasks, so you can focus on important problems and not have to worry about AWS service quirks.', 'https://img.stackshare.io/service/4512/17075165.png', 'https://github.com/claudiajs/claudia', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (408, '2020-06-24 18:17:26', '2020-06-24 18:17:26', null, 'fabric8', 'fabric8', 'fabric8 makes it easy to create microservices, build, test and deploy them via Continuous Delivery pipelines then run and manage them with Continuous Improvement and ChatOps.', 'https://img.stackshare.io/service/5628/GTOqxmsi.png', 'https://github.com/fabric8io/fabric8', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (409, '2020-06-24 18:17:30', '2020-06-24 18:17:30', null, 'Conductor', 'conductor', 'Conductor is an orchestration engine that runs in the cloud.', 'https://img.stackshare.io/service/6134/99V92_Sr.png', 'https://github.com/Netflix/conductor', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (410, '2020-06-24 18:17:39', '2020-06-24 18:17:39', null, 'Akamai', 'akamai', 'If you''ve ever shopped online, downloaded music, watched a web video or connected to work remotely, you''ve probably used Akamai''s cloud platform. Akamai helps businesses connect the hyperconnected, empowering them to transform and reinvent their business online. We remove the complexities of technology, so you can focus on driving your business faster forward.', 'https://img.stackshare.io/service/12/k7PvYZYh.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (411, '2020-06-24 18:17:56', '2020-06-24 18:17:56', null, 'MaxCDN', 'maxcdn', 'The MaxCDN Content Delivery Network efficiently delivers your site’s static file through hundreds of servers instead of slogging through a single host. This "smart route" technology distributes your content to your visitors via the city closest to them.', 'https://img.stackshare.io/service/14/HG2q2Oxj.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (412, '2020-06-24 18:18:18', '2020-06-24 18:18:18', null, 'Incapsula', 'incapsula', 'Through an application-aware, global content delivery network (CDN), Incapsula provides any website and web application with best-of-breed security, DDoS protection, load balancing and failover solutions.', 'https://img.stackshare.io/service/16/pmMygGUP.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (413, '2020-06-24 18:18:22', '2020-06-24 18:18:22', null, 'Netlify', 'netlify', 'Netlify is smart enough to process your site and make sure all assets gets optimized and served with perfect caching-headers from a cookie-less domain. We make sure your HTML is served straight from our CDN edge nodes without any round-trip to our backend servers and are the only ones to give you instant cache invalidation when you push a new deploy. Netlify is also the only static hosting service with integrated continuous deployment.', 'https://img.stackshare.io/service/2748/lV55uZMx.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (414, '2020-06-24 18:18:31', '2020-06-24 18:18:31', null, 'Cloudflare CDN', 'cloudflare-cdn', 'A CDN is a distributed network of servers that provides several advantages for a web site: Cached content: By caching web site content, It helps improve page load speeds, reduce bandwidth usage, and reduce CPU usage on the server.', 'https://img.stackshare.io/service/10332/_VIX9eN1_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (415, '2020-06-24 18:18:48', '2020-06-24 18:18:48', null, 'Varnish', 'varnish', 'Varnish Cache is a web application accelerator also known as a caching HTTP reverse proxy. You install it in front of any server that speaks HTTP and configure it to cache the contents. Varnish Cache is really, really fast. It typically speeds up delivery with a factor of 300 - 1000x, depending on your architecture.', 'https://img.stackshare.io/service/1073/mPwTb3BF.png', 'https://github.com/varnish/Varnish-Cache', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (416, '2020-06-24 18:18:52', '2020-06-24 18:18:52', null, 'StackPath', 'stackpath', 'Build your applications and services at the edge, with Edge Computing and Edge Services that give you high performance, full security, and total control.', 'https://img.stackshare.io/service/7918/R9pGQrSZ_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (417, '2020-06-24 18:18:56', '2020-06-24 18:18:56', null, 'Twilio', 'twilio', 'Twilio offers developers a powerful API for phone services to make and receive phone calls, and send and receive text messages. Their product allows programmers to more easily integrate various communication methods into their software and programs. ', 'https://img.stackshare.io/service/130/VrwpNfjh_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (418, '2020-06-24 18:19:07', '2020-06-24 18:19:07', null, 'Semantic UI', 'semantic-ui', 'Semantic empowers designers and developers by creating a shared vocabulary for UI.', 'https://img.stackshare.io/service/1106/semantic-ui.png', 'https://github.com/Semantic-Org/Semantic-UI', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (419, '2020-06-24 18:19:15', '2020-06-24 18:19:15', null, 'Material', 'material', 'Express your creativity with Material, an animation and graphics framework for Google''s Material Design and Apple''s Flat UI in Swift.', 'https://img.stackshare.io/service/4459/material.png', 'https://github.com/CosmicMind/Material', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (420, '2020-06-24 18:19:27', '2020-06-24 18:19:27', null, 'Material Design', 'material-design', 'Material Design is a unified system that combines theory, resources, and tools for crafting digital experiences.', 'https://img.stackshare.io/service/3994/guidelines-icon-192x192.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (421, '2020-06-24 18:19:52', '2020-06-24 18:19:52', null, 'Angular Material ', 'angular-material', 'Sprint from Zero to App. Hit the ground running with comprehensive, modern UI components that work across the web, mobile and desktop. It allows to create material styled angular apps fast and easy. ', 'https://img.stackshare.io/service/5445/cb8U-gL6_400x400.jpg', 'https://github.com/angular/components', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (422, '2020-06-24 18:19:57', '2020-06-24 18:19:57', null, 'Vuetify', 'vuetify', 'Vuetify is a component framework for Vue.js 2. It aims to provide clean, semantic and reusable components that make building your application a breeze. Vuetify utilizes Google''s Material Design design pattern, taking cues from other popular frameworks such as Materialize.css, Material Design Lite, Semantic UI and Bootstrap 4.', 'https://img.stackshare.io/service/6163/PzNbCwXH.jpg', 'https://github.com/vuetifyjs/vuetify', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (423, '2020-06-24 18:20:07', '2020-06-24 18:20:07', null, 'Flat UI', 'flat-ui', 'Flat UI is a beautiful theme for Bootstrap. We have redesigned many of its components to look flat in every pixel.', 'https://img.stackshare.io/service/3245/Screen_Shot_2015-06-25_at_11.19.50_AM.png', 'https://github.com/designmodo/Flat-UI', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (424, '2020-06-24 18:20:11', '2020-06-24 18:20:11', null, 'Kendo UI', 'kendo-ui', 'Fast, light, complete: 70+ jQuery-based UI widgets in one powerful toolset. AngularJS integration, Bootstrap support, mobile controls, offline data solution.', 'https://img.stackshare.io/service/2636/4TVgtx9B.png', 'https://github.com/telerik/kendo-ui-core', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (425, '2020-06-24 18:20:20', '2020-06-24 18:20:20', null, 'Ant Design', 'ant-design', 'An enterprise-class UI design language and React-based implementation. Graceful UI components out of the box, base on React Component. A npm + webpack + babel + dora + dva development framework.', 'https://img.stackshare.io/service/6112/12101536.png', 'https://github.com/ant-design/ant-design', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (426, '2020-06-24 18:20:24', '2020-06-24 18:20:24', null, 'react-md', 'react-md', 'React MD is Google''s Material Design specifications implemented with Sass and React. The goal of the project is to create components that adhere to the Material Design specifications.', 'https://img.stackshare.io/service/6757/react-md.png', 'https://github.com/mlaursen/react-md', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (427, '2020-06-24 18:21:06', '2020-06-24 18:21:06', null, 'Red', 'red', 'It is both an imperative and functional programming language. Its syntax and general usage overlaps that of the interpreted Rebol language.', 'https://img.stackshare.io/service/9626/R-a4YJ5K_400x400.png', 'https://github.com/red/red', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (428, '2020-06-24 18:21:14', '2020-06-24 18:21:14', null, 'Akka HTTP', 'akka-http', 'The Akka HTTP modules implement a full server- and client-side HTTP stack on top of akka-actor and akka-stream. It’s not a web-framework but rather a more general toolkit for providing and consuming HTTP-based services. While interaction with a browser is of course also in scope it is not the primary focus of Akka HTTP.', 'https://img.stackshare.io/service/11316/akka_http.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (429, '2020-06-24 18:21:22', '2020-06-24 18:21:22', null, 'Sails.js', 'sailsjs', 'Sails is designed to mimic the MVC pattern of frameworks like Ruby on Rails, but with support for the requirements of modern apps: data-driven APIs with scalable, service-oriented architecture.', 'https://img.stackshare.io/service/1165/3bf33a82d4b1624f6b94da4d9fe1eaeb.png', 'https://github.com/balderdashy/sails', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (430, '2020-06-24 18:22:09', '2020-06-24 18:22:09', null, 'Hanami', 'hanami', 'Use the 100+ features that we offer to build powerful products without compromising memory. Hanami consumes 60% less memory than other full-featured Ruby frameworks.', 'https://img.stackshare.io/service/5161/Pd9fDAOA.jpg', 'https://github.com/hanami/hanami', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (431, '2020-06-24 18:22:14', '2020-06-24 18:22:14', null, 'Padrino', 'padrino', 'Padrino is a ruby framework built upon the excellent Sinatra Microframework. Padrino was created to make it fun and easy to code more advanced web applications while still adhering to the spirit that makes Sinatra great!', 'https://img.stackshare.io/service/1000/e488e167fe1b085db44b5407802527ff.png', 'https://github.com/padrino/padrino-framework', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (432, '2020-06-24 18:22:18', '2020-06-24 18:22:18', null, 'Mercury', 'mercury', 'A modular JSON-RPC library that allows pluggable transport layers, JSON libraries, and effect/async monads.
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (433, '2020-06-24 18:22:39', '2020-06-24 18:22:39', null, 'Spring MVC', 'spring-mvc', 'A Java framework that follows the Model-View-Controller design pattern and provides an elegant solution to use MVC in spring framework by the help of DispatcherServlet.
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (434, '2020-06-24 18:22:43', '2020-06-24 18:22:43', null, 'Play', 'play', 'Play Framework makes it easy to build web applications with Java & Scala. Play is based on a lightweight, stateless, web-friendly architecture. Built on Akka, Play provides predictable and minimal resource consumption (CPU, memory, threads) for highly-scalable applications.', 'https://img.stackshare.io/service/1013/HqN22PuY.png', 'https://github.com/playframework/playframework', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (435, '2020-06-24 18:22:47', '2020-06-24 18:22:47', null, 'Dropwizard', 'dropwizard', 'Dropwizard is a sneaky way of making fast Java web applications. Dropwizard pulls together stable, mature libraries from the Java ecosystem into a simple, light-weight package that lets you focus on getting things done.', 'https://img.stackshare.io/service/2210/KGguccbW.png', 'https://github.com/dropwizard/dropwizard', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (436, '2020-06-24 18:23:09', '2020-06-24 18:23:09', null, 'Phabricator', 'phabricator', 'Phabricator is a collection of open source web applications that help software companies build better software.', 'https://img.stackshare.io/service/751/VE_3ve2I.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (437, '2020-06-24 18:23:36', '2020-06-24 18:23:36', null, 'Gogs', 'gogs', 'The goal of this project is to make the easiest, fastest and most painless way to set up a self-hosted Git service. With Go, this can be done in independent binary distribution across ALL platforms that Go supports, including Linux, Mac OS X, and Windows.
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (438, '2020-06-24 18:23:40', '2020-06-24 18:23:40', null, 'Git', 'git', 'Git is a free and open source distributed version control system designed to handle everything from small to very large projects with speed and efficiency.', 'https://img.stackshare.io/service/1046/git.png', 'https://github.com/git/git', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (439, '2020-06-24 18:23:56', '2020-06-24 18:23:56', null, 'Couchbase', 'couchbase', 'Developed as an alternative to traditionally inflexible SQL databases, the Couchbase NoSQL database is built on an open source foundation and architected to help developers solve real-world problems and meet high scalability demands.', 'https://img.stackshare.io/service/1089/KMIbGY8C.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (440, '2020-06-24 18:24:10', '2020-06-24 18:24:10', null, 'Workday', 'workday', 'Workday is a leading provider of enterprise cloud applications for human resources and finance. Founded in 2005, Workday delivers human capital management, financial management, and analytics applications designed for the world’s largest organizations. Hundreds of companies, ranging from medium-sized businesses to Fortune 50 enterprises, have selected Workday.', 'https://img.stackshare.io/service/910/aATj_hm-.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (441, '2020-06-24 18:24:14', '2020-06-24 18:24:14', null, 'Prophet', 'prophet', 'Prophet is a procedure for forecasting time series data. It is based on an additive model where non-linear trends are fit with yearly and weekly seasonality, plus holidays. It works best with daily periodicity data with at least one year of historical data. Prophet is robust to missing data, shifts in the trend, and large outliers.', 'https://img.stackshare.io/service/6594/Screen_Shot_2018-01-25_at_4.46.45_AM.png', 'https://github.com/facebookincubator/prophet', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (442, '2020-06-24 18:25:29', '2020-06-24 18:25:29', null, 'Electron', 'electron', 'With Electron, creating a desktop application for your company or idea is easy. Initially developed for GitHub''s Atom editor, Electron has since been used to create applications by companies like Microsoft, Facebook, Slack, and Docker. The Electron framework lets you write cross-platform desktop applications using JavaScript, HTML and CSS. It is based on io.js and Chromium and is used in the Atom editor.', 'https://img.stackshare.io/service/2946/XJRdVxx3.png', 'https://github.com/atom/electron', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (443, '2020-06-24 18:25:33', '2020-06-24 18:25:33', null, 'MATLAB', 'matlab', 'Using MATLAB, you can analyze data, develop algorithms, and create models and applications. The language, tools, and built-in math functions enable you to explore multiple approaches and reach a solution faster than with spreadsheets or traditional programming languages, such as C/C++ or Java.', 'https://img.stackshare.io/service/1214/h5g3etjnacmazg8oq17z.jpeg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (444, '2020-06-24 18:25:43', '2020-06-24 18:25:43', null, 'Amazon LightSail', 'amazon-lightsail', 'Everything you need to jumpstart your project on AWS—compute, storage, and networking—for a low, predictable price. Launch a virtual private server with just a few clicks.', 'https://img.stackshare.io/service/6094/amazon-lightsail.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (445, '2020-06-24 18:25:51', '2020-06-24 18:25:51', null, 'Amazon EC2 Container Service', 'amazon-ec2-container-service', 'Amazon EC2 Container Service lets you launch and stop container-enabled applications with simple API calls, allows you to query the state of your cluster from a centralized service, and gives you access to many familiar Amazon EC2 features like security groups, EBS volumes and IAM roles.', 'https://img.stackshare.io/service/1908/amazon-ecs.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (446, '2020-06-24 18:25:55', '2020-06-24 18:25:55', null, 'Beanstalk', 'beanstalk', 'A single process to commit code, review with the team, and deploy the final result to your customers.', 'https://img.stackshare.io/service/308/4ef272f5549f8c7b2d5da1b03ef6669b.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (447, '2020-06-24 18:26:06', '2020-06-24 18:26:06', null, 'Scaleway', 'scaleway', 'Scaleway is the best platform to deploy BareMetal ARM & X64 SSD cloud servers. Enjoy a new cloud computing experience!', 'https://img.stackshare.io/service/2730/XTkO3mcj.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (448, '2020-06-24 18:26:11', '2020-06-24 18:26:11', null, 'Hetzner Online AG', 'hetzner', 'Hetzner Online is a professional web hosting provider and experienced data center operator. Since 1997 the company has provided private and business clients with high-performance hosting products as well as the necessary infrastructure for the efficient operation of websites. ', 'https://img.stackshare.io/service/1279/hetzner_hosted_by_1.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (449, '2020-06-24 18:26:15', '2020-06-24 18:26:15', null, 'Vultr', 'vultr', 'Strategically located in 16 datacenters around the globe and provides frictionless provisioning of public cloud, storage and single-tenant bare metal.', 'https://img.stackshare.io/service/2510/logo_v_onwhite.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (450, '2020-06-24 18:26:27', '2020-06-24 18:26:27', null, 'SoftLayer', 'softlayer', 'SoftLayer dedicated servers give you options from entry-level single processor servers to quad proc, hex-core, and even GPU-powered workhorses. They''re all deployed in real time via our portal or API.', 'https://img.stackshare.io/service/215/Sq31fSok.jpeg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (451, '2020-06-24 18:26:41', '2020-06-24 18:26:41', null, 'Code Climate', 'code-climate', 'After each Git push, Code Climate analyzes your code for complexity, duplication, and common smells to determine changes in quality and surface technical debt hotspots.', 'https://img.stackshare.io/service/305/KFgYaUkK.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (452, '2020-06-24 18:26:45', '2020-06-24 18:26:45', null, 'Better Code Hub', 'better-code-hub', 'Better Code Hub runs the first analysis of any GitHub repository with the default configuration. This default configuration is based on the programming languages reported by GitHub and supported by Better Code Hub. Better Code Hub further uses heuristics and commonly used conventions.', 'https://img.stackshare.io/service/7558/7DzwvvVk_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (453, '2020-06-24 18:26:49', '2020-06-24 18:26:49', null, 'Codecov', 'codecov', 'Our patrons rave about our elegant coverage reports, integrated pull request comments, interactive commit graphs, our Chrome plugin and security.', 'https://img.stackshare.io/service/2673/Codecov_Mark_Circle_Pink.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (454, '2020-06-24 18:26:54', '2020-06-24 18:26:54', null, 'Coveralls', 'coveralls', 'Coveralls works with your CI server and sifts through your coverage data to find issues you didn''t even know you had before they become a problem. Free for open source, pro accounts for private repos, instant sign up with GitHub OAuth.', 'https://img.stackshare.io/service/680/a43e4a04cb9f778842de43f95db59a14.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (455, '2020-06-24 18:26:58', '2020-06-24 18:26:58', null, 'codebeat', 'codebeat', 'codebeat helps you prioritize issues and identify quick wins. It provides immediate and continuous feedback on complexity and duplication', 'https://img.stackshare.io/service/4576/logo-symbol.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (456, '2020-06-24 18:27:07', '2020-06-24 18:27:07', null, 'TSLint', 'tslint', 'An extensible static analysis tool that checks TypeScript code for readability, maintainability, and functionality errors. It is widely supported across modern editors & build systems and can be customized with your own lint rules, configurations, and formatters.', 'https://img.stackshare.io/service/5561/303157.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (457, '2020-06-24 18:27:15', '2020-06-24 18:27:15', null, 'JSLint', 'jslint', 'It is a static code analysis tool used in software development for checking if JavaScript source code complies with coding rules. It is provided primarily as a browser-based web application accessible through their domain, but there are also command-line adaptations.', 'https://img.stackshare.io/no-img-open-source.png', 'https://github.com/douglascrockford/JSLint', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (458, '2020-06-24 18:27:19', '2020-06-24 18:27:19', null, 'JSHint', 'jshint', 'It is a community-driven tool to detect errors and potential problems in JavaScript code. It is open source and can easily adjust in the environment you expect your code to execute.', 'https://img.stackshare.io/service/1945/mzh2bRes_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (459, '2020-06-24 18:27:27', '2020-06-24 18:27:27', null, 'Babel', 'babel', 'Babel will turn your ES6+ code into ES5 friendly code, so you can start using it right now without waiting for browser support.', 'https://img.stackshare.io/service/2739/-1wfGjNw.png', 'https://github.com/babel/babel', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (460, '2020-06-24 18:27:37', '2020-06-24 18:27:37', null, 'ReSharper', 'resharper', 'It is a popular developer productivity extension for Microsoft Visual Studio. It automates most of what can be automated in your coding routines. It finds compiler errors, runtime errors, redundancies, and code smells right as you type, suggesting intelligent corrections for them.', 'https://img.stackshare.io/service/1831/lni0by_I_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (461, '2020-06-24 18:27:41', '2020-06-24 18:27:41', null, 'Checkmarx', 'checkmarx', 'It is a provider of state-of-the-art application security solution: static code analysis software, seamlessly integrated into development process.', 'https://img.stackshare.io/service/7157/pzliH_yc_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (462, '2020-06-24 18:27:45', '2020-06-24 18:27:45', null, 'FindBugs', 'findbugs', 'It detects possible bugs in Java programs. Potential errors are classified in four ranks: scariest, scary, troubling and of concern. This is a hint to the developer about their possible impact or severity.', 'https://img.stackshare.io/service/2662/kWjFjx3K_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (463, '2020-06-24 18:27:49', '2020-06-24 18:27:49', null, 'Veracode', 'veracode', 'It seamlessly integrates application security into the software lifecycle, effectively eliminating vulnerabilities during the lowest-cost point in the development/deployment chain, and blocking threats while in production.', 'https://img.stackshare.io/service/7149/ftujD3z3_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (464, '2020-06-24 18:27:54', '2020-06-24 18:27:54', null, 'SonarLint', 'sonarlint', 'It is an IDE extension that helps you detect and fix quality issues as you write code. 
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (465, '2020-06-24 18:28:11', '2020-06-24 18:28:11', null, 'Crucible', 'crucible', 'It is a Web-based application primarily aimed at enterprise, and certain features that enable peer review of a code base may be considered enterprise social software.', 'https://img.stackshare.io/service/2695/New_Project__80_.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (466, '2020-06-24 18:28:32', '2020-06-24 18:28:32', null, 'SVN (Subversion)', 'svn', 'Subversion exists to be universally recognized and adopted as an open-source, centralized version control system characterized by its reliability as a safe haven for valuable data; the simplicity of its model and usage; and its ability to support the needs of a wide variety of users and projects, from individuals to large-scale enterprise operations.', 'https://img.stackshare.io/service/1045/svn.jpg', 'https://github.com/apache/subversion', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (467, '2020-06-24 18:29:35', '2020-06-24 18:29:35', null, 'Symfony', 'symfony', 'It is written with speed and flexibility in mind. It allows developers to build better and easy to maintain websites with PHP..', 'https://img.stackshare.io/service/1197/logosf_positif_03_icon.png', 'https://github.com/symfony/symfony', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (468, '2020-06-24 18:29:39', '2020-06-24 18:29:39', null, 'CodeIgniter', 'codeigniter', 'CodeIgniter is a proven, agile & open PHP web application framework with a small footprint. It is powering the next generation of web apps.', 'https://img.stackshare.io/service/1195/ci_logo.png', 'https://github.com/EllisLab/CodeIgniter', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (469, '2020-06-24 18:29:44', '2020-06-24 18:29:44', null, 'CakePHP', 'cakephp', 'CakePHP makes building web applications simpler, faster, while requiring less code. A modern PHP 7 framework offering a flexible database access layer and a powerful scaffolding system.', 'https://img.stackshare.io/service/1196/CakePHP_Newsletter-34_square_2.jpg', 'https://github.com/cakephp/cakephp', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (470, '2020-06-24 18:30:15', '2020-06-24 18:30:15', null, 'Primer', 'primer', 'Primer is the basecoat of GitHub, made by nerds just like you who share a passion for HTML and CSS.', 'https://img.stackshare.io/service/2701/7143434.png', 'https://github.com/primer/primer', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (471, '2020-06-24 18:30:23', '2020-06-24 18:30:23', null, 'Pure', 'pure', 'Pure is meant to be a starting point for every website or web app. We take care of all the CSS work that every site needs, without making it look cookie-cutter.', 'https://img.stackshare.io/service/1108/pure.png', 'https://github.com/yui/pure', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (472, '2020-06-24 18:30:28', '2020-06-24 18:30:28', null, 'Topcoat', 'topcoat', 'TopCoat is made up of base controls, platform specific styles, themes and a build script to stitch them all together.', 'https://img.stackshare.io/service/1110/fIZk-0UD.png', 'https://github.com/topcoat/topcoat', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (473, '2020-06-24 18:30:37', '2020-06-24 18:30:37', null, 'Hibernate', 'hibernate', 'Hibernate is a suite of open source projects around domain models. The flagship project is Hibernate ORM, the Object Relational Mapper.', 'https://img.stackshare.io/service/1756/1uNl_IZX.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (474, '2020-06-24 18:30:41', '2020-06-24 18:30:41', null, 'Switch', 'switch', 'Ring your mobile phone, computer, and desk phone at the same time. Answer calls and switch seamlessly between devices. Use your personal device with a business phone number so you''re always reachable.', 'https://img.stackshare.io/service/3146/vo2TT03y.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (475, '2020-06-24 18:30:45', '2020-06-24 18:30:45', null, 'Knex.js', 'knex-js', 'Knex.js is a "batteries included" SQL query builder for Postgres, MySQL, MariaDB, SQLite3, and Oracle designed to be flexible, portable, and fun to use. It features both traditional node style callbacks as well as a promise interface for cleaner async flow control, a stream interface, full featured query and schema builders, transaction support (with savepoints), connection pooling and standardized responses between different query clients and dialects.', 'https://img.stackshare.io/service/3376/knex.png', 'https://github.com/tgriesser/knex', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (476, '2020-06-24 18:30:49', '2020-06-24 18:30:49', null, 'Redsmin', 'redsmin', 'Redsmin is an all-in-one GUI for Redis, a tightly crafted developer oriented, online real-time monitoring and administration service for Redis.', 'https://img.stackshare.io/service/1441/sjx8MhOY.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (477, '2020-06-24 18:30:54', '2020-06-24 18:30:54', null, 'Open PostgreSQL Monitoring', 'opm', 'Open PostgreSQL Monitoring is a free software designed to help you manage your PostgreSQL servers.', 'https://img.stackshare.io/service/1456/bHf0-JWX.png', 'https://github.com/OPMDG/opm-core', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (478, '2020-06-24 18:31:07', '2020-06-24 18:31:07', null, 'Sqitch', 'sqitch', 'It is a standalone change management system with no opinions about your database engine, application framework, or development environment. Native scripting. Changes are implemented as scripts native to your selected database engine.', 'https://img.stackshare.io/service/10485/New_Project__47_.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (479, '2020-06-24 18:31:11', '2020-06-24 18:31:11', null, 'Trevor.io', 'trevor-io', 'It is a powerful query-builder that gives your team all the power of SQL, without the learning curve. It lets you build queries as a series of atomic steps, and do everything from simple look ups (e.g. checking a specific user''s orders) to performing complex analyses. You can chart or download results, or live-stream them to tools like Google Sheets and Slack.  ', 'https://img.stackshare.io/service/11223/zHAer0oM_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (480, '2020-06-24 18:31:36', '2020-06-24 18:31:36', null, 'GitHub Enterprise', 'github-enterprise', 'GitHub Enterprise lets developers use the tools they love across the development process with support for popular IDEs, continuous integration tools, and hundreds of third party apps and services.', 'https://img.stackshare.io/service/2900/pBeeJQDQ.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (481, '2020-06-24 18:32:01', '2020-06-24 18:32:01', null, 'Vue Native', 'vue-native', 'Vue Native is a mobile framework to build truly native mobile app using Vue.js. Its is designed to connect React Native and Vue.js.
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (482, '2020-06-24 18:32:18', '2020-06-24 18:32:18', null, 'Swift', 'swift', 'Writing code is interactive and fun, the syntax is concise yet expressive, and apps run lightning-fast. Swift is ready for your next iOS and OS X project — or for addition into your current app — because Swift code works side-by-side with Objective-C.', 'https://img.stackshare.io/service/1009/tuHsaI2U.png', 'https://github.com/apple/swift', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (483, '2020-06-24 18:32:32', '2020-06-24 18:32:32', null, 'React Navigation', 'react-navigation', 'Start quickly with built-in navigators that deliver a seamless out-of-the box experience. Navigation views that deliver 60fps animations, and utilize native components to deliver a great look and feel.', 'https://img.stackshare.io/service/6422/react-navigation.png', 'https://github.com/react-community/react-navigation', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (484, '2020-06-24 18:32:57', '2020-06-24 18:32:57', null, 'CoreOS', 'coreos', 'It is designed for security, consistency, and reliability. Instead of installing packages via yum or apt, it uses Linux containers to manage your services at a higher level of abstraction. A single service''s code and all dependencies are packaged within a container that can be run on one or many machines.', 'https://img.stackshare.io/service/1608/92f941aa760503ef8552a9fbc77ef9b6.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (485, '2020-06-24 18:33:10', '2020-06-24 18:33:10', null, 'Apache Aurora', 'aurora', 'Apache Aurora is a service scheduler that runs on top of Mesos, enabling you to run long-running services that take advantage of Mesos'' scalability, fault-tolerance, and resource isolation. ', 'https://img.stackshare.io/service/915/EzEnKUIc.png', 'https://github.com/apache/incubator-aurora', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (486, '2020-06-24 18:33:18', '2020-06-24 18:33:18', null, 'Microsoft Access', 'microsoft-access', 'It is an easy-to-use tool for creating business applications, from templates or from scratch. With its rich and intuitive design tools, it can help you create appealing and highly functional applications in a minimal amount of time.', 'https://img.stackshare.io/service/7820/8e4328e293fd55c577925a7adb2c5eaf_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (487, '2020-06-24 18:33:32', '2020-06-24 18:33:32', null, 'Percona', 'percona', 'It delivers enterprise-class software, support, consulting and managed services for both MySQL and MongoDB across traditional and cloud-based platforms.', 'https://img.stackshare.io/service/2760/bullseye-800_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (488, '2020-06-24 18:33:53', '2020-06-24 18:33:53', null, 'Insomnia REST Client', 'insomnia-rest-client', 'Insomnia is a powerful REST API Client with cookie management, environment variables, code generation, and authentication for Mac, Window, and Linux.', 'https://img.stackshare.io/service/6406/qLPJL1NZ.jpg', 'https://github.com/getinsomnia/insomnia', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (489, '2020-06-24 18:34:06', '2020-06-24 18:34:06', null, 'cURL', 'curl', 'Used in command lines or scripts to transfer data. It is also used in cars, television sets, routers, printers, audio equipment, mobile phones, tablets, and is the internet transfer backbone for thousands of software applications affecting billions of humans daily.', 'https://img.stackshare.io/service/6552/curl-logo.png', 'https://github.com/curl/curl', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (490, '2020-06-24 18:34:10', '2020-06-24 18:34:10', null, 'Fiddler', 'fiddler', 'It is a free web debugging proxy for any browser, system or platform. It helps you debug web applications by capturing network traffic between the Internet and test computers. The tool enables you to inspect incoming and outgoing data to monitor and modify requests and responses before the browser receives them.', 'https://img.stackshare.io/service/5319/JMsyvkiF_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (491, '2020-06-24 18:34:25', '2020-06-24 18:34:25', null, 'Slate', 'slate', 'Slate helps you create beautiful API documentation. Think of it as an intelligent, responsive documentation template for your API.', 'https://img.stackshare.io/service/4189/preview.png', 'https://github.com/tripit/slate', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (492, '2020-06-24 18:34:29', '2020-06-24 18:34:29', null, 'jsdoc', 'jsdoc', 'JSDoc 3 is an API documentation generator for JavaScript, similar to JavaDoc or PHPDoc. You add documentation comments directly to your source code, right along side the code itself. The JSDoc Tool will scan your source code, and generate a complete HTML documentation website for you.', 'https://img.stackshare.io/service/4047/js-doc.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (493, '2020-06-24 18:34:33', '2020-06-24 18:34:33', null, 'Apiary', 'apiary', 'It takes more than a simple HTML page to thrill your API users. The right tools take weeks of development. Weeks that apiary.io saves.', 'https://img.stackshare.io/service/272/7b176017eab2903a23d914460b6dd600.jpeg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (494, '2020-06-24 18:34:38', '2020-06-24 18:34:38', null, 'Gelato.io', 'gelato-io', 'Gelato.io is a SaaS tool for creating API documentation and developer portals. ', 'https://img.stackshare.io/service/3258/4sYR50d5.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (495, '2020-06-24 18:35:03', '2020-06-24 18:35:03', null, 'Gradle', 'gradle', 'Gradle is a build tool with a focus on build automation and support for multi-language development. If you are building, testing, publishing, and deploying software on any platform, Gradle offers a flexible model that can support the entire development lifecycle from compiling and packaging code to publishing web sites.', 'https://img.stackshare.io/service/975/gradlephant-social-black-bg.png', 'https://github.com/gradle/gradle', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (496, '2020-06-24 18:35:24', '2020-06-24 18:35:24', null, 'CodeKit', 'codekit', 'Process Less, Sass, Stylus, Jade, Haml, Slim, CoffeeScript, Javascript, and Compass files automatically each time you save. Easily set options for each language.', 'https://img.stackshare.io/service/2389/codekit.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (497, '2020-06-24 18:35:29', '2020-06-24 18:35:29', null, 'Parcel', 'parcel', 'Parcel is a web application bundler, differentiated by its developer experience. It offers blazing fast performance utilizing multicore processing, and requires zero configuration.', 'https://img.stackshare.io/service/8054/fC6Wad-S_400x400.jpg', 'https://github.com/parcel-bundler/parcel', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (498, '2020-06-24 18:35:46', '2020-06-24 18:35:46', null, 'Browserify', 'browserify', 'Browserify lets you require(''modules'') in the browser by bundling up all of your dependencies.', 'https://img.stackshare.io/service/849/9esmqty2.png', 'https://github.com/substack/node-browserify', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (499, '2020-06-24 18:35:50', '2020-06-24 18:35:50', null, 'Brunch', 'brunch', 'Brunch is an assembler for HTML5 applications. It''s agnostic to frameworks, libraries, programming, stylesheet & templating languages and backend technology.', 'https://img.stackshare.io/service/846/b6b445836933a987d835737ec2693b29.jpeg', 'https://github.com/brunch/brunch', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (500, '2020-06-24 18:36:03', '2020-06-24 18:36:03', null, 'Pencil', 'pencil', 'A web application microframework for Rust', 'https://img.stackshare.io/service/4613/pencil.png', 'https://github.com/fengsp/pencil', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (501, '2020-06-24 18:36:11', '2020-06-24 18:36:11', null, 'Ganglia', 'ganglia', 'Ganglia is a scalable distributed monitoring system for high-performance computing systems such as clusters and Grids. It is based on a hierarchical design targeted at federations of clusters. ', 'https://img.stackshare.io/service/1684/360097.jpeg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (502, '2020-06-24 18:36:37', '2020-06-24 18:36:37', null, 'etcd', 'etcd', 'etcd is a distributed key value store that provides a reliable way to store data across a cluster of machines. It’s open-source and available on GitHub. etcd gracefully handles master elections during network partitions and will tolerate machine failure, including the master.', 'https://img.stackshare.io/service/1721/etcd.png', 'https://github.com/coreos/etcd', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (503, '2020-06-24 18:36:45', '2020-06-24 18:36:45', null, 'SkyDNS', 'skydns', 'SkyDNS is a distributed service for announcement and discovery of services. It leverages Raft for high-availability and consensus, and utilizes DNS queries to discover available services. This is done by leveraging SRV records in DNS, with special meaning given to subdomains, priorities and weights (more info here: http://blog.gopheracademy.com/skydns).', 'https://img.stackshare.io/no-img-open-source.png', 'https://github.com/skynetservices/skydns', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (504, '2020-06-24 18:36:49', '2020-06-24 18:36:49', null, 'Ambassador', 'ambassador-2', 'Map services to arbitrary URLs in a single, declarative YAML file. Configure routes with CORS support, circuit breakers, timeouts, and more. Replace your Kubernetes ingress controller. Route gRPC, WebSockets, or HTTP. ', 'https://img.stackshare.io/service/9175/uedtT4ju_400x400.jpg', 'https://github.com/datawire/ambassador', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (505, '2020-06-24 18:36:58', '2020-06-24 18:36:58', null, 'Redis', 'redis', 'Redis is an open source, BSD licensed, advanced key-value store. It is often referred to as a data structure server since keys can contain strings, hashes, lists, sets and sorted sets.', 'https://img.stackshare.io/service/1031/redis.png', 'https://github.com/antirez/redis', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (506, '2020-06-24 18:37:25', '2020-06-24 18:37:25', null, 'Serf', 'serf', 'Serf is a service discovery and orchestration tool that is decentralized, highly available, and fault tolerant. Serf runs on every major platform: Linux, Mac OS X, and Windows. It is extremely lightweight: it uses 5 to 10 MB of resident memory and primarily communicates using infrequent UDP messages.', 'https://img.stackshare.io/service/750/serf.png', 'https://github.com/hashicorp/serf', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (507, '2020-06-24 18:37:37', '2020-06-24 18:37:37', null, 'Ambari', 'ambari', 'This project is aimed at making Hadoop management simpler by developing software for provisioning, managing, and monitoring Apache Hadoop clusters. It provides an intuitive, easy-to-use Hadoop management web UI backed by its RESTful APIs.', 'https://img.stackshare.io/service/6834/ambari.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (508, '2020-06-24 18:37:55', '2020-06-24 18:37:55', null, 'cell', 'cell', 'cell is a self-constructing web app framework powered by a self-driving DOM.  Learning cell is mostly about understanding how cell works, and not about how to use and memorize some API methods, because there is no API.', 'https://img.stackshare.io/service/7089/Screen-Shot-2017-06-15-at-9.20.42-PM.png', 'https://github.com/intercellular/cell', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (509, '2020-06-24 18:38:00', '2020-06-24 18:38:00', null, 'Element', 'element', 'Element is a Vue 2.0 based component library for developers, designers and product managers, with a set of design resources.', 'https://img.stackshare.io/service/6421/12810740.png', 'https://github.com/ElemeFE/element', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (510, '2020-06-24 18:38:13', '2020-06-24 18:38:13', null, 'UltraEdit', 'ultraedit', 'It is a powerful, fast, and secure text editor whose helpful features make every day life easier for any user type and programming language. Windows, Mac, Linux.
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (511, '2020-06-24 18:38:22', '2020-06-24 18:38:22', null, 'Emacs', 'emacs', 'GNU Emacs is an extensible, customizable text editor—and more. At its core is an interpreter for Emacs Lisp, a dialect of the Lisp programming language with extensions to support text editing. ', 'https://img.stackshare.io/service/645/emacs.gif', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (512, '2020-06-24 18:38:32', '2020-06-24 18:38:32', null, 'ASP.NET', 'asp-net', '.NET is a developer platform made up of tools, programming languages, and libraries for building many different types of applications.', 'https://img.stackshare.io/service/6755/2c45151a4a11d3a3c8e71bb34dd069d6_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (513, '2020-06-24 18:38:58', '2020-06-24 18:38:58', null, 'InfluxDB', 'influxdb', 'InfluxDB is a scalable datastore for metrics, events, and real-time analytics. It has a built-in HTTP API so you don''t have to write any server side code to get up and running.
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (514, '2020-06-24 18:39:15', '2020-06-24 18:39:15', null, 'ActiveMQ', 'activemq', 'Apache ActiveMQ is fast, supports many Cross Language Clients and Protocols, comes with easy to use Enterprise Integration Patterns and many advanced features while fully supporting JMS 1.1 and J2EE 1.4. Apache ActiveMQ is released under the Apache 2.0 License.', 'https://img.stackshare.io/service/1062/vlz__1_.png', 'https://github.com/apache/activemq', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (515, '2020-06-24 18:39:24', '2020-06-24 18:39:24', null, 'Amazon Kinesis', 'amazon-kinesis', 'Amazon Kinesis can collect and process hundreds of gigabytes of data per second from hundreds of thousands of sources, allowing you to easily write applications that process information in real-time, from sources such as web site click-streams, marketing and financial information, manufacturing instrumentation and social media, and operational logs and metering data. ', 'https://img.stackshare.io/service/433/16ffae8c667bdbc6a4969f6f02090652.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (516, '2020-06-24 18:39:32', '2020-06-24 18:39:32', null, 'Akka', 'akka', 'Akka is a toolkit and runtime for building highly concurrent, distributed, and resilient message-driven applications on the JVM.', 'https://img.stackshare.io/service/1773/bxLhidly.png', 'https://github.com/akka/akka', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (517, '2020-06-24 18:39:37', '2020-06-24 18:39:37', null, 'Apache Storm', 'apache-storm', 'Apache Storm is a free and open source distributed realtime computation system. Storm makes it easy to reliably process unbounded streams of data, doing for realtime processing what Hadoop did for batch processing. Storm has many use cases: realtime analytics, online machine learning, continuous computation, distributed RPC, ETL, and more. Storm is fast: a benchmark clocked it at over a million tuples processed per second per node. It is scalable, fault-tolerant, guarantees your data will be processed, and is easy to set up and operate.', 'https://img.stackshare.io/service/1595/WC8j4Gr3.png', 'https://github.com/apache/storm', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (518, '2020-06-24 18:39:54', '2020-06-24 18:39:54', null, 'Amazon SNS', 'amazon-sns', 'Amazon Simple Notification Service makes it simple and cost-effective to push to mobile devices such as iPhone, iPad, Android, Kindle Fire, and internet connected smart devices, as well as pushing to other distributed services. Besides pushing cloud notifications directly to mobile devices, SNS can also deliver notifications by SMS text message or email, to Simple Queue Service (SQS) queues, or to any HTTP endpoint.', 'https://img.stackshare.io/service/396/amazon-sns.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (519, '2020-06-24 18:40:02', '2020-06-24 18:40:02', null, 'Gearman', 'gearman', 'Gearman allows you to do work in parallel, to load balance processing, and to call functions between languages. It can be used in a variety of applications, from high-availability web sites to the transport of database replication events.', 'https://img.stackshare.io/service/1090/gearman.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (520, '2020-06-24 18:40:16', '2020-06-24 18:40:16', null, 'MQTT', 'mqtt', 'It was designed as an extremely lightweight publish/subscribe messaging transport. It is useful for connections with remote locations where a small code footprint is required and/or network bandwidth is at a premium.', 'https://img.stackshare.io/service/3670/mqtticon-large_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (521, '2020-06-24 18:40:29', '2020-06-24 18:40:29', null, 'nanomsg', 'nanomsg', 'It is a socket library that provides several common communication patterns. It aims to make the networking layer fast, scalable, and easy to use. Implemented in C, it works on a wide range of operating systems with no further dependencies.', 'https://img.stackshare.io/service/5718/nanomsg.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (522, '2020-06-24 18:40:46', '2020-06-24 18:40:46', null, 'Bing Maps API', 'bing-maps-api', 'The Bing Maps platform provides multiple API options for your application including Web Control, a Windows Store apps control, a WPF control, REST Services, and Spatial Data Services. Use the information below as well as at MSDN to help determine which API bests suits your needs.', 'https://img.stackshare.io/service/1102/Sgv8z7DN.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (523, '2020-06-24 18:40:50', '2020-06-24 18:40:50', null, 'LocationIQ', 'locationiq', 'Free and Fast Geocoding Service', 'https://img.stackshare.io/service/5325/JfjmH56W.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (524, '2020-06-24 18:41:07', '2020-06-24 18:41:07', null, 'CARTO', 'carto', 'The CARTO platform empowers everyone, from business analysts to data scientists, to turn location data into business outcomes. We accelerate innovation, power new use cases and disrupt business models through Location Intelligence.', 'https://img.stackshare.io/service/2164/carto-logo.png', 'https://github.com/CartoDB/cartodb', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (525, '2020-06-24 18:41:11', '2020-06-24 18:41:11', null, 'ArcGIS', 'arcgis', 'It is a geographic information system for working with maps and geographic information. It is used for creating and using maps, compiling geographic data, analyzing mapped information, sharing  and much more.', 'https://img.stackshare.io/service/4379/mjImnOJe_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (526, '2020-06-24 18:41:24', '2020-06-24 18:41:24', null, 'Parse', 'parse', 'With Parse, you can add a scalable and powerful backend in minutes and launch a full-featured app in record time without ever worrying about server management. We offer push notifications, social integration, data storage, and the ability to add rich custom logic to your app’s backend with Cloud Code.', 'https://img.stackshare.io/service/86/68wTsXcT.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (527, '2020-06-24 18:41:33', '2020-06-24 18:41:33', null, 'Auth0', 'auth0', 'A set of unified APIs and tools that instantly enables Single Sign On and user management to all your applications.', 'https://img.stackshare.io/service/601/5Nm3jtVh.jpeg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (528, '2020-06-24 18:41:38', '2020-06-24 18:41:38', null, 'Heroku', 'heroku', 'Heroku is a cloud application platform – a new way of building and deploying web apps. Heroku lets app developers spend 100% of their time on their application code, not managing servers, deployment, ongoing operations, or scaling.', 'https://img.stackshare.io/service/133/3wgIDj3j.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (529, '2020-06-24 18:41:43', '2020-06-24 18:41:43', null, 'Realm', 'realm', 'The Realm Mobile Platform is a next-generation data layer for applications. Realm is reactive, concurrent, and lightweight, allowing you to work with live, native objects.', 'https://img.stackshare.io/service/1140/realm_logo_200_x_200.png', 'https://github.com/realm/realm-cocoa', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (530, '2020-06-24 18:41:47', '2020-06-24 18:41:47', null, 'Contentful', 'contentful', 'Contentful is a flexible and future-friendly content platform that helps editors to manage and developers to serve content into mobile or web applications. Using Contentful, editors collaborate on content interactively in an easy-to-use editing interface, while developers use the content with the programming language and templating frameworks of their choice.', 'https://img.stackshare.io/service/672/5A0HbXAZ.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (531, '2020-06-24 18:42:05', '2020-06-24 18:42:05', null, 'SendBird', 'sendbird', 'SendBird is a Messaging SDK, Chat API, and fully managed chat infrastructure for your mobile apps and websites. Embeddable chat for iOS, Android, JavaScript, Unity, .NET.', 'https://img.stackshare.io/service/4275/SB_Symbol_RGB_v3.0.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (532, '2020-06-24 18:42:09', '2020-06-24 18:42:09', null, 'Stream', 'stream', 'Stream allows you to build scalable feeds, activity streams, and chat. Stream’s simple, yet powerful API’s and SDKs are used by some of the largest and most popular applications for feeds and chat. SDKs available for most popular languages.', 'https://img.stackshare.io/service/2213/mBSAJI_h_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (533, '2020-06-24 18:42:18', '2020-06-24 18:42:18', null, 'Ably', 'ably-0', 'Ably provides cloud infrastructure and APIs to help developers simplify complex realtime engineering. We make it easy to power and scale realtime features in apps, or distribute data streams to third-party developers as realtime APIs.', 'https://img.stackshare.io/service/6158/5a5d9e561de1436558364b30b3d5717d_400x400.png', 'https://github.com/ably/ably-js', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (534, '2020-06-24 18:42:27', '2020-06-24 18:42:27', null, 'SignalR', 'signalr', 'SignalR allows bi-directional communication between server and client. Servers can now push content to connected clients instantly as it becomes available. SignalR supports Web Sockets, and falls back to other compatible techniques for older browsers. SignalR includes APIs for connection management (for instance, connect and disconnect events), grouping connections, and authorization.', 'https://img.stackshare.io/service/4013/SignalR-logo.png', 'https://github.com/SignalR/SignalR', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (535, '2020-06-24 18:42:35', '2020-06-24 18:42:35', null, 'Chat by Stream', 'chat-by-stream', 'Chat API and SDK. With a beautiful UI Kit, easy to use React Components and powerful API. Add Chat to any application in a matter of hours. The tech uses Go, RocksDB and Raft. By the creators of Stream, the API that powers activity feeds for more than 300 million users.', 'https://img.stackshare.io/service/10836/streamchatph_2x.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (536, '2020-06-24 18:43:01', '2020-06-24 18:43:01', null, 'Leaf', 'leaf', 'Leaf is a Machine Intelligence Framework engineered by software developers, not scientists. It was inspired by the brilliant people behind TensorFlow, Torch, Caffe, Rust and numerous research papers and brings modularity, performance and portability to deep learning. Leaf is lean and tries to introduce minimal technical debt to your stack.', 'https://img.stackshare.io/service/4612/K7cSOnwP.png', 'https://github.com/autumnai/leaf', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (537, '2020-06-24 18:43:23', '2020-06-24 18:43:23', null, 'Cesium', 'cesium', 'it is used to create the leading web-based globe and map for visualizing dynamic data. We strive for the best possible performance, precision, visual quality, ease of use, platform support, and content.', 'https://img.stackshare.io/service/9557/85ba7259a6a0bbfa00ffd975240b3846_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (538, '2020-06-24 18:43:40', '2020-06-24 18:43:40', null, 'Postmark', 'postmark', 'Postmark removes the headaches of delivering and parsing transactional email for webapps with minimal setup time and zero maintenance.', 'https://img.stackshare.io/service/45/yZ35yCOu.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (539, '2020-06-24 18:43:44', '2020-06-24 18:43:44', null, 'Mailchimp', 'mailchimp', 'MailChimp helps you design email newsletters, share them on social networks, integrate with services you already use, and track your results. It''s like your own personal publishing platform.', 'https://img.stackshare.io/service/47/69XlPqVT.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (540, '2020-06-24 18:43:53', '2020-06-24 18:43:53', null, 'SparkPost', 'sparkpost', 'SparkPost is the world’s #1 email delivery provider.  We empower companies with actionable, real-time data to send relevant email to their customers which increases engagement and both top and bottom line revenue.', 'https://img.stackshare.io/company/15421/F5Lz0HYx_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (541, '2020-06-24 18:44:14', '2020-06-24 18:44:14', null, 'Apache Drill', 'drill', 'Apache Drill is a distributed MPP query layer that supports SQL and alternative query languages against NoSQL and Hadoop data storage systems. It was inspired in part by Google''s Dremel.', 'https://img.stackshare.io/service/3054/76b707b638427b42474b32c19eb39dd5.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (542, '2020-06-24 18:44:18', '2020-06-24 18:44:18', null, 'Gmail', 'gmail', 'An easy to use email app that saves you time and keeps your messages safe. Get your messages instantly via push notifications, read and respond online & offline, and find any message quickly.', 'https://img.stackshare.io/service/3167/_K34MGL8_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (543, '2020-06-24 18:44:44', '2020-06-24 18:44:44', null, 'Constant Contact', 'constant-contact', 'As an industry leader in permission based online marketing, Constant Contact partners with the leading providers of online marketing and social media marketing solutions. ', 'https://img.stackshare.io/service/50/nFz-fG-v_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (544, '2020-06-24 18:44:53', '2020-06-24 18:44:53', null, 'Charles', 'charles', 'Charles is a web proxy (HTTP Proxy / HTTP Monitor) that runs on your own computer. Your web browser (or any other Internet application) is then configured to access the Internet through Charles, and Charles is then able to record and display for you all of the data that is sent and received.', 'https://img.stackshare.io/service/2493/charles_icon.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (545, '2020-06-24 18:44:57', '2020-06-24 18:44:57', null, 'Reqres', 'reqres', 'A hosted REST-API ready to respond to your AJAX requests.', 'https://img.stackshare.io/no-img-open-source.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (546, '2020-06-24 18:45:01', '2020-06-24 18:45:01', null, 'APItools', 'apitools', 'APItools is a service for developers to test and debug API traffic, troubleshoot, etc. and for devops to monitor API traffic. Available in the cloud and on-premise. Open source. In private beta.', 'https://img.stackshare.io/service/1237/2fjVQ36v.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (547, '2020-06-24 18:45:05', '2020-06-24 18:45:05', null, 'Restlet Studio', 'restlet-studio', 'Packaged as a Chrome extension and accessible from any modern web browser, Restlet Studio instantly provides to any developer powerful API crafting capabilities. Through an intuitive interface, developers can visually define all the elements of a web API, and automatically generate the client SDK and server skeleton of their API.', 'https://img.stackshare.io/service/2506/2mSsFFsG.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (548, '2020-06-24 18:45:22', '2020-06-24 18:45:22', null, 'BlazeMeter', 'blazemeter', 'Simulate any user scenario for webapps, websites, mobile apps or web services. 100% Apache JMeter compatible. Scalable from 1 to 1,000,000+ concurrent users.<br>', 'https://img.stackshare.io/service/498/WYl4LlbI.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (549, '2020-06-24 18:45:26', '2020-06-24 18:45:26', null, 'Pingdom', 'pingdom', 'Pingdom is an uptime monitoring service. When problems happen with a site that Pingdom monitors, it immediately alerts the owner so the problem can be taken care of.', 'https://img.stackshare.io/service/106/usvDLKsY_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (550, '2020-06-24 18:45:35', '2020-06-24 18:45:35', null, 'Assertible', 'assertible', 'Reduce bugs in web applications by using Assertible to create an automated QA pipeline that helps you catch failures & ship code faster.
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (551, '2020-06-24 18:45:48', '2020-06-24 18:45:48', null, 'SocketCluster', 'socketcluster', 'SocketCluster is a fast, highly scalable HTTP + realtime server engine which lets you build multi-process realtime servers that make use of all CPU cores on a machine/instance. It removes the limitations of having to run your Node.js server as a single thread and makes your backend resilient by automatically recovering from worker crashes and aggregating errors into a central log.', 'https://img.stackshare.io/service/3192/v2uoilfV.png', 'https://github.com/SocketCluster/socketcluster', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (552, '2020-06-24 18:46:05', '2020-06-24 18:46:05', null, 'Amazon MQ', 'amazon-mq', 'Amazon MQ is a managed message broker service for Apache ActiveMQ that makes it easy to set up and operate message brokers in the cloud.', 'https://img.stackshare.io/service/7971/FrshWMKt_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (553, '2020-06-24 18:46:42', '2020-06-24 18:46:42', null, 'Stride', 'stride', 'Bring all the right people together instantly with built-in voice and video meetings. Turn conversations into action with integrated collaboration tools. Find the space to focus so you can get to done faster.', 'https://img.stackshare.io/service/7572/246x0w.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (554, '2020-06-24 18:46:46', '2020-06-24 18:46:46', null, 'Yammer', 'yammer', 'Yammer brings the power of social networking to your company. Collaborate securely across departments, geographies, content and business applications.', 'https://img.stackshare.io/service/246/NWoiK8Kp.jpeg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (555, '2020-06-24 18:46:54', '2020-06-24 18:46:54', null, 'Flock', 'flock', 'Flock is a communication app for teams. Packed with tons of productivity features, Flock drives efficiency and boosts speed of execution.', 'https://img.stackshare.io/service/6194/5iU0I0wb_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (556, '2020-06-24 18:46:58', '2020-06-24 18:46:58', null, 'Flowdock', 'flowdock', 'Flowdock is a web-based team chat service that integrates with your tools to provide a window into your team''s activities. With the team inbox, everyone on your team can stay up to date. Stay connected with Flowdock''s iOS and Android apps.', 'https://img.stackshare.io/service/547/-vh2vDWG_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (557, '2020-06-24 18:47:03', '2020-06-24 18:47:03', null, 'WhatsApp', 'whatsapp', 'It is a cross-platform mobile messaging app for iPhone, BlackBerry, Android, Windows Phone and Nokia.  It allows users to send text messages and voice messages, make voice and video calls, and share images, documents, user locations, and other media.', 'https://img.stackshare.io/service/4410/SqyiYHRL_400x400.png', '', '', '', '');
