INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (560, '2020-06-24 18:47:42', '2020-06-24 18:47:42', null, 'Microsoft Teams', 'microsoft-teams', 'See content and chat history anytime, including team chats with Skype that are visible to the whole team. Private group chats are available for smaller group conversations.', 'https://img.stackshare.io/service/5989/teams.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (561, '2020-06-24 18:47:46', '2020-06-24 18:47:46', null, 'Discord', 'discord', 'Discord is a modern free voice & text chat app for groups of gamers. Our resilient Erlang backend running on the cloud has built in DDoS protection with automatic server failover.', 'https://img.stackshare.io/service/4418/gT8yKJa7.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (562, '2020-06-24 18:47:52', '2020-06-24 18:47:52', null, 'Trello', 'trello', 'Trello is a collaboration tool that organizes your projects into boards. In one glance, Trello tells you what''s being worked on, who''s working on what, and where something is in a process.', 'https://img.stackshare.io/service/109/-CvHThPk_400x400.jpg', '', '', '', '');
