INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (565, '2020-06-24 18:48:18', '2020-06-24 18:48:18', null, 'Spyder', 'spyder', 'It is a powerful scientific environment written in Python, for Python, and designed by and for scientists, engineers and data analysts.', 'https://img.stackshare.io/service/8758/FMxO_-fd_400x400.png', 'https://github.com/spyder-ide/spyder?ref=stackshare', '', '', '');
