INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (567, '2020-06-24 18:48:47', '2020-06-24 18:48:47', null, 'Hue', 'hue', 'It is open source and lets regular users import their big data, query it, search it, visualize it and build dashboards on top of it, all from their browser.', 'https://img.stackshare.io/service/1910/d64e494ec7611a65e9960689e1a04a23_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (568, '2020-06-24 18:49:12', '2020-06-24 18:49:12', null, 'NVD3', 'nvd3', 'This project is an attempt to build re-usable charts and chart components for d3.js without taking away the power that d3.js gives you. This is a very young collection of components, with the goal of keeping these components very customizable, staying away from your standard cookie cutter solutions.', 'https://img.stackshare.io/service/4367/no-img-open-source.png', 'https://github.com/novus/nvd3', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (569, '2020-06-24 18:49:16', '2020-06-24 18:49:16', null, 'Plotly', 'plotly', 'Plotly.js is the only open-source JavaScript library for data visualization in the sciences and engineering. Open-source interfaces to Plotly.js are available for Python, R, MATLAB, and React.', 'https://img.stackshare.io/service/2385/5997976.jpeg', 'https://github.com/plotly/plotly.js', '', '', '');
