INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (571, '2020-06-24 18:49:54', '2020-06-24 18:49:54', null, 'amCharts', 'amcharts', 'amCharts is an advanced charting library that will suit any data visualization need. Our charting solution include Column, Bar, Line, Area, Step, Step without risers, Smoothed line, Candlestick, OHLC, Pie/Donut, Radar/ Polar, XY/Scatter/Bubble, Bullet, Funnel/Pyramid charts as well as Gauges.', 'https://img.stackshare.io/service/2396/pptlXTHN.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (572, '2020-06-24 18:50:02', '2020-06-24 18:50:02', null, 'Google Charts', 'google-charts', 'It is an interactive Web service that creates graphical charts from user-supplied information. The user supplies data and a formatting specification expressed in JavaScript embedded in a Web page; in response the service sends an image of the chart. ', 'https://img.stackshare.io/service/1651/ma2jqJKH_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (573, '2020-06-24 18:50:06', '2020-06-24 18:50:06', null, 'ECharts', 'echarts', 'It is an open source visualization library implemented in JavaScript, runs smoothly on PCs and mobile devices, and is compatible with most current browsers.', 'https://img.stackshare.io/service/4230/aSzYQa43_400x400.jpg', 'https://github.com/apache/incubator-echarts', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (574, '2020-06-24 18:50:23', '2020-06-24 18:50:23', null, 'Mailtrap', 'mailtrap', 'Fake SMTP server for development teams to test, view and share emails sent from the development and staging environments without spamming real customers.', 'https://img.stackshare.io/service/506/VWjhZN6Z_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (575, '2020-06-24 18:50:27', '2020-06-24 18:50:27', null, 'Premailer', 'premailer', 'For the best HTML e-mail delivery results, CSS should be inline. This is a huge pain and a simple newsletter becomes un-managable very quickly. This script is the solution.', 'https://img.stackshare.io/service/1331/5750522.png', 'https://github.com/premailer/premailer', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (576, '2020-06-24 18:50:32', '2020-06-24 18:50:32', null, 'MailCatcher', 'mailcatcher', 'It runs a super simple SMTP server which catches any message sent to it to display in a web interface. It catches all mail and stores it for display. It shows HTML, Plain Text and Source version of messages, as applicable.
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (577, '2020-06-24 18:50:36', '2020-06-24 18:50:36', null, 'MailHog', 'mailhog', 'It is an email testing tool for developers. You can configure your application to use MailHog for SMTP delivery. You can view messages in the web UI, or retrieve them with the JSON API.', 'https://img.stackshare.io/service/7378/10258541.png', 'https://github.com/mailhog/MailHog', '', '', '');
