INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (579, '2020-06-24 18:50:54', '2020-06-24 18:50:54', null, 'BrowserStack', 'browserstack', 'Live, Web-Based Browser Testing
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (580, '2020-06-24 18:51:21', '2020-06-24 18:51:21', null, 'Raygun', 'raygun', 'Raygun gives you a window into how users are really experiencing your software applications. Detect, diagnose and resolve issues that are affecting end users with greater speed and accuracy.', 'https://img.stackshare.io/service/192/jTDjfbiS_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (581, '2020-06-24 18:51:39', '2020-06-24 18:51:39', null, 'Crashlytics', 'crashlytics', 'Instead of just showing you the stack trace, Crashlytics performs deep analysis of each and every thread. We de-prioritize lines that don''t matter while highlighting the interesting ones. This makes reading stack traces easier, faster, and far more useful! Crashlytics'' intelligent grouping can take 50,000 crashes, distill them down to 20 unique issues, and then tell you which 3 are the most important to fix.', 'https://img.stackshare.io/service/264/Q3LJPRGx.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (582, '2020-06-24 18:51:52', '2020-06-24 18:51:52', null, 'Instabug', 'instabug', 'Instabug is a platform for Real-Time Contextual Insights that completely takes care of your bug reporting and user feedback process; to accelerate your workflow and allow you to release with confidence. ', 'https://img.stackshare.io/service/3586/InstabugLogo_vertical_600x600.png', '', '', '', '');
