INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (584, '2020-06-24 18:52:39', '2020-06-24 18:52:39', null, 'Amazon Web Services', 'amazon-web-services', 'It provides on-demand cloud computing platforms to individuals, companies and governments. It offers reliable, scalable, and inexpensive cloud computing services.', 'https://img.stackshare.io/service/5200/FrshWMKt_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (585, '2020-06-24 18:52:44', '2020-06-24 18:52:44', null, 'Google Cloud Platform', 'google-cloud-platform', 'It helps you build what''s next with secure infrastructure, developer tools, APIs, data analytics and machine learning. It is a suite of cloud computing services that runs on the same infrastructure that Google uses internally for its end-user products, such as Google Search and YouTube.', 'https://img.stackshare.io/service/4240/1a61e4pu_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (586, '2020-06-24 18:53:09', '2020-06-24 18:53:09', null, 'WebFaction', 'webfaction', 'No need to spend hours installing and configuring the software, database and other tools. We have over 50 one-click installers in our control panel.', 'https://ucarecdn.com/84bad1ad-bfcb-445c-b902-6e2a68ff9ed2/', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (587, '2020-06-24 18:53:17', '2020-06-24 18:53:17', null, 'RamNode', 'ramnode', 'High performance hosting on a simplified OpenStack platform.', 'https://img.stackshare.io/service/2472/8fe14fe3a96c13bc744e7cbca6b7cd58.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (588, '2020-06-24 18:53:25', '2020-06-24 18:53:25', null, 'CImg', 'cimg', 'It mainly consists in a (big) single header file CImg.h providing a set of C++ classes and functions that can be used in your own sources, to load/save, manage/process and display generic images.', 'https://img.stackshare.io/service/5175/no-img-open-source.png', 'https://github.com/dtschump/CImg', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (589, '2020-06-24 18:53:29', '2020-06-24 18:53:29', null, 'OpenGL', 'opengl', 'It is a cross-language, cross-platform application programming interface for rendering 2D and 3D vector graphics. The API is typically used to interact with a graphics processing unit, to achieve hardware-accelerated rendering.', 'https://img.stackshare.io/service/4266/-K9sv7Gz_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (590, '2020-06-24 18:53:38', '2020-06-24 18:53:38', null, 'OpenCL', 'opencl', 'It is the open, royalty-free standard for cross-platform, parallel programming of diverse processors found in personal computers, servers, mobile devices and embedded platforms. It greatly improves the speed and responsiveness of a wide spectrum of applications in numerous market categories including gaming and entertainment titles, scientific and medical software, professional creative tools, vision processing, and neural network training and inferencing.', 'https://img.stackshare.io/service/8767/opencl.jpeg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (591, '2020-06-24 18:54:02', '2020-06-24 18:54:02', null, 'Pixaven', 'pixaven', 'Transform, adjust, enhance, stylize, filter, apply watermarks, and store your images with blazing speed. It guarantees ultra-fast image operations and unparalleled quality of your visual content thanks to a modern, GPU-powered image processing engine.', 'https://img.stackshare.io/service/11923/gsp5rNgB_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (592, '2020-06-24 18:54:15', '2020-06-24 18:54:15', null, 'Flight', 'flight', 'Flight is distinct from existing frameworks in that it doesn''t prescribe or provide any particular approach to rendering or providing data to a web application. It''s agnostic to how requests are routed, which templating language you use or even if you render your HTML on the client or the server. While some web frameworks encourage developers to arrange their code around a prescribed model layer, Flight is organized around the existing DOM model with functionality mapped directly to DOM nodes.', 'https://img.stackshare.io/service/2909/8daa3c654f99955695e287d9d1aa87b9.png', 'https://github.com/flightjs/flight', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (593, '2020-06-24 18:54:19', '2020-06-24 18:54:19', null, 'Sketch', 'sketch', 'Easily create complex shapes with our state-of-the-art vector boolean operations and take advantage of our extensive layer styles.', 'https://img.stackshare.io/service/4561/c07jH7QS.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (594, '2020-06-24 18:54:23', '2020-06-24 18:54:23', null, 'Zeplin', 'zeplin', 'Collaboration app for designers & developers. Supports Sketch and Photoshop (on beta!).', 'https://img.stackshare.io/service/3457/SNbLveBx.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (595, '2020-06-24 18:54:32', '2020-06-24 18:54:32', null, 'Adobe XD', 'adobe-xd', 'A vector-based tool developed and published by Adobe Inc for designing and prototyping user experience for web and mobile apps. ', 'https://img.stackshare.io/service/5602/adobe-xd-logo.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (596, '2020-06-24 18:54:45', '2020-06-24 18:54:45', null, 'Atomic', 'atomic_2', 'Pull in designs from Photoshop or Sketch, instantly animate between them, and share your prototypes with anyone or view on any device via URL.', 'https://img.stackshare.io/service/3086/H3AAb-hd.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (597, '2020-06-24 18:54:57', '2020-06-24 18:54:57', null, 'Marqueed', 'marqueed', 'Marqueed allows the rapid collection of images, culled from websites using drag-and-drop or our bookmarklet feature, which can then be shared and discussed publicly or privately. In each gallery you can invite collaborators and together arrange, label, annotate, and draw on the images to communicate your visual ideas.', 'https://img.stackshare.io/service/126/jzazgjp4pvrakm2u4xgz.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (598, '2020-06-24 18:55:13', '2020-06-24 18:55:13', null, 'Principle', 'principle', 'It makes it easy to design animated and interactive user interfaces. Whether you''re designing the flow of a multi-screen app, or new interactions and animations, it helps you create designs that look and feel amazing.', 'https://img.stackshare.io/service/6057/Mg2OVH9o_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (599, '2020-06-24 18:55:22', '2020-06-24 18:55:22', null, 'Fluid UI', 'fluid-ui', 'It is a prototyping tool that lets you design, test and get feedback on your app ideas quickly and without needing to know how to code.
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (600, '2020-06-24 18:55:51', '2020-06-24 18:55:51', null, 'Google App Engine', 'google-app-engine', 'Google has a reputation for highly reliable, high performance infrastructure. With App Engine you can take advantage of the 10 years of knowledge Google has in running massively scalable, performance driven systems. App Engine applications are easy to build, easy to maintain, and easy to scale as your traffic and data storage needs grow. ', 'https://img.stackshare.io/service/139/s01TMTGn.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (601, '2020-06-24 18:56:32', '2020-06-24 18:56:32', null, 'AWeber', 'aweber', 'It is an email marketing service provider with over 100,000 small business clients world wide. It helps people keep in touch with the subscribers who have requested to be on their mailing list. ', 'https://img.stackshare.io/service/3871/7L3pCyc__400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (602, '2020-06-24 18:56:45', '2020-06-24 18:56:45', null, 'PayPal', 'paypal', 'PayPal is an online payments and money transfer service that allows you to send money via email, phone, text message or Skype. They offer products to both individuals and businesses alike, including online vendors, auction sites and corporate users. PayPal connects effortlessly to bank accounts and credit cards.
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (603, '2020-06-24 18:56:53', '2020-06-24 18:56:53', null, 'Wirecard', 'wirecard', 'It is a global internet technology and financial services provider which is listed on the German stock exchange. It offers worldwide services for innovative digital payments: online, mobile, and at the POS.', 'https://img.stackshare.io/service/9542/gE7ZUfPA_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (604, '2020-06-24 18:56:57', '2020-06-24 18:56:57', null, 'Mollie', 'mollie', 'Helps businesses of all sizes to sell and build more efficiently with a solid but easy-to-use payment solution. ', 'https://img.stackshare.io/service/6683/Ia0vTZ_a_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (605, '2020-06-24 18:57:02', '2020-06-24 18:57:02', null, 'CyberSource', 'cybersource', 'It is an e-commerce credit card payment system management company. Customers process online payments, streamline online fraud management, and simplify payment security. ', 'https://img.stackshare.io/service/2585/4KxE4Ykq_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (606, '2020-06-24 18:57:35', '2020-06-24 18:57:35', null, 'WePay', 'wepay', 'WePay helps people sell tickets to events, send invoices, sell items online, and accept donations online. WePay also provides an API that allows developers to access its payments platform.', 'https://img.stackshare.io/service/237/QtfjIBsx.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (607, '2020-06-24 18:57:39', '2020-06-24 18:57:39', null, 'Recurly', 'recurly', 'Recurly is the leading pay-as-you-go recurring billing service because setup is easy, integrations are quick, and our service grows with the needs of your business.', 'https://img.stackshare.io/service/101/k5k9oe87zeufoqndzo1w.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (608, '2020-06-24 18:57:43', '2020-06-24 18:57:43', null, 'Shopify', 'shopify', 'Shopify powers tens of thousands of online retailers including General Electric, Amnesty International, CrossFit, Tesla Motors, Encyclopaedia Britannica, Foo Fighters, GitHub, and more. Our platform allows users to easily and quickly create their own online store without all the technical work involved in developing their own website, or the huge expense of having someone else build it. Shopify lets merchants manage all aspects of their shops: uploading products, changing the design, accepting credit card orders, and viewing their incoming orders and completed transactions.', 'https://img.stackshare.io/service/266/xDoyHgZW_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (609, '2020-06-24 18:57:56', '2020-06-24 18:57:56', null, 'Google Hangouts', 'google-hangouts', 'Message contacts, start free video or voice calls, and hop on a conversation with one person or a group.', 'https://ucarecdn.com/4e2a74dc-9dfc-407c-aecf-c80656b7dbd9/', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (610, '2020-06-24 18:59:11', '2020-06-24 18:59:11', null, 'jQuery Mobile', 'jquery-mobile', 'jQuery Mobile is a HTML5-based user interface system designed to make responsive web sites and apps that are accessible on all smartphone, tablet and desktop devices.', 'https://img.stackshare.io/service/1023/80508321d8ce3ba8aa264380bb7eba33_400x400.png', 'https://github.com/jquery/jquery-mobile', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (611, '2020-06-24 18:59:58', '2020-06-24 18:59:58', null, 'Vue.js', 'vue-js', 'It is a library for building interactive web interfaces. It provides data-reactive components with a simple and flexible API. ', 'https://img.stackshare.io/service/3837/paeckCWC.png', 'https://github.com/vuejs/vue', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (612, '2020-06-24 19:00:28', '2020-06-24 19:00:28', null, 'Apple Push Notification Service', 'apple-push-notification-service', 'It is the centerpiece of the remote notifications feature. It is a robust, secure, and highly efficient service for app developers to propagate information to iOS (and, indirectly, watchOS), tvOS, and macOS devices.', 'https://img.stackshare.io/service/4692/iEqpsbUA_200x200.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (613, '2020-06-24 19:00:36', '2020-06-24 19:00:36', null, 'Firebase Cloud Messaging', 'firebase-cloud-messaging', 'It is a cross-platform messaging solution that lets you reliably deliver messages at no cost. You can notify a client app that new email or other data is available to sync. You can send notification messages to drive user re-engagement and retention. For use cases such as instant messaging, a message can transfer a payload of up to 4KB to a client app.', 'https://img.stackshare.io/service/7670/m3cEA33V_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (614, '2020-06-24 19:00:49', '2020-06-24 19:00:49', null, 'Mixpanel', 'mixpanel', 'Mixpanel is an advanced analytics service that helps improve web and mobile applications by tracking how users interact & engage with them. ', 'https://img.stackshare.io/service/60/Dmy5RfTT_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (615, '2020-06-24 19:00:54', '2020-06-24 19:00:54', null, 'Mobile Action', 'mobile-action', 'Mobile Action helps mobile marketing teams, developers and founders manage the app store optimization and ad campaigns of their mobile apps in an all-in-one mobile marketing platform. Mobile Action offers insights into app store optimization for clients to better position themselves in the app stores and garner the highest organic downloads that have the biggest impact on retention.', 'https://img.stackshare.io/service/2225/6excXKQZ.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (616, '2020-06-24 19:00:58', '2020-06-24 19:00:58', null, 'appFigures', 'appfigures', 'App store intelligence for app developers, marketers, and other spectators. Sales and download tracking, ad analytics, app store reviews, app store ranks and top charts, and more.', 'https://img.stackshare.io/service/1097/7c3d205a86621e0be1534f5cfd7f6422.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (617, '2020-06-24 19:01:02', '2020-06-24 19:01:02', null, 'SimilarWeb', 'similarweb', 'It is a website which provides web analytics services for businesses. The company offers its customers information on their clients'' and competitors'' website traffic volumes; referral sources, including keyword analysis; and website "stickiness", among other features.', 'https://img.stackshare.io/service/6222/4r3bbaGp_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (618, '2020-06-24 19:01:27', '2020-06-24 19:01:27', null, 'StoreMaven', 'storemaven', 'In 2014, StoreMaven invented App Store A/B testing. Today, over 60% of top app publishers (such as Google, Zynga, and Uber) rely on our platform and expertise to test their app store marketing assets and understand user behavior.', 'https://img.stackshare.io/service/1137/400x400__4_.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (619, '2020-06-24 19:02:31', '2020-06-24 19:02:31', null, 'Botkit', 'botkit', 'Botkit designed to ease the process of designing and running useful, creative bots that live inside Slack, Facebook Messenger and other messaging platforms.', 'https://img.stackshare.io/service/4897/3bMSWEnX.jpg', 'https://github.com/howdyai/botkit', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (620, '2020-06-24 19:02:35', '2020-06-24 19:02:35', null, 'Errbot', 'errbot', 'The main use is to make it easy for you to write your own plugins so you can make it do whatever you want: a deployment, retrieving some information online, trigger a tool via an API.', 'https://img.stackshare.io/service/10398/New_Project__37_.png', 'https://github.com/errbotio/errbot', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (621, '2020-06-24 19:02:40', '2020-06-24 19:02:40', null, 'Sequel', 'sequel', 'It is a simple, flexible, and powerful SQL database access toolkit for Ruby. It includes a comprehensive ORM layer for mapping records to Ruby objects and handling associated records.', 'https://img.stackshare.io/service/6651/preview.jpeg', 'https://github.com/jeremyevans/sequel', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (622, '2020-06-24 19:02:48', '2020-06-24 19:02:48', null, 'Pagerbot', 'pagerbot', 'Pagerbot is a bot that makes managing PagerDuty on-call schedules easier. It currently supports IRC and slack, and can be easily deployed to heroku.', 'https://img.stackshare.io/no-img-open-source.png', 'https://github.com/stripe/pagerbot', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (623, '2020-06-24 19:03:21', '2020-06-24 19:03:21', null, 'Selenium', 'selenium', 'Selenium automates browsers. That''s it! What you do with that power is entirely up to you. Primarily, it is for automating web applications for testing purposes, but is certainly not limited to just that. Boring web-based administration tasks can (and should!) also be automated as well.', 'https://img.stackshare.io/service/1517/sbUizSli_400x400.jpg', 'https://github.com/SeleniumHQ/selenium', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (624, '2020-06-24 19:03:26', '2020-06-24 19:03:26', null, 'TestCafe', 'testcafe', 'It is a pure node.js end-to-end solution for testing web apps. It takes care of all the stages: starting browsers, running tests, gathering test results and generating reports.', 'https://img.stackshare.io/service/7532/W2FwS-Ry_400x400.jpg', 'https://github.com/devexpress/testcafe', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (625, '2020-06-24 19:03:31', '2020-06-24 19:03:31', null, 'Puppeteer', 'puppeteer', 'Puppeteer is a Node library which provides a high-level API to control headless Chrome over the DevTools Protocol. It can also be configured to use full (non-headless) Chrome.', 'https://img.stackshare.io/service/7553/puppeteer.png', 'https://github.com/GoogleChrome/puppeteer', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (626, '2020-06-24 19:03:35', '2020-06-24 19:03:35', null, 'WebdriverIO', 'webdriverio', 'WebdriverIO lets you control a browser or a mobile application with just a few lines of code. Your test code will look simple, concise and easy to read.', 'https://img.stackshare.io/service/4185/webdriver.io.png', 'https://github.com/webdriverio/webdriverio', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (627, '2020-06-24 19:03:39', '2020-06-24 19:03:39', null, 'Protractor', 'protractor', 'Protractor is an end-to-end test framework for Angular and AngularJS applications. Protractor runs tests against your application running in a real browser, interacting with it as a user would.', 'https://img.stackshare.io/service/1754/protractor-logo1.png', 'https://github.com/angular/protractor', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (628, '2020-06-24 19:03:48', '2020-06-24 19:03:48', null, 'Mocha', 'mocha', 'Mocha is a feature-rich JavaScript test framework running on node.js and the browser, making asynchronous testing simple and fun. Mocha tests run serially, allowing for flexible and accurate reporting, while mapping uncaught exceptions to the correct test cases. ', 'https://img.stackshare.io/service/832/mocha.png', 'https://github.com/visionmedia/mocha', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (629, '2020-06-24 19:03:57', '2020-06-24 19:03:57', null, 'AVA', 'ava', 'Even though JavaScript is single-threaded, IO in Node.js can happen in parallel due to its async nature. AVA takes advantage of this and runs your tests concurrently, which is especially beneficial for IO heavy tests. In addition, test files are run in parallel as separate processes, giving you even better performance and an isolated environment for each test file.', 'https://img.stackshare.io/service/4685/6ae_Oi3X.png', 'https://github.com/sindresorhus/ava', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (630, '2020-06-24 19:04:02', '2020-06-24 19:04:02', null, 'Enzyme', 'enzyme', 'Enzyme is a JavaScript Testing utility for React that makes it easier to assert, manipulate, and traverse your React Components'' output.', 'https://img.stackshare.io/service/4488/enzyme.png', 'https://github.com/airbnb/enzyme', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (631, '2020-06-24 19:04:06', '2020-06-24 19:04:06', null, 'Jasmine', 'jasmine', 'Jasmine is a Behavior Driven Development testing framework for JavaScript. It does not rely on browsers, DOM, or any JavaScript framework. Thus it''s suited for websites, Node.js projects, or anywhere that JavaScript can run.', 'https://img.stackshare.io/service/831/7c0b595409af531b9cdeb07f8c513e8b.png', 'https://github.com/pivotal/jasmine', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (632, '2020-06-24 19:04:15', '2020-06-24 19:04:15', null, 'PHP CodeSniffer', 'php-codesniffer', 'It tokenizes PHP, JavaScript and CSS files and detects violations of a defined set of coding standards. It is an essential development tool that ensures your code remains clean and consistent.', 'https://img.stackshare.io/service/11011/997547.png', 'https://github.com/squizlabs/PHP_CodeSniffer', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (633, '2020-06-24 19:04:19', '2020-06-24 19:04:19', null, 'Codebrag', 'codebrag', 'Codebrag saves you time with well‑organized and enjoyable code reviews. A simple dashboard combined with a game‑like experience brings fun to the process and makes it work for your team. Codebrag gamifies the experience with achievements, leader boards, gravatars and ''Likes'' for the code. Codebrag is built by developers with over 10 years experience in programming, working on projects all over the world. It is developed with passion answering a real need to make code reviews an easier and more pleasant experience.', 'https://img.stackshare.io/service/331/ecdac83c75298d0ee378d5b913300f9d.jpeg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (634, '2020-06-24 19:04:27', '2020-06-24 19:04:27', null, 'Phacility', 'phacility', 'A hosted version of Phabricator, that you pay for.', 'https://img.stackshare.io/service/752/E0Z5_o2v.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (635, '2020-06-24 19:04:35', '2020-06-24 19:04:35', null, 'PullReview', 'pullreview', 'PullReview helps Ruby and Rails developers to develop new features cleanly, on-time, and with confidence by automatically reviewing their code.
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (636, '2020-06-24 19:04:44', '2020-06-24 19:04:44', null, 'EditorConfig', 'editorconfig', 'It is a file format and collection of text editor plugins. It helps maintain consistent coding styles for multiple developers working on the same project across various editors and IDEs.', 'https://img.stackshare.io/service/4726/edcon_color_transbg2_400x400.png', '', '', '', '');
