INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (640, '2020-06-24 19:05:54', '2020-06-24 19:05:54', null, 'Heroku Postgres', 'heroku-postgres', 'Heroku Postgres provides a SQL database-as-a-service that lets you focus on building your application instead of messing around with database management.', 'https://img.stackshare.io/service/2516/original.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (641, '2020-06-24 19:05:59', '2020-06-24 19:05:59', null, 'Google Cloud SQL', 'google-cloud-sql', 'MySQL databases deployed in the cloud without a fuss. Google Cloud Platform provides you with powerful databases that run fast, don’t run out of space and give your application the redundant, reliable storage it needs.', 'https://img.stackshare.io/service/619/Cloud_SQL.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (642, '2020-06-24 19:06:40', '2020-06-24 19:06:40', null, 'gRPC', 'grpc', 'gRPC is a modern open source high performance RPC framework that can run in any environment. It can efficiently connect services in and across data centers with pluggable support for load balancing, tracing, health checking...', 'https://img.stackshare.io/service/4670/Tb-g6Nu3_400x400.jpg', 'https://github.com/grpc/grpc', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (643, '2020-06-24 19:07:00', '2020-06-24 19:07:00', null, 'REST', 'rest', 'An architectural style for developing web services. A distributed system framework that uses Web protocols and technologies.', 'https://img.stackshare.io/service/2969/0Zflj6Y__400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (644, '2020-06-24 19:07:13', '2020-06-24 19:07:13', null, 'Apollo', 'apollo', 'Build a universal GraphQL API on top of your existing REST APIs, so you can ship new application features fast without waiting on backend changes.', 'https://img.stackshare.io/service/5508/CyUH653y.png', 'https://github.com/apollostack/apollo-server', '', '', '');
