INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (646, '2020-06-24 19:07:25', '2020-06-24 19:07:25', null, 'TypeORM', 'typeorm', 'It supports both Active Record and Data Mapper patterns, unlike all other JavaScript ORMs currently in existence, which means you can write high quality, loosely coupled, scalable, maintainable applications the most productive way.', 'https://img.stackshare.io/service/7419/20165699.png', 'https://github.com/typeorm/typeorm', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (647, '2020-06-24 19:07:42', '2020-06-24 19:07:42', null, 'Emotion', 'emotion', 'Emotion is a performant and flexible CSS-in-JS library. Building on many other CSS-in-JS libraries, it allows you to style apps quickly with string or object styles. It has predictable composition to avoid specificity issues with CSS. With source maps and labels, Emotion has a great developer experience and great performance with heavy caching in production.', 'https://img.stackshare.io/service/8770/emotion-a76dfa0d18a0536af9e917cdb8f873b9-44576.png', 'https://github.com/emotion-js/emotion', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (648, '2020-06-24 19:07:46', '2020-06-24 19:07:46', null, 'PrimeReact', 'primereact', 'PrimeReact is a rich set of open source UI Components for React.', 'https://img.stackshare.io/service/8766/8KpRJctC_400x400.jpg', 'https://github.com/primefaces/primereact', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (649, '2020-06-24 19:08:15', '2020-06-24 19:08:15', null, 'angular-gantt', 'angular-gantt', 'angular-gantt provides a gantt chart component to your AngularJS application.', 'https://img.stackshare.io/service/2159/angular-gantt.png', 'https://github.com/angular-gantt/angular-gantt', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (650, '2020-06-24 19:08:19', '2020-06-24 19:08:19', null, 'React Hot Loader', 'react-hot-loader', 'Tweak React components in real time.', 'https://img.stackshare.io/no-img-open-source.png', 'https://github.com/gaearon/react-hot-loader', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (651, '2020-06-24 19:08:23', '2020-06-24 19:08:23', null, 'Vue CLI', 'vue-cli', 'Vue CLI aims to be the standard tooling baseline for the Vue ecosystem. It ensures the various build tools work smoothly together with sensible defaults so you can focus on writing your app instead of spending days wrangling with config.', 'https://img.stackshare.io/service/9559/upM71pVR_400x400.jpg', 'https://github.com/vuejs/vue-cli', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (652, '2020-06-24 19:09:25', '2020-06-24 19:09:25', null, 'NodeGUI', 'nodegui', 'It is an open source library for building cross-platform native desktop applications with JavaScript and CSS like styling. It is based on Qt5 and NOT chromium, hence it is memory and cpu efficient. ', 'https://img.stackshare.io/service/11301/preview.png', 'https://github.com/nodegui/nodegui', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (653, '2020-06-24 19:10:02', '2020-06-24 19:10:02', null, 'SmartGit', 'smartgit', 'It is a graphical Git client with support for SVN and Pull Requests for GitHub and Bitbucket. It runs on Windows, macOS and Linux.', 'https://img.stackshare.io/service/2178/syntevo_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (654, '2020-06-24 19:11:58', '2020-06-24 19:11:58', null, 'Chaplin', 'chaplin', 'Chaplin addresses Backbone’s limitations by providing a lightweight and flexible structure that features well-proven design patterns and best practices. Chaplin empowers you to quickly develop scalable single-page web applications; allowing you to focus on designing and developing the underlying functionality in your web application.', 'https://img.stackshare.io/service/1145/chaplin-logo-hut-quad.png', 'https://github.com/chaplinjs/chaplin', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (655, '2020-06-24 19:12:02', '2020-06-24 19:12:02', null, 'Ampersand.js', 'ampersandjs', 'We <3 Backbone.js at &yet. It’s brilliantly simple and solves many common problems in developing clientside applications. But we missed the focused simplicity of tiny modules in node-land. We wanted something similar in style and philosophy, but that fully embraced tiny modules, npm, and browserify. Ampersand.js is a well-defined approach to combining (get it?) a series of intentionally tiny modules.', 'https://img.stackshare.io/service/1387/pmwBlTsY.png', 'https://github.com/AmpersandJS/ampersand', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (656, '2020-06-24 19:12:07', '2020-06-24 19:12:07', null, 'Espresso.js', 'espressojs', 'Espresso.js is a tiny MVC framework inspired by Backbone and React with a focus on simplicity and speed. We''ve aimed to bring the ideas of unidirectional data flow of Flux to a simple, Backbone-style library.', 'https://img.stackshare.io/no-img-open-source.png', 'https://github.com/techlayer/espresso.js', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (657, '2020-06-24 19:13:18', '2020-06-24 19:13:18', null, 'AdonisJS', 'adonisjs', 'It is a Node.js Framework which is highly focused on developer ergonomics, stability and confidence.', 'https://img.stackshare.io/service/6439/AlIKY7xr_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (658, '2020-06-24 19:13:23', '2020-06-24 19:13:23', null, 'FeathersJS', 'feathersjs', 'Feathers is a real-time, micro-service web framework for NodeJS that gives you control over your data via RESTful resources, sockets and flexible plug-ins.', 'https://img.stackshare.io/service/3448/5321853.png', 'https://github.com/feathersjs/feathers', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (659, '2020-06-24 19:13:27', '2020-06-24 19:13:27', null, 'Koa', 'koa', 'Koa aims to be a smaller, more expressive, and more robust foundation for web applications and APIs. Through leveraging generators Koa allows you to ditch callbacks and greatly increase error-handling. Koa does not bundle any middleware.', 'https://img.stackshare.io/service/1726/5055057.png', 'https://github.com/koajs/koa', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (660, '2020-06-24 19:13:32', '2020-06-24 19:13:32', null, 'LoopBack', 'loopback', 'A highly-extensible, open-source Node.js framework that enables you to create dynamic end-to-end REST APIs with little or no coding. Connect to multiple data sources, write business logic in Node.js, glue on top of your existing services and data, connect using JS, iOS & Android SDKs.', 'https://img.stackshare.io/service/2727/loobback-logo.png', 'https://github.com/strongloop/loopback', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (661, '2020-06-24 19:13:36', '2020-06-24 19:13:36', null, 'hapi', 'hapi', 'hapi is a simple to use configuration-centric framework with built-in support for input validation, caching, authentication, and other essential facilities for building web applications and services.', 'https://img.stackshare.io/service/1166/AC_RK5Ra_400x400.png', 'https://github.com/spumko/hapi', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (662, '2020-06-24 19:14:01', '2020-06-24 19:14:01', null, 'TextMate', 'textmate', 'TextMate brings Apple''s approach to operating systems into the world of text editors. By bridging UNIX underpinnings and GUI, TextMate cherry-picks the best of both worlds to the benefit of expert scripters and novice users alike.', 'https://img.stackshare.io/service/643/textmate2.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (663, '2020-06-24 19:14:22', '2020-06-24 19:14:22', null, 'Neovim', 'neovim', 'Neovim is a project that seeks to aggressively refactor Vim in order to: simplify maintenance and encourage contributions, split the work between multiple developers, enable the implementation of new/modern user interfaces without any modifications to the core source, and improve extensibility with a new plugin architecture.', 'https://img.stackshare.io/service/983/XDy-S1r6.png', 'https://github.com/neovim/neovim', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (664, '2020-06-24 19:14:48', '2020-06-24 19:14:48', null, 'Zoom', 'zoom', 'Zoom unifies cloud video conferencing, simple online meetings, and cross platform group chat into one easy-to-use platform. Our solution offers the best video, audio, and screen-sharing experience across Zoom Rooms, Windows, Mac, iOS, Android, and H.323/SIP room systems.', 'https://img.stackshare.io/service/6083/uGzVfgaE.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (665, '2020-06-24 19:14:53', '2020-06-24 19:14:53', null, 'WebRTC', 'webrtc', 'It is a free, open project that enables web browsers with Real-Time Communications (RTC) capabilities via simple JavaScript APIs. The WebRTC components have been optimized to best serve this purpose.', 'https://img.stackshare.io/service/2262/xDgK1jYK_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (666, '2020-06-24 19:14:57', '2020-06-24 19:14:57', null, 'Kurento', 'kurento', 'It is a WebRTC media server and a set of client APIs making simple the development of advanced video applications for WWW and smartphone platforms. Media Server features include group communications, transcoding and more.', 'https://img.stackshare.io/service/7203/tCy3gJSp_400x400.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (667, '2020-06-24 19:15:01', '2020-06-24 19:15:01', null, 'Jami', 'jami', 'It is a free software for universal communication which respects
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (668, '2020-06-24 19:15:06', '2020-06-24 19:15:06', null, 'Google Meet', 'google-meet', 'It is the business-oriented version of Google''s Hangouts platform and is suitable for businesses of all sizes. It allows users to dial in phone numbers to access meetings, thus enabling users with slow internet connection to call in.', 'https://img.stackshare.io/service/8683/246x0w.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (669, '2020-06-24 19:15:40', '2020-06-24 19:15:40', null, 'Hangouts', 'hangouts', 'It is a communication platform which includes messaging, video chat, and VOIP features.', 'https://img.stackshare.io/service/5828/Hangouts_Icon.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (670, '2020-06-24 19:15:49', '2020-06-24 19:15:49', null, 'CapRover', 'caprover', 'It is an extremely easy to use app/database deployment & web server manager for your NodeJS, Python, PHP, ASP.NET, Ruby, MySQL, MongoDB, Postgres, WordPress (and etc...) applications!
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (671, '2020-06-24 19:15:53', '2020-06-24 19:15:53', null, 'AppFog', 'appfog', 'AppFog provides the infrastructure web developers need to build apps without worrying about IT tasks or having to wait days to get servers ready for writing code. AppFog’s web application technologies include PHP, NodeJS, Ruby, Python, Java, .NET, MySQL, and PostgreSQL.', 'https://img.stackshare.io/service/137/avatar.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (672, '2020-06-24 19:15:58', '2020-06-24 19:15:58', null, 'Red Hat OpenShift', 'red-hat-openshift', 'OpenShift is Red Hat''s Cloud Computing Platform as a Service (PaaS) offering. OpenShift is an application platform in the cloud where application developers and teams can build, test, deploy, and run their applications.', 'https://img.stackshare.io/service/197/854d85d0c77271af224b455f81b5fc88.png', 'https://github.com/openshift/origin-server', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (673, '2020-06-24 19:16:06', '2020-06-24 19:16:06', null, 'CloudBees', 'cloudbees', 'Enables organizations to build, test and deploy applications to production, utilizing continuous delivery practices. They are focused solely on Jenkins as a tool for continuous delivery both on-premises and in the cloud. ', 'https://img.stackshare.io/service/136/o-p1F0I9_400x400.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (674, '2020-06-24 19:16:11', '2020-06-24 19:16:11', null, 'Engine Yard Cloud', 'engine-yard-cloud', 'The Engine Yard Platform as a Service (PaaS) is a product family that leverages open source technologies to orchestrate and automate the configuration, deployment and management of applications on multiple infrastructures.', 'https://img.stackshare.io/service/134/kT489xVY.jpg', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (675, '2020-06-24 19:16:28', '2020-06-24 19:16:28', null, 'PostGraphile', 'postgraphile', 'Execute one command (or mount one Node.js middleware) and get an instant high-performance GraphQL API for your PostgreSQL database', 'https://img.stackshare.io/service/4991/postgraphile.optimized.square.png', 'https://github.com/graphile/postgraphile', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (676, '2020-06-24 19:16:49', '2020-06-24 19:16:49', null, 'Atlas', 'atlas', 'Atlas is one foundation to manage and provide visibility to your servers, containers, VMs, configuration management, service discovery, and additional operations services.', 'https://img.stackshare.io/service/2112/atlas.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (677, '2020-06-24 19:16:53', '2020-06-24 19:16:53', null, 'MongoDB Atlas', 'mongodb-atlas', 'MongoDB Atlas is a global cloud database service built and run by the team behind MongoDB. Enjoy the flexibility and scalability of a document database, with the ease and automation of a fully managed service on your preferred cloud.', 'https://img.stackshare.io/service/5739/atlas-360x360.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (678, '2020-06-24 19:16:58', '2020-06-24 19:16:58', null, 'AWS Lambda', 'aws-lambda', 'AWS Lambda is a compute service that runs your code in response to events and automatically manages the underlying compute resources for you. You can use AWS Lambda to extend other AWS services with custom logic, or create your own back-end services that operate at AWS scale, performance, and security.', 'https://img.stackshare.io/service/1909/aws-lambda.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (679, '2020-06-24 19:17:52', '2020-06-24 19:17:52', null, 'MobX', 'mobx', 'MobX is a battle tested library that makes state management simple and scalable by transparently applying functional reactive programming (TFRP). React and MobX together are a powerful combination. React renders the application state by providing mechanisms to translate it into a tree of renderable components. MobX provides the mechanism to store and update the application state that React then uses.', 'https://img.stackshare.io/service/5302/17475736.png', 'https://github.com/mobxjs/mobx', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (680, '2020-06-24 19:18:00', '2020-06-24 19:18:00', null, 'Redux Observable', 'redux-observable', 'It allows developers to dispatch a function that returns an observable, promise or iterable of action(s). Compose and cancel async actions to create side effects and more.', 'https://img.stackshare.io/no-img-open-source.png', '', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (681, '2020-06-24 19:18:04', '2020-06-24 19:18:04', null, 'Effector', 'effector', 'It is an effective multi-store state manager for Javascript apps, that allows you to manage data in complex applications.', 'https://img.stackshare.io/service/11025/xajEXm5c_400x400.png', 'https://github.com/zerobias/effector', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (682, '2020-06-24 19:18:25', '2020-06-24 19:18:25', null, 'reselect', 'reselect', 'Simple “selector” library for Redux (and others) inspired by getters in NuclearJS, subscriptions in re-frame and this proposal from speedskater.', 'https://img.stackshare.io/service/7757/13142323.png', 'https://github.com/reduxjs/reselect', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (683, '2020-06-24 19:18:30', '2020-06-24 19:18:30', null, 'vuex', 'vuex', 'Vuex is a state management pattern + library for Vue.js applications. It serves as a centralized store for all the components in an application, with rules ensuring that the state can only be mutated in a predictable fashion. It also integrates with Vue''s official devtools extension to provide advanced features such as zero-config time-travel debugging and state snapshot export / import.', 'https://img.stackshare.io/service/6705/6128107.png', 'https://github.com/vuejs/vuex', '', '', '');
INSERT INTO db.stacks (id, created_at, updated_at, deleted_at, name, slug, description, image, git_url, fork, star, watch) VALUES (684, '2020-06-24 19:18:38', '2020-06-24 19:18:38', null, 'Adobe Illustrator', 'adobe-illustrator', 'The industry-standard vector graphics app lets you create logos, icons, sketches, typography, and complex illustrations for print, web, interactive, video, and mobile.', 'https://img.stackshare.io/service/3175/adobe-illustrator.png', '', '', '', '');
